(1, 6, '2014-02-14 06:41:49', '2014-02-14 06:41:49', 'Nobody likes change, habits, and routines, set mental models inevitable set in. Changes causes disruptions to one’s life, no matter how tiny can be annoying and inconvenient. Yet, there are changes happening every second.  Changes in our society, our environment, our organizations, and even our dearly held social relationships are happening sometimes unbeknownst to our perception. So, how can we reap the benefits from the momentum of engaging in multiple transitions?\r\n\r\nWhat can we learn from people who thrive on change?  How can we thrive in transition? Our study of significant life changes and how they changed lives, informed us that there are 3 mechanisms at work.  First, the dialectical cycling of goal-setting and sensemaking/sensegiving when one encounters ‘newness’; new job, new circumstance, new relationships.  No matter how often we think we are ready to take on changes, each transition often offers surprising elements.  The second is the generative mechanism offering individuals a platform to question our assumptions and world views, gaining insights into ourselves, about our social relationships as well as gaining confidence in positioning the change as a beneficial experience.  The third is a self-regulatory, evaluative gauge to compare us in our new environments, and adjustments, adaptation or perhaps a complete renewal or transformation of ourselves starts to take place.\r\n\r\nSome people are habituated in ‘transitioning’ therefore their ‘transition muscle’ works on a daily basis.  There are three things I suggest you do in the next 24 hours to start developing these ‘transition muscles’.\r\n<p style="text-align: left;">1) In order to test out dialectic goal setting-sensemaking/giving, go to work / school/ wherever you normally go via an alternative route.</p>\r\n<p style="text-align: left;">2) Observe one surprising element of your new route that confirms your preference for the normal route and discover one element that may sway you to start using the alternative route</p>\r\n<p style="text-align: left;">3) Ask yourself how a change of scenery on your commute has been pleasurable in some way, despite the inconvenience.</p>\r\n<p style="text-align: center;"><strong>..Happy Trails..</strong></p>\r\n<img id="irc_mi" class="irc_mut" style="margin-top: 20px;" src="http://www.landthink.com/wp-content/uploads/happy_trails.jpg" alt="" width="889" height="308" />', 'Transitions offer great opportunities', '', 'publish', 'open', 'closed', '', 'transitions-offer-great-opportunities', '', '', '2015-01-17 12:04:53', '2015-01-17 12:04:53', '', 0, 'http://kissaah.org/webroot/blog/?p=1', 0, 'post', '', 0),
