(13, 6, '2014-02-19 04:07:16', '2014-02-19 04:07:16', '<h3><span style="color: #0c63a2;">Meet the Kissaah Advisory Team</span></h3>\r\n\r\n<span style="color: #353535;"><font style="font-size:14px">Our Advisory team consists of some of the best minds in the fields related to our work, specialising in business development, business start-ups, marketing and academia.</span></font>\r\n\r\n[tw_team height=270]', 'Advisors', '', 'publish', 'closed', 'closed', '', 'advisors', '', '', '2015-07-27 23:12:06', '2015-07-27 23:12:06', '', 0, 'http://kissaah.org/webroot/blog/?page_id=13', 2, 'page', '', 0),
