(10, 6, '2014-02-19 04:05:06', '2014-02-19 04:05:06', '<h2><span style="color: #0c63a2;">Who are we?</span></h2>\r\n<span style="color: #000;"><span style="font-size: 16px;">We live in a world filled with volatility, uncertainty, complexity andambiguity, VUCA. Nathan Bennett, a Professor at Georgia State University wrote an HBR article about how to identify and prepare for living in a newly found VUCA world.  Our company was founded upon the aspiration to help as many people as possible to increase one’s probability of attaining and sustaining eudaimonia through understanding more about who we are and what we want. Another words, we help people thrive in the age of flux.  The services we offer are designed to transform the way we look at change, engaging in transition towards purpose, meaning and alignment in our every day existence. We develop and market to a community of individuals, organizations and communities experiencing transitions; providing a trusted, fun and engaging platform of tools and services aimed at reducing uncertainty, ambiguity and the general discomfort with the experience of transitions.  An online, longitudinal and scalable approach to plan, to connect and to progress towards thriving; by perpetuating self-discovery, analysis and expression; externalizing and socializing an often internal dialogue.</span></span>\r\n\r\n<span style="color: #000;"><span style="font-size: 16px;">Our mission is to help build an engine of human growth through a robust community of users who are interested in self-improvement/development; looking for challenges to fulfill one’s potential but at the same time, happy and willing to aid in others journeys.</span></span>\r\n<h2><span style="color: #0c63a2;">What we do?</span></h2>\r\n<span style="color: #000;"><span style="font-size: 16px;">Kissaah is an online platform that will prompt you to become aware of and evaluate your strengths and values, and define your dreams, goals, and aspirations. It is a community in which you will be linked with like-minded others to spark a shared passion or drive, as well as have the ability to get connected with experienced mentors who can give insight into your areas of interest.</span></span>\r\n\r\n<span style="color: #000;"><span style="font-size: 16px;">With increased input into Kissaah by users, the application will provide cohesive and insightful feedback, perpetuating a journey of discovery and self-expression in a safe environment; by supplying some of the pieces of the puzzle of which the path to goals are built.</span></span>\r\n\r\n<span style="color: #000;"><span style="font-size: 16px;">Kissaah utilizes the Appreciative Inquiry Process of Discover, Dream, Design and Deliver to help create an online and real-world society which sustains and attains human flourishing, also known as ''Eudaimonia'', and we are passionate about helping as many people as possible to flourish through using Kissaah.</span></span>\r\n\r\n<span style="color: #000;"><span style="font-size: 16px;">Kissaah serves a community of individuals whose desire is to seek opportunities and curate a path towards that is well-attuned to their strengths, values, passions, purpose, and intentions.</span></span>\r\n<span style="color: #353535;"><span style="font-size: 18px;">In the world work, Kissaah can nurture organizations to construct habitats in which employees are motivated and rewarded for fulfilling their potential to flourish, for organizations and communities to thrive.</span></span>\r\n<p style="text-align: center;"><span style="color: #0c63a2;"><span style="font-size: 16px;">Check out our video to find out more about Kissaah!</span></span></p>\r\n<iframe src="//player.vimeo.com/video/107238044" width="400" height="181" frameborder="0" allowfullscreen="allowfullscreen"></iframe>\r\n\r\n&nbsp;\r\n\r\n<a href="http://kissaah.com/wp-content/uploads/KissaahWorldMap2.png"><img class="alignright size-full wp-image-2186" src="http://kissaah.com/wp-content/uploads/KissaahWorldMap2.png" alt="KissaahWorldMap2" width="646" height="336" /></a>\r\n\r\n<span style="color: #0b649e;"><span style="font-size: 18px;">Kissaah has users in over 24 countries including</span></span>\r\n<ul>\r\n	<li style="font-size: 18px;">UK</li>\r\n	<li style="font-size: 18px;">USA</li>\r\n	<li style="font-size: 18px;">Singapore</li>\r\n	<li style="font-size: 18px;">India</li>\r\n	<li style="font-size: 18px;">Hong Kong</li>\r\n</ul>\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2015-07-28 19:42:08', '2015-07-28 19:42:08', '', 0, 'http://kissaah.org/webroot/blog/?page_id=10', 1, 'page', '', 0),
