(138, 5, '2015-07-20 04:53:38', '2015-07-20 04:53:38', 'At the Weatherhead School of Mgt at Case Western Reserve University, David and his team at <a href="https://weatherhead.case.edu/centers/fowler/about/">The Fowler Center</a> is advancing the scholarship and practice of flourishing enterprises. Appreciative Inquiry is a transformative evolutionary method of seeking whole system positive change.', 'Prof. of Entrepreneurship Weatherhead School of Mgt', '', 'publish', 'closed', 'closed', '', 'david-cooperrider', '', '', '2015-07-30 22:41:08', '2015-07-30 22:41:08', '', 0, 'http://blog.kissaah.com/?post_type=tw_team&#038;p=138', 0, 'tw_team', '', 0),
(53, 6, '2014-03-03 17:30:33', '2014-03-03 17:30:33', '“Being happy” seems altogether an innocuous desire contemporary of our times.  Sense of well being has been a pursuit of philosophers, economists, politicians, scholars and scientists for thousands of years. (Myers &amp; Diener, 1995) On one hand the Roman philosopher Cicero said, “A happy life consists of tranquility of mind”, but on the other hand, Greek philosopher Aristippus taught that the goal of life is to maximize pleasure, and that happiness is the totality of one’s hedonic moments.\r\n\r\nLiterature found on well being are mainly divided into the two major traditions of inquiry; hedonic and eudaimonic (Ryan &amp; Deci, 2001) Subjective well being falls into the hedonic camp, while Psychological well being is in the eudaimonic camp. Satisfaction in these domains; life, work and relationships, tend to be indicators of subjective well being (Deiner, 1984; Diener, Emmons, Larsen, &amp; Griffin, 1985).  The six dimensions of psychological well being include 1) Autonomy, 2) Environmental Mastery, 3) Personal Growth, 4) Positive Relations With Others, 5) Purpose in Life, and 6) Self-Acceptance. (Keyes, Shmotkin, &amp; Ryff, 2002; Ryan, Huta, &amp; Deci, 2008)\r\n\r\nMy research attempts to understand how to thrive while going through an increasing number of transitions in our modern every day living.  I propose that transitioning, or embracing seismic changes in our lives may serve as a mechanism towards well being or thriving.  My research, therefore seeks to understand the motivation, emotional, cognitive and behavioral conditions that beckon a person’s ability to overcome challenges of engaging in transitions, and experience punctuated thriving at various junctures of their life journey.\r\n\r\nTransition is a time when one suspends routinized mode of life and engage with the ‘new’ in their circumstance or environment.  During this period, there are numerous occasions to evaluate and devise a plan of action and formulate behavioral strategies.  It is an opportunity to gauge our actions against our moral compass, our value system and prepare oneself towards managing transformation of self as we define and refine a future in these new circumstances. In the next paragraphs, I hope to invite a conversation on how thriving in transition should be viewed as a mechanism towards thriving.  Unfortunately the reluctance to change often overshadows this great window into self, morphing of self in relation to our dynamic environments.\r\n\r\nFirst, let us discuss a virtue-based reasoning for action during a transition.  According to Aristotle, living a life of virtue is society’s highest good.  If we obliged ourselves to make decisions during a time of transition based on virtue, we have a chance to design our future based on the value we place on doing the right things.  As modernity has offered an increased chance of engaging in multiple transitions, we have a chance to strive towards a life of virtuous living.\r\n\r\nSecond, what guides us in our action can also be rule-based.  Kant spoke about the moral principles that guide action, and they are absolute, invariable and must be followed, otherwise dire consequences will be imposed upon individuals and affecting well being of the society(Kant, 1949). Value systems often form the core foundation of our moral compass.  For example, at the time of a major transition, if our action is based on a strong sense of value guiding our behavior and attitude; act and react to our ‘new normal’ within the framework of our value system, we leverage the opportunity of a transition to better align our actions with our value system.\r\n\r\nWhen we encounter a transition, especially a second-order change that requires us to shake our assumptive worldviews, an ends-based logic is sometimes applied. Jeremy Bentham says that a good society is built upon the maximization of subjective well being, a rather hedonic view of attaining pleasure and maximization of one’s hedonic moments. He developed the Felicific calculator in that vein, Bentham fully embraced ethical utilitarianism(Lapidus &amp; Sigot, 2000).  The ends-based approach can yield a spectrum of results ranging from flourishing to languishing in transition. Given that we construct an ‘end’ through a thorough reflective process, we can leverage new circumstances in a transition to yield positive outcomes. However, if we are mindless in attaining an‘end’ without much thought or reasoning, then these actions may result in unintended consequences.\r\n\r\nThese three logical reasoning behind our action may individually provide a platform that helps us thriving in transitions; however, I propose a portfolio approach using all three may yield the best results.  For example, one stands to thrive in their new community by refining their contribution driven by virtue, aligned with their value system, and  ‘an end’ designed with purpose, meaning and impact.\r\n\r\nChange is inevitable, change is also hard; therefore is it not a good idea for us to utilize the power of virtue, rule and ends based logic to engineer ourselves in the face of our ‘new normal?\r\n\r\n<img class="irc_mut" id="irc_mi" style="margin-top: 51px;" alt="" src="http://www.fao.org/docrep/007/j0902e/j0902e06.jpg" width="500" height="292" />', 'Ethical framing for happiness', '', 'publish', 'open', 'closed', '', 'ethical-framing-for-happiness', '', '', '2014-05-20 00:41:32', '2014-05-20 00:41:32', '', 0, 'http://kissaah.org/blog/?p=53', 0, 'post', '', 0),
