INSERT INTO `org_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(60, 5, '2014-03-21 10:18:26', '2014-03-21 10:18:26', 'Kissaah allows users to create a interactive, personalized roadmap that encourages:\r\n<ol>\r\n	<li>Self-awareness</li>\r\n	<li>Identifies real-world resources to help you</li>\r\n	<li>Generates an individualized action plan to reach your goals</li>\r\n</ol>\r\nYou can share your roadmap for further input from friends, family, colleagues and mentors.\r\n\r\nBefore getting started...Please locate the following images:\r\n<ul>\r\n	<li>3 images that represent what inspires you</li>\r\n	<li>1 image of someone you admire - a superhero or role model</li>\r\n	<li>3 images that represent your goals 3-5 years from now</li>\r\n	<li>3 images that represent paths that may take you to these goals</li>\r\n</ul>\r\nGood sources of images may come from Google searches, or existing photos from your Facebook, Instagram, Pinterest or photo library.\r\n\r\nThese are building blocks to develop your roadmap in Kissaah.\r\n\r\nSave them to a folder on your desktop for easy access during the game.\r\n\r\nDon''t forget!\r\nPlease go into Settings to upload your profile photo and manage your Kissaah account. Scroll to the bottom of the window, and you will find settings on the lower right corner.', 'Instructions', '', 'publish', 'closed', 'closed', '', 'instructions', '', '', '2015-01-01 04:13:42', '2015-01-01 04:13:42', '', 1624, 'http://blog.kissaah.org/?page_id=60', 1, 'page', '', 0),
(95, 5, '2014-06-09 08:55:41', '2014-06-09 08:55:41', '<p style="text-align: center;">Hi there! Thank you for joining Kissaah and the Kissaah Community. We''d love to show you around.</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Start tour</a>\r\n<a class="btn btn-primary tourbus-stop">No thanks, no tour needed</a></div>', 'Tour-Step-01', '', 'draft', 'closed', 'closed', '', 'tour-step-01', '', '', '2015-03-03 02:10:12', '2015-03-03 02:10:12', '', 0, 'http://blog.kissaah.org/?p=95', 0, 'post', '', 0),
(97, 5, '2014-06-09 08:56:03', '2014-06-09 08:56:03', '<p style="text-align: center;">This is your homepage. It features your Roadmap, downloadable content for sharing, your allies, achievements and more.</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-02', '', 'draft', 'closed', 'closed', '', 'tour-step-02', '', '', '2015-03-02 12:16:08', '2015-03-02 12:16:08', '', 0, 'http://blog.kissaah.org/?p=97', 0, 'post', '', 0),
(104, 5, '2014-06-11 06:19:40', '2014-06-11 06:19:40', '<p style="text-align: center;">Your RoadMap is divided into 4 quarters. Each section will ask you to upload pictures and answer thought-provoking questions about your life to help you achieve your goals and thrive in times of change. Go ahead, click on this quadrant here.</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-03', '', 'draft', 'closed', 'closed', '', 'tour-step-03', '', '', '2015-03-03 02:04:56', '2015-03-03 02:04:56', '', 0, 'http://blog.kissaah.org/?p=104', 0, 'post', '', 0),
(106, 5, '2014-06-11 06:20:30', '2014-06-11 06:20:30', '<p style="text-align: center;">You can upload pictures from your Pinterest or Instagram profile in these areas. If you don''t have these profiles, don''t worry. You can always upload the pictures you want easily from your computer.</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-04', '', 'draft', 'closed', 'closed', '', 'tour-step-04', '', '', '2015-03-02 12:31:12', '2015-03-02 12:31:12', '', 0, 'http://blog.kissaah.org/?p=106', 0, 'post', '', 0),
(108, 5, '2014-06-11 06:21:27', '2014-06-11 06:21:27', '<p style="text-align: center;">When you''re done populating each area with your thoughts and pictures, just press ''Save and Close'' to move on in your RoadMap. All your things will automatically save.</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-05', '', 'draft', 'closed', 'closed', '', 'tour-step-05', '', '', '2015-03-05 06:12:47', '2015-03-05 06:12:47', '', 0, 'http://blog.kissaah.org/?p=108', 0, 'post', '', 0),
(110, 5, '2014-06-11 06:22:03', '2014-06-11 06:22:03', '<p style="text-align: center;">Every time you complete a section of your RoadMap, these dots will change colour, like this one</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-06', '', 'draft', 'closed', 'closed', '', 'tour-step-06', '', '', '2015-10-02 07:18:40', '2015-10-02 07:18:40', '', 0, 'http://blog.kissaah.org/?p=110', 0, 'post', '', 0),
(112, 5, '2014-06-11 06:22:42', '2014-06-11 06:22:42', '<p style="text-align: center;">These quadrants have been specifically designed to help you thrive in a time of change, and reach our goals for a happier life through Discovering, Dreaming, Designing and Delivering. Take some time to check each quadrant out to familiarise yourself</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-07', '', 'draft', 'closed', 'closed', '', 'tour-step-07', '', '', '2015-03-03 01:48:14', '2015-03-03 01:48:14', '', 0, 'http://blog.kissaah.org/?p=112', 0, 'post', '', 0),
(114, 5, '2014-06-11 06:23:59', '2014-06-11 06:23:59', '<p style="text-align: center;">This toolbar is really useful. Here you can export your RoadMap to your computer, make notes to yourself and even email those notes to yourself so you don''t forget.</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-08', '', 'draft', 'closed', 'closed', '', 'tour-step-08', '', '', '2015-03-03 02:00:42', '2015-03-03 02:00:42', '', 0, 'http://blog.kissaah.org/?p=114', 0, 'post', '', 0),
(116, 5, '2014-06-11 06:24:38', '2014-06-11 06:24:38', '<p style="text-align: center;">You can also add Allies and give your Allies feedback about their RoadMaps.</p>\n\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-09', '', 'draft', 'closed', 'closed', '', 'tour-step-09', '', '', '2015-10-02 07:17:37', '2015-10-02 07:17:37', '', 0, 'http://blog.kissaah.org/?p=116', 0, 'post', '', 0),
(118, 5, '2014-06-11 06:25:19', '2014-06-11 06:25:19', '<p style="text-align: center;">You can also create a second or third RoadMap for other areas of your life. For instance, one RoadMap might be used to help you achieve goals in your work-life, while other goals may be specific to your life as a student. Just click here to generate a new, second RoadMap.</p>\r\n\r\n<div class="margin-top-10"><a class="btn btn-primary pull-right tourbus-next">Next</a>\r\n<a class="btn btn-primary tourbus-prev">Step Back</a></div>', 'Tour-Step-10', '', 'draft', 'closed', 'closed', '', 'tour-step-10', '', '', '2015-03-03 02:06:30', '2015-03-03 02:06:30', '', 0, 'http://blog.kissaah.org/?p=118', 0, 'post', '', 0),
