(199, 6, '2014-10-15 15:20:40', '2014-10-15 15:20:40', '<strong>PLEASE READ THIS PRIVACY POLICY CAREFULLY BEFORE USING THIS WEBSITE</strong>\r\n\r\nEudaimon Corporation and its affiliated companies (together, “Eudaimon”) is committed to protecting your online privacy while you use our website at <a href="http://www.kisaah.com">www.Kissaah.com</a> (the “Website” or “Kissaah”) and related services (collectively, the “Service”). We urge you to read the Privacy Policy in its entirety so you will understand all of the practices and procedures we follow relating to your online privacy. In this Privacy Policy, Eudaimon will inform you about the type of information that is collected about you on this Website, how it is collected, what it will be used for, and to whom it will be given. This policy will also tell you how to limit our use of your personal information.\r\n\r\nAs Eudaimon evolves, we may need to update this Policy to keep pace with changes in the Service, our business and laws applicable to you; and us. We will, however, always maintain our commitment to respect your privacy. We will post any revisions to this Policy, along with their effective date, in an easy to find area of our web site, so we recommend that you periodically check back here to stay informed of any changes.\r\n\r\nThis Privacy Policy is incorporated into the Eudaimon Terms of Service and certain capitalized terms are defined in the Terms of Service.\r\n\r\n<strong>What Kind of Information Eudaimon Collects</strong>\r\n\r\nEudaimon reserves the following rights regarding the information you submit:\r\n<table width="455">\r\n<tbody>\r\n<tr>\r\n<td width="239"><strong>Type of Information</strong></td>\r\n<td width="216"><strong>How and Why We Use It</strong></td>\r\n</tr>\r\n<tr>\r\n<td width="239">Your username, email address, Facebook contact credentials (if provided) Gender, Date of Birth and Current Location</td>\r\n<td width="216">\r\n<ul>\r\n	<li>To create and support your Kissaah Service account.</li>\r\n	<li>To communicate with you.</li>\r\n	<li>To respond to your specific requests.</li>\r\n</ul>\r\n&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width="239">A list of your allies and action plan tasks, material you submit pertaining to the process of the Kissaah game (e.g. images, videos, text as well as other media formats)</td>\r\n<td width="216">\r\n<ul>\r\n	<li>To enable social functions within Kissaah.</li>\r\n	<li>To facilitate goal setting and task management functions.</li>\r\n	<li>To organize and share Vision Boards.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="239">Information about your home server, IP addresses, web browser, and computer system&nbsp;</td>\r\n<td width="216">\r\n<ul>\r\n	<li>To provide account support.</li>\r\n	<li>To calculate aggregated, anonymous statistics on users of the Service.</li>\r\n	<li>To better operate our Website.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="239">Your location and calendar information – (if you elect to share it)</td>\r\n<td width="216">\r\n<ul>\r\n	<li>To enhance your experience as a user</li>\r\n	<li>To administer the Service and improve the features and usability of the Service.</li>\r\n	<li>To suggest to you Eudaimon features, products and services that can enhance your use of the Service.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="239">Non-personally identifiable information regarding what pages of the Website you choose to access&nbsp;</td>\r\n<td width="216">\r\n<ul>\r\n	<li>For analytics, targeting, monitoring, marketing, demographic, and promotional purposes as well as to assist us in customizing the content of our Website.</li>\r\n	<li>To produce statistical and/or demographic data for use by advertisers, potential advertisers, and other business partners and affiliates.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="239">Other requests you make (e.g. to export or share your Roadmap)</td>\r\n<td width="216">\r\n<ul>\r\n	<li>To fulfill that specific request.</li>\r\n</ul>\r\n&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width="239">Contents of your Roadmaps, including personal information(As a rule, Eudaimon employees do not monitor or review your Roadmaps.)\r\n\r\n&nbsp;</td>\r\n<td width="216">\r\n<ul>\r\n	<li>If we believe our Terms of Service have been violated and confirmation is required.</li>\r\n	<li>If we need to do so in order to respond to your requests for support.</li>\r\n	<li>By detecting certain actions you take in your account (such as emailing content into your account) or specific attributes associated with your Roadmaps (such as whether your Vision Board contain PDFs or image files, or which application you use to create Roadmaps), we may use that information to suggest products or features to you that we think will help you get the most out of our Service.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="239">Content posted to public portions of the Website(Certain portions of the Website, such as shared data with designated allies or in Challenges and our user forum, are open to any online viewer when you elect to allow us to share it publicly.)</td>\r\n<td width="216">\r\n<ul>\r\n	<li>Any information that you post in these locations can be read, collected and used by anyone and could enable others to send you unsolicited messages.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n<table width="457">\r\n<tbody>\r\n<tr>\r\n<td width="457">We Only Share Your Personally Identifiable Information When:</td>\r\n</tr>\r\n<tr>\r\n<td width="457">\r\n<ul>\r\n	<li>You have provided your explicit consent to share the information.</li>\r\n	<li>We are required by law to provide your information or we find that your actions on our Website violate our Terms of Use agreement to the extent that an outside investigation in warranted.</li>\r\n	<li>We believe doing so is necessary to protect the rights, property or personal safety of Eudaimon and its users.</li>\r\n	<li>We sell or otherwise transfer such information to a successor or subsidiary of Eudaimon.</li>\r\n	<li>We use a third party subcontractor with its own secure privacy practices, e.g. for mailing list services.</li>\r\n</ul>\r\n<strong>We will never sell or rent your personally identifiable information. We do not read or share the contents of your Roadmaps with anyone for any advertising purposes.</strong>\r\n\r\nWe vigilantly protect the privacy of your Kissaah account and, whenever we determine it possible, we provide you with notice if we believe we are compelled to comply with a third party’s request for information.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\nSharing Information with Other Users\r\n\r\nWhen you share information with another User (including, without limitation, on the Website’s User Forum) Eudaimon cannot control the nature of the information shared. Eudaimon prohibits sharing personally identifiable information and any such communication is done at your own risk. Communications between Users are not encrypted.\r\n\r\nUse caution and common sense when posting publicly. Eudaimon is not responsible for any publication or use of any personal information you choose to post in these locations.\r\n\r\nEUDAIMON AND ITS AFFILIATES SHALL NOT BE LIABLE FOR ANY DAMAGES, IRRESPECTIVE OF THEIR NATURE, INCURRED BY YOU IN CONNECTION WITH INFORMATION YOU DISCLOSE TO A THIRD PARTY INCLUDING A USER.\r\n\r\n<strong>Security</strong>\r\n\r\nWe take the security of all personally identifiable information obtained through the Website seriously. Only those who require such information to serve the purposes described above may access it.\r\n\r\nWe use industry standard encryption, e.g. transport layer security (“TLS”) or secure socket layer (“SSL”) technology. When we receive your data, we protect it on our servers using a combination of administrative, physical and logical security safeguards.\r\n\r\nWhile the acts of third parties are not within our control and 100% security can never be guaranteed, one can reduce risks by using strong passwords and anti-virus software. We recommend that you take the appropriate steps to secure all computing devices that you use with the Service.\r\n\r\n<strong>Cookies</strong>\r\n\r\nA "cookie" is a small file sent from a web server to your browser and is stored on your computer’s hard drive when you visit certain websites and applications to save visitor preferences and other information. You can configure your browser to refuse cookies. We reserve the right to use cookies on the Website. If you have any questions concerning our use of cookies, please contact us at support@kissaah.com.\r\n\r\n<strong>Opting-Out</strong>\r\n\r\nYou may opt-out of having your personal information collected or used by contacting us by e-mail or regular mail. Please note that in order to fulfill certain obligations, we may need to continue sending you notices or other important information concerning any orders or services you request.\r\n\r\nWe consider your registration on the site and acceptance of this Privacy Policy as granting us the right to contact you by email. You may opt out of emails at any time by clicking the “unsubscribe” link found within Eudaimon email updates or by contacting us at support@kissaah.com.\r\n\r\n<strong>Deleting Information</strong>\r\n\r\nYou can delete Content you have posted to the Website at any time, and you can stop using the Service at any time. If you delete information and material from Kissaah.com, it will no longer be accessible to you or others who may access the Service, but residual copies of your deleted Content may continue to exist on the back-up and archiving systems for up to one year due to the nature of those systems’ operations and may remain searchable for a longer period due to the nature of search engine archives. Data previously shared, in the course of using our Services cannot be deleted, as the media may reside outside of our Service.\r\n\r\n<strong>Requesting to See Your Personal Information</strong>\r\n\r\nYou may request via e-mail or regular mail that we provide you with the personal information we have concerning you. Once you receive this information, you may request that we modify or remove any of your personal information. We reserve the right to verify your identity before sending you this information.\r\n\r\n<strong>Links to Other Apps</strong>\r\n\r\nOur Website may contain links to other websites and/or applications. We encourage our partners, contributors and other third parties to implement policies and practices that respect your privacy. We are not, however, responsible for third party privacy practices or content.\r\n\r\nThird parties may embed content or plugins on the Website, such as Facebook “Like” buttons. Such features may allow their operators to learn that you have visited the Website, and they may combine this information with other information they have collected about you from other websites or online services. Please refer to those sites privacy policies.\r\n\r\nEudaimon SHALL NOT BE LIABLE FOR ANY DAMAGES, IRRESPECTIVE OF THEIR NATURE, INCURRED BY YOU IN CONNECTION WITH THE USE OR NON-USE OF THIRD PARTY CONTENT.\r\n\r\n<strong>California Online Privacy Protection Act Compliance and Do Not Track browser signals</strong>\r\n\r\nBecause we value your privacy we have taken the necessary precautions to be in compliance with the California Online Privacy Protection Act. We currently do not actively respond to Do Not Track browser signals and do not authorize the collection of personal information from users through technologies deployed in advertising on the site.\r\n\r\n<strong>Access to Children</strong>\r\n\r\nThere are no features of this Website directed to children under the age of 13. Those under 13 may not use any interactive features of this Website.\r\n\r\n<strong>Changes to This Privacy Policy</strong>\r\n\r\nWe reserve the right to change this policy at any time to keep pace with changes in Kissaah, our business the law. We will post any revisions to this Policy, along with their effective date, in a prominent area of our Website. We ask that you check back from time to time to ensure you are familiar with the most current version of it. Your continued use of your account after any change means that you agree with, and consent to be bound by, the updated Privacy Policy. If you disagree with any changes in this Policy you have the option to terminate your account.\r\n\r\n<strong>Contact Us</strong>\r\n\r\nEudaimon has appointed an officer, Victoria Woo, who is accountable for the compliance with these privacy principles and can answer any questions you may have. You may contact by e-mail at support@kissaah.com and regular mail at 5 E. Manor Drive, Mill Valley, California 94941 USA\r\n\r\n<strong>Jurisdiction and Data Storage</strong>\r\n\r\nPlease be aware that content submitted to Eudaimon will be transferred to a data center in the United States. If you post information to the Website you are confirming your consent to such information being hosted and accessed in the United States. Privacy laws or regulations in your country may differ from those in the United States, where Eudaimon operates from and whose laws govern this Privacy Policy.\r\n\r\n<strong>Acceptance of This Privacy Policy</strong>\r\n\r\nBy using this Website, you agree to the terms as well as any posted changes of this Privacy Policy. By using this Website, you hereby consent to the collection and use of this information by Eudaimon. If you do not agree to the terms, DO NOT use our Website.\r\n\r\nDate of last update: ___Sept 25, 2014___', 'Privacy Policy', '', 'publish', 'closed', 'closed', '', 'privacy-policy', '', '', '2014-12-27 13:48:02', '2014-12-27 13:48:02', '', 1624, 'http://blog.kissaah.com/?page_id=199', 4, 'page', '', 0),
