(783, 6, '2013-07-19 10:49:18', '2013-07-19 10:49:18', '<h2><span style="color: #0c63a2;">Kissaah. Architect your future.\r\n</span></h2>\r\n[tw_sh_column][tw_sh_column_item item_animation="none" item_animation_delay="" column_size="2 / 3"]\r\n\r\nKissaah leverages on-site sessions and technology to connect people, knowledge and ideas, helping individuals engage in a journey of self-reflection by externalizing and organizing experiences, skills and knowledge to open new doors or pathways.\r\n\r\nKissaah is a reflective tool that drives action for individuals and organizations in transition, taking them through a structured and sustained journey from envisioning to accomplishing a collective future. We facilitate the transformation of individuals in a forward-looking and supportive approach that is rooted in academic research.\r\n\r\nKissaah has had life-changing impact on groups in organizations like Coca Cola, the Cleveland Clinic and Stanford University.[/tw_sh_column_item][tw_sh_column_item item_animation="none" item_animation_delay="" column_size="1 / 3"]\r\n\r\n<img class="alignnone wp-image-2557 size-medium" src="http://kissaah.com/wp-content/uploads/Stanford1-300x115.png" alt="Stanford" width="300" height="115" /><img class="alignnone wp-image-2556 size-medium" src="http://kissaah.com/wp-content/uploads/coca-cola1-300x138.jpg" alt="coca-cola" width="300" height="138" />\r\n[/tw_sh_column_item][/tw_sh_column]\r\n<h2><span style="color: #0c63a2;">Kissaah is an unusual word. What does it mean?</span></h2>\r\n<h4><span style="color: #353535;">''Kissaah'' means ''life story'', ''narrative'' or ''tale'' in Sanskrit.</span></h4>\r\n<span style="color: #353535;"><span style="font-size: 16px;">We''ve used this word because we believe that by helping individuals and organizations structure their past, current and future narratives that results in accelerating relationship-building, sparking collective creativity and increase engagement.  </span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;"><strong>We''ve all gone through changes in our lives</strong>. </span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">Kissaah helps mediate the uncertainty, ambiguity and isolation that sometimes make engaging in change difficult and disorienting.\r\n</span></span>\r\n<p style="text-align: left;">[tw_button link="http://kissaah.com/game" size="large" rounded="true" style="border" hover="hover2" color="#00a6e9" target="_blank"]Sign-in or Create an account[/tw_button]</p>\r\n<p style="text-align: left;"><em>(The game is not yet optimized for mobile viewing)</em></p>\r\n[tw_sh_column][tw_sh_column_item item_animation="none" item_animation_delay="" column_size="1 / 3"]<img class="alignnone wp-image-2441 size-medium" src="http://kissaah.com/wp-content/uploads/change-300x300.jpg" alt="change" width="300" height="300" />[/tw_sh_column_item]\r\n[tw_sh_column_item item_animation="none" item_animation_delay="" column_size="1 / 3"]<img class="alignnone wp-image-2440 size-medium" src="http://kissaah.com/wp-content/uploads/build-300x300.jpg" alt="build" width="300" height="300" />[/tw_sh_column_item]\r\n[tw_sh_column_item item_animation="none" item_animation_delay="" column_size="1 / 3"] <img class="alignnone wp-image-2442 size-medium" src="http://kissaah.com/wp-content/uploads/reach-300x300.jpg" alt="reach" width="300" height="300" />[/tw_sh_column_item][/tw_sh_column]\r\n\r\n[tw_sh_column][tw_sh_column_item item_animation="none" item_animation_delay="" column_size="1 / 4"]Are you ready for a more fulfilled life? Listen to Ethan''s Story.\r\n\r\nThere is so much we all want to do and accomplish in life.\r\n\r\nWatch our video of Ethan''s story and be inspired to use Kissaah today to help you live a happier life tomorrow.[/tw_sh_column_item][tw_sh_column_item item_animation="none" item_animation_delay="" column_size="2 / 3"]<iframe src="https://player.vimeo.com/video/107260429" width="440" height="248" frameborder="0" allowfullscreen="allowfullscreen"></iframe>\r\n\r\n<a href="https://vimeo.com/107260429">Ethan''s Story</a> from <a href="https://vimeo.com/kissaah">Kissaah</a> on <a href="https://vimeo.com">Vimeo</a>.\r\n\r\n[/tw_sh_column_item][/tw_sh_column]', 'Homepage', '', 'publish', 'closed', 'closed', '', 'homepage', '', '', '2015-08-04 23:48:09', '2015-08-04 23:48:09', '', 0, 'http://themes.themewaves.com/flatco/?page_id=783', 0, 'page', '', 0),
