(1624, 5, '2014-10-17 05:31:45', '2014-10-17 05:31:45', '<h2>Welcome to Kissaah!</h2>\r\n<h4><b>Kissaah is an unusual word. What does it mean?</b></h4>\r\n<h4><b>''Kissaah'' means ''life story'', ''narrative'' or ''tale'' in Sanskrit.</b></h4>\r\n<span style="color: #0b649e;">We''ve used this word because we believe this is a chance for YOU to tell your story, or tale, and to CHANGE the narrative of your life for the better. Share your story, <i>change</i> your story, and let Kissaah help get you where you want to be.</span>\r\n<h2>Rooted in research</h2>\r\n<span style="color: #0b649e;">We''ve developed Kissaah through our extensive study in how people articulate their life stories to bring about positive change and well-being. Find out more about our research <a href="http://kissaah.com/game-home/references/">here</a>.</span>\r\n\r\n&nbsp;', 'Game', '', 'publish', 'closed', 'closed', '', 'game-home', '', '', '2015-07-28 20:26:07', '2015-07-28 20:26:07', '', 0, 'http://blog.kissaah.com/?page_id=1624', 5, 'page', '', 0),
