(1928, 6, '2015-01-26 16:37:40', '2015-01-26 16:37:40', '&nbsp;\r\n\r\n<a href="http://kissaah.com/wp-content/uploads/OurMissionKissaahBadge.png"><img class=" size-medium wp-image-1993 alignright" src="http://kissaah.com/wp-content/uploads/OurMissionKissaahBadge-300x254.png" alt="OurMissionKissaahBadge" width="300" height="254" /></a>\r\n<h2><span style="color: #0c63a2;">Victoria Woo Ph.D.\r\n</span></h2>\r\n<a href="http://kissaah.com/wp-content/uploads/Victoira-9503.jpg"><img class="alignnone size-medium wp-image-2340" src="http://kissaah.com/wp-content/uploads/Victoira-9503-300x200.jpg" alt="Victoira-9503" width="300" height="200" /></a>\r\n\r\n<span style="color: #000;"><span style="font-size: 16px;"><strong>Chief Thriving Officer &amp; Kissaah Founder</strong></span></span>\r\n\r\nVictoria Woo has 20+ years experience in start-ups and international business development. Kissaah is a methodology aimed at transforming the transition experience which emerged from her academic research and industry experiences.  Victoria''s research focused on how thriving can become a ''normal'' outcome of experiencing change and how we might revise the lexicon and expectations of engaging in transitions.  There is a widely accepted sentiment that a large and growing segment of the developed world experiences life and work in a more dynamic and less predictable way than ever before. Many people, across a wide spectrum of age cohorts, will engage in frequent transitions throughout their lifetimes. Transitions can be opportunities for individuals and organizations to gain clarity and growth.  Kissaah provides structure and future oriented approaches in order to harness the power of transformative transitional experiences. \r\n\r\n<a href="http://kissaah.com/wp-content/uploads/Vic-Bio-July-2015.pdf">Full bio here</a>\r\n\r\n[tw_sh_column][tw_sh_column_item item_animation="none" item_animation_delay="" column_size="1 / 3"]\r\n&nbsp;\r\n<p>Kissaah was founded by Victoria Woo, Ph.D. She created the Kissaah platform as part of her academic research into how people thrive in times of transitions. Check out the video to hear Victoria&#039;s story and what propelled her to create Kissaah.</p>Watch Victoria''s  video about Kissaah[/tw_sh_column_item][tw_sh_column_item item_animation="none" item_animation_delay="" column_size="2 / 3"]<iframe src="https://player.vimeo.com/video/110388026" width="500" height="281" frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe> <p><a href="https://vimeo.com/110388026">Meet the Founder of Kissaah - Victoria&#039;s story</a> from <a href="https://vimeo.com/kissaah">Kissaah</a> on <a href="https://vimeo.com">Vimeo</a>.</p> \r\n\r\n[/tw_sh_column_item][/tw_sh_column]\r\n\r\nVictoria on     <a href="http://www.linkedin.com/in/victoriawoo" target="_blank">Linked In</a>\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Founder', '', 'publish', 'closed', 'closed', '', 'founder', '', '', '2015-09-16 13:00:15', '2015-09-16 13:00:15', '', 0, 'http://kissaah.com/?page_id=1928', 0, 'page', '', 0),
