(2191, 6, '2015-02-02 15:21:50', '2015-02-02 15:21:50', '<span style="color: #45a1c5;"><span style="font-size: 16px;"><strong>What is Appreciative Inquiry?</strong></span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">Appreciative Inquiry is an academic framework which was co-created by David Cooperrider, who is a member of our Advisory Board. Our Founder, Victoria Woo, had been carrying out her PhD at Case Western Reserve University which had a heavy focus on Appreciative Inquiry, which had, in turn, inspired her to create Kissaah so that Appreciative Inquiry could be tranformed from an academic framework into a practical application people could use. Find out more about Appreciative Inquiry here.</span></span>\r\n\r\n<span style="color: #45a1c5;"><span style="font-size: 16px;"><strong>What is ''Eudaimonia''?</strong></span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">Literally translated, Eudaimonia means ''welfare'' or ''happiness'' in Greek. The word Eudaimonia is increasinly usedin academia and used in the context of ''human flourishing''. This word is perfect for our cause, and for our mission, where we hope to help 1,000,000 people reach ''Eudaimonia'' through Kissaah by 2020. Find out more about Eudaimonia here.</span></span>\r\n\r\n<span style="color: #45a1c5;"><span style="font-size: 16px;"><strong>What is a RoadMap?</strong></span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">A RoadMap is your online path towards your ultimate goals within the Kissaah site. Users can create up to three RoadMaps, and each RoadMaps contains four important levels. These levels are Discover, Dream, Design and Deliver. Within each of the four levels of your RoadMap, there are various activities to take part in which will encourage you to reflect on your values and what you enjoy doing, understand the sub-goals to your ultimate goals, develop a strategy to those goals and deliver on those goals. While you are going through your RoadMap, you can also add Allies to help you and you, in turn, can help others towards their goals.</span></span>\r\n\r\n<span style="color: #45a1c5;"><span style="font-size: 16px;"><strong>Why do I have the choice of three RoadMaps?</strong></span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">During our research, and also from our own experiences, we realised that people don''t just have one singular ''road'' in their lives in order to obtain a singular goal. For many men and women, we are increasingly taking on more and more roles in our lives. For those increase in roles that we play, we have different goals. For instance, a working mother may have the role of being a manager in the workplace with the aspiration of gaining a promotion. This woman may also be a mother to children at home and aspire to help them study for school. This woman may also be a daughter who may need to care for her elders and aspire to gain appropriate support and care for them.\r\nFor men, we''re seeing more roles too; to be a dad, a husband, an employee in the workplace, someone who mentors others, someone who also may need to take care of elders. That''s why we have a total of three RoadMaps right now so that no matter your life-roles, you can create a path to a goal in that area of your life AND, also see where there are overlaps in your timelines to reach different goals in the different roles you play in life.\r\nThere have been so many times that we''ve spoken to people during our research who have ideas about what they want to achieve in their personal lives but sadly, the ideal timelines to make those goals happen do not overlap well with work-related goals, or even the goals of a spouse or partner. That''s why the Kissaah RoadMaps are so incredibly useful; not only can you create strategies towards goals, but you can also share those ideas with others and instead of finding problems were there are no parallel overlaps, you can create better timelines with the help of others. Any why three RoadMaps? Our research shows that human beings have only the capacity for up to three different ''roles'' to play in life and any more can be very overwhelming and stressful. By having three RoadMaps, we are encouraging our users to stay within a realistic capacity to achieve their dreams and thrive.</span></span>\r\n\r\n<span style="color: #45a1c5;"><span style="font-size: 16px;"><strong>What are the ways in which I could share my RoadMap with other people?</strong></span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">There are many ways to share your RoadMap within and outside of your Kissaah account. Within the Kissaah account, you can export your RoadMap to a Word document, and then share this on email or you could even use it as part of a CV. You can also view your RoadMap as a digital vision board that you can download as a PDF and share again on email, or even on social media, should you wish to. Some of our users who do not want to share the text they''ve aded into their RoadMap take a screenshot of their RoadMap, which only shows the images and the Thriving Scale. Of course, this can then be shared on email and social media or again, used as part of a CV.\r\nWithin Kissaah, you can easily share your RoadMap by asking an Ally for feedback on it. In turn, you can also provide feedback to an Ally about their RoadMap too. This can be done by simply clicking on the ''Allies Feedback'' icon in your left toolbar. We encourage our users to share their RoadMap with people they trust, who can help to support them and find resources to aid their path towards goals. We also love inspiring the Kissaah Community, so you can share your RoadMap, or aspacts of your RoadMap on our various social media sites! Posting up an incomplete RoadMap may encourage other people to give you ideas about resources and strategies. Posting up completed RoadMaps may inspire others to reach their goals and gain ideas from strategies other people have employed to meet their own goals. Either way, each and every user is involved with making Kissaah the sharing economy we want it to be, so however you chose to share your RoadMap, we hope you can inspire others.</span></span>\r\n\r\n<span style="color: #45a1c5;"><span style="font-size: 16px;"><strong>What is an Ally?</strong></span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">An Ally is a person who you can trust to provide you with the support you need throughout your journey towards a goal in using Kissaah. An Ally could be a parent, spouse, friend or even a teacher at school if you are using Kissaah for Academic Institutions. In the workplace, and Ally could be a trusted colleague or manager. An Ally is there to help you by recommending strategies towards goals, or giving you emotional support, providing useful resources that will ultimately help you thrive and live the life you want. Some Allies are more ''hands-on'' than others; while some Allies can simply recommend a useful book to read, other Allies may be proactive in introducing you to people within their network that can make your dreams a reality. We recommend that our users only become Allies with people they can trust, as sometimes sharing our future-visions can be private, so it''s really important to share your ideas about your future with someone you know truly wants the best for you.</span></span>\r\n\r\n<span style="color: #45a1c5;"><span style="font-size: 16px;"><strong>How many Allies can I add to any Kissaah RoadMap I start?</strong></span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">You can add as many Allies as you wish to each RoadMap however, we know that ''too many cooks in the kitchen can spoil the broth'' so pick your Allies carefully as it''s about quality not quantity. For instance, you could have 500 Allies but they might not be as useful as say, four really supportive Allies who are genuinely aiding your path to your goals.</span></span>', 'Our method', '', 'publish', 'closed', 'open', '', 'faqs', '', '', '2015-07-27 17:38:53', '2015-07-27 17:38:53', '', 10, 'http://kissaah.com/?page_id=2191', 0, 'page', '', 0),
