(2275, 6, '2015-03-05 16:45:23', '2015-03-05 16:45:23', '<span style="color: #353535;"><span style="font-size: 16px;">By Kissaah</span></span>\r\n\r\n<p><span style="color: #353535;"><span style="font-size: 16px;">At Kissaah, we''re so keen on keeping our knowledge fresh in the world of well-being and wellness so we''re very happy that <a href="http://worldbookday.com/" target="_blank">World Book Day </a> (#WBD2015 on Twitter) has come along so we can share our top 5 books with you all!</span></span>\r\n\r\n<p><span style="color: #353535;"><span style="font-size: 16px;"><strong>Our top 5 books are:</strong></span></span>\r\n\r\n<a href="http://kissaah.com/wp-content/uploads/Thrive-Book-Recommendation-by-Kissaah_World-Book-Day-2015.png"><img src="http://kissaah.com/wp-content/uploads/Thrive-Book-Recommendation-by-Kissaah_World-Book-Day-2015-217x300.png" alt="Thrive Book Recommendation by Kissaah_World Book Day 2015" width="217" height="300" class="alignright size-medium wp-image-2280" /></a>1) <span style="color: #353535;"><span style="font-size: 16px;"><a href="http://www.hup.harvard.edu/catalog.php?isbn=9780674059825" target="_blank">The Triumphs of Experience</a> by George Vaillant.</span></span>\r\n\r\n2) <span style="color: #353535;"><span style="font-size: 16px;"><a href="http://www.apa.org/pubs/books/431660A.aspx" target="_blank">Turns in the Road: Narrative Studies of Lives in Transition</a> edited by Dan P. McAdams, PhD, Ruthellen Josselson, PhD, and Amia Lieblich, PhD.</span></span>\r\n\r\n3) <span style="color: #353535;"><span style="font-size: 16px;"><a href="http://thrive.huffingtonpost.com/" target="_blank">Thrive</a> by Arianna Huffington (also downloadable as an iBook <a href="https://itunes.apple.com/us/book/thrive/id717817626?mt=11" target="_blank">here</a>)</span></span>\r\n\r\n4) <span style="color: #353535;"><span style="font-size: 16px;"><a href="http://www.amazon.com/Working-Identity-Unconventional-Strategies-Reinventing/dp/1591394139" target="_blank">Working Identity: Unconventional Strategies for Reinventing Your Career </a>by Herminia Ibarra</span></span>\r\n\r\n5)<span style="color: #353535;"><span style="font-size: 16px;"><a href="http://theinsideouteffect.com/" target="_blank">The Inside-Out Effect: A Practical Guide to Transformational Leadership</a> by Behnam Tabrizi and Michael Terrell</span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">We hope you enjoy these books! Hopefully they will inspire you to thrive in your own times of transition and balance your own well-being with personal and professional responsibilities. Try out our Transition and Thriving Support Tool online today and let Kissaah help you create a RoadMap to your future.</span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">Kissaah takes the academia and science of so many of these books to produce a practical and easy-to-use platform that has been produced from Victoria Woo''s academic research. Victoria Woo is the founder of Kissaah and you can hear her story <a href="https://vimeo.com/110388026" target="_blank">here</a>. </span></span>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">Our RoadMaps, like the one you see below from our Creative Development Director, Betty Adamou, has been created to aid her journey to her goals in her professional life, while she also has a separate RoadMap for her personal career and her voluntary work.</span></span>\r\n\r\n<a href="http://kissaah.com/wp-content/uploads/Betty-adamou-example-RoadMap-Kissaah-2015.png"><img src="http://kissaah.com/wp-content/uploads/Betty-adamou-example-RoadMap-Kissaah-2015-1024x630.png" alt="Betty adamou example RoadMap Kissaah 2015" width="960" height="591" class="aligncenter size-large wp-image-2284" /></a>\r\n\r\n<span style="color: #353535;"><span style="font-size: 16px;">You can sign up to Kissaah for free today! Just click <a href="http://kissaah.com/game/games" target="_blank">here</a> and sign up!</span></span>\r\n\r\n', 'World Book Day - recommendations from Kissaah', '', 'publish', 'closed', 'open', '', 'world-book-day-recommendations-from-kissaah', '', '\nhttps://vimeo.com/110388026', '2015-03-05 17:18:27', '2015-03-05 17:18:27', '', 0, 'http://kissaah.com/?p=2275', 0, 'post', '', 0),
