(2334, 6, '2015-07-27 17:42:11', '2015-07-27 17:42:11', '<h2><span style="color: #0c63a2;">We all have a story to tell.. </span></h2>\r\nOur stories describe our hopes, dreams and ideas; scripting a coherent and rewarding image of self. Studies show that our personal narratives guide our decision-making and help us realize our futures. In short, our life stories can help us figure out who we want to become and where we want to go. Kissaah is based in a research framework that helps you narrate your story, which is useful in future mapping. Kissaah''s interactive and visual platform will help you sustain and attain <em>eudaimonia</em> by bringing clarity and alignment that promotes action.\r\n<p style="text-align: left;">Read about the academic research behind Kissaah.</p>\r\n<p style="text-align: left;">[tw_button link="http://kissaah.com/game-home/references/" size="large" rounded="true" style="border" hover="hover2" color="#666666" target="_blank"]READ MORE[/tw_button]</p>\r\n&nbsp;\r\n<h2><span style="color: #0c63a2;">What is Appreciative Inquiry?</span></h2>\r\n<span style="color: #353535;"><span style="font-size: 16px;">Appreciative Inquiry is a systemic approach to positive change. Kissaah leverages the Appreciative Inquiry framework to help individuals and organization to thrive at times of transition. The AI framework is about the coevolutionary search for the best in people, their organizations, and the relevant world around them. In its broadest focus, it involves systematic discovery of what gives “life” to a living system when it is most alive, most effective, and most constructively capable in economic, ecological, and human terms. AI involves, in a central way, the art and practice of asking questions that strengthen a system’s capacity to apprehend, anticipate, and heighten positive potential.It centrally involves the mobilization of inquiry through the crafting of the “unconditional positive question” often-involving hundreds or sometimes thousands of people.</span></span>\r\n<h3><span style="color: #0c63a2;">What is ''Eudaimonia''?</span></h3>\r\n<span style="color: #000;"><span style="font-size: 16px;">Literally translated, Eudaimonia means ''welfare'' or ''happiness'' in Greek. The word Eudaimonia is increasingly used in academia and used in the context of ''human flourishing''. Kissaah, using the power of story telling, facilitates designing and engineering a life well-lived. We hope to help 1,000,000 people attain and sustain ''Eudaimonia'' through Kissaah by 2020. </span></span>\r\n<h3><span style="color: #0c63a2;">What is a RoadMap?</span></h3>\r\n<span style="color: #000;"><span style="font-size: 16px;">A RoadMap is your electronic diary to chart your journey towards the future within the Kissaah site. Users can create up to three RoadMaps, and each RoadMaps contains four important levels. These levels are Discover, Dream, Design and Deliver. Within each of the four levels of your RoadMap, there are various activities to take part in which will encourage you to reflect on your values and what you enjoy doing, develop a strategy towards a future state. While you are going through your RoadMap, you can also add Allies to help you and you, in turn, can help others towards their goals.</span></span>\r\n<h3><span style="color: #0c63a2;">Why do I have the choice of three RoadMaps?</span></h3>\r\n<span style="color: #000;"><span style="font-size: 16px;">During our research, and also from our own experiences, we realized that people don''t just have one singular ''road'' in their lives in order to obtain a singular goal. For many men and women, we are increasingly taking on more and more roles in our lives. For those increase in roles that we play, we have different paths. </span></span><span style="color: #000;"><span style="font-size: 16px;">\r\n</span></span>\r\n\r\n<span style="color: #000;"><span style="font-size: 16px;">That''s why we have a total of three RoadMaps right now so that no matter your life-roles, you can create a path to a goal in that area of your life AND, also see where there are overlaps in your timelines to reach different goals in the different roles you play in life.</span></span>\r\n\r\n<span style="color: #000;"><span style="font-size: 16px;">There have been so many times that we''ve spoken to people during our research who have ideas about what they want to achieve in their personal lives but sadly, the ideal timelines to make those goals happen do not overlap well with work-related goals, or even the goals of a spouse or partner. That''s why the Kissaah RoadMaps are so incredibly useful; not only can you create strategies towards goals, but you can also share those ideas with others and instead of finding problems were there are no parallel overlaps, you can create better timelines with the help of others. Why three RoadMaps? Our research shows that human beings have only the capacity for up to three different ''roles'' to play in life and any more can be very overwhelming and stressful. By having three RoadMaps, we are encouraging our users to stay within a realistic capacity to achieve their dreams and thrive.</span></span>\r\n<h3><span style="color: #0c63a2;">What is an Ally?</span></h3>\r\n<span style="color: #000;"><span style="font-size: 16px;">An Ally is a person who you can trust to provide you with the support you need throughout your journey towards a goal in using Kissaah. An Ally could be a parent, spouse, friend or even a teacher at school if you are using Kissaah for Academic Institutions. In the workplace, and Ally could be a trusted colleague or manager. An Ally is there to help you by recommending strategies towards goals, or giving you emotional support, providing useful resources that will ultimately help you thrive and live the life you want. Some Allies are more ''hands-on'' than others; while some Allies can simply recommend a useful book to read, other Allies may be proactive in introducing you to people within their network that can make your dreams a reality. We recommend that our users only become Allies with people they can trust, as sometimes sharing our future-visions can be private, so it''s really important to share your ideas about your future with someone you know truly wants the best for you.</span></span>\r\n<h3><span style="color: #0c63a2;">How many Allies can I add to any Kissaah RoadMap I start?</span></h3>\r\n<span style="color: #000;"><span style="font-size: 16px;">You can add as many Allies as you wish to each RoadMap however, we know that ''too many cooks in the kitchen can spoil the broth'' so pick your Allies carefully as it''s about quality not quantity. For instance, you could have 500 Allies but they might not be as useful as say, four really supportive Allies who are genuinely aiding your path to your goals.</span></span>', 'Our method', '', 'publish', 'closed', 'open', '', 'our-method', '', '', '2015-07-29 16:54:47', '2015-07-29 16:54:47', '', 0, 'http://kissaah.com/?page_id=2334', 0, 'page', '', 0),
