(2473, 6, '2015-07-29 16:18:46', '2015-07-29 16:18:46', 'We often cannot comprehend the consequences of our own actions; much less digest what we are doing to generations yet to be born. We hear about the drought in California frequently now in media, yet when we open our tap, water flows. A phenomenon, however real, can seem surreal until the moment reality smacks you in the face. That moment happened this weekend.\r\n\r\n<a href="http://kissaah.com/wp-content/uploads/blog.jpg"><img class="alignnone size-medium wp-image-2475" src="http://kissaah.com/wp-content/uploads/blog-300x225.jpg" alt="blog" width="300" height="225" /></a>\r\n\r\nOver the weekend, we visited Boca Reservoir in Truckee near Lake Tahoe. Walking from what used to be the boat ramp, water was hundreds of meters, perhaps even half a kilometer away. I stood on perched, cracked earth that must have been at least twenty to thirty meters below water when the reservoir was ‘healthy’. A certain sadness and feeling of being overwhelmed by the severity of the problem engulfed me as we walked around the reservoir on solid ground where water had been, should still be. The drought is here, and it is terrifying to think about its implications. The dramatic shift of weather patterns around the world today illustrates that changes are always happening, all around us, sometimes imperceptible, until which point it is dramatic, unimaginable and a bit frightening. Change is indeed a constant. My interest is what we can do - here and now, how do we respond to changes that are happening all around us, and how to take action to build and sustain a thriving society and community.\r\n\r\nThere is a widely accepted sentiment that a large and growing segment of the developed world experiences life and work in a more dynamic and less predictable way than ever before. Many people, across a wide spectrum of ages, will engage in frequent transitions throughout their lifetimes. Given that the frequency of change is inevitably going to increase rather than decrease, my work is focused on how to harness the velocity of changes and experience transitions positively.\r\n\r\nKissaah (K'' saah ) was born out my passion for helping individuals, organizations and communities thrive during times of change. Kissaah is a Sanskrit word that roughly translates into tale, narrative, or events. Dramatic events such as severe changes in our surroundings may be economic, environmental, political, or technological, are drivers of the changes we experience today. Kissaah is a simple concept. It leverages the power of narratives to situate our story and help us find our purpose and meaning amidst this tsunami of changes. By leveraging technology and connectivity, we can help each other build stories, understand own our narratives as well as change the narrative of the world around us.\r\n\r\nIn an ideal world, we help each other knit together a collective imagined future that is consistent with our values and be part of a society that strives towards a brighter future. Our future rests upon essentially choice and action. Changes actually present opportunities for us to gain clarity and alignment.\r\n\r\nBuilding wisdom from the crowd, improving our self-awareness and self-knowledge, Kissaah can help spark the beginning of a dialogue that revises the lexicon and expectations of change. Instead of resisting change, one possibility is to embracing change. Engaging in change generates positive knowledge and meaning that is conducive to resolution of conflict, within self, within the community, and within society at large. By harnessing change as a learning platform, we stand to celebrate change and the opportunities it offers us.\r\n\r\nAs Benjamin Franklin noted:\r\n\r\n<a href="http://kissaah.com/wp-content/uploads/quote-when-you-re-finished-changing-you-re-finished-benjamin-franklin-65462.jpg"><img class="alignnone size-medium wp-image-2478" src="http://kissaah.com/wp-content/uploads/quote-when-you-re-finished-changing-you-re-finished-benjamin-franklin-65462-300x141.jpg" alt="quote-when-you-re-finished-changing-you-re-finished-benjamin-franklin-65462" width="300" height="141" /></a>', 'Changes perceivable to us have large consequences', '', 'publish', 'closed', 'open', '', 'changes-perceivable-to-us-have-large-consequences', '', '', '2015-07-29 16:33:58', '2015-07-29 16:33:58', '', 0, 'http://kissaah.com/?p=2473', 0, 'post', '', 0),
