(2480, 6, '2015-07-29 16:41:32', '2015-07-29 16:41:32', '<a href="http://kissaah.com/wp-content/uploads/quote-action-may-not-always-bring-happiness-but-there-is-no-happiness-without-action-benjamin-disraeli-51465.jpg"><img class="alignnone size-medium wp-image-2481" src="http://kissaah.com/wp-content/uploads/quote-action-may-not-always-bring-happiness-but-there-is-no-happiness-without-action-benjamin-disraeli-51465-300x141.jpg" alt="quote-action-may-not-always-bring-happiness-but-there-is-no-happiness-without-action-benjamin-disraeli-51465" width="300" height="141" /></a>\r\n\r\n[caption id="attachment_2482" align="alignright" width="300"]<a href="http://kissaah.com/wp-content/uploads/prism1.jpg"><img class="size-medium wp-image-2482" src="http://kissaah.com/wp-content/uploads/prism1-300x200.jpg" alt="Light dispersion illustration. Hi-res 3d rendering." width="300" height="200" /></a> Light dispersion illustration. Hi-res 3d rendering.[/caption]\r\n\r\nAt the conclusion of my four years of research, I found a new appreciation for choice and action in modern times. Eudaimonic happiness is “enacted”; people who will succeed are able to develop a self-referential system with a significant thread that connects self with the ever-changing environment. Using the metaphor of a prism, this body of work has the potential to help individuals harness the deep structure within “self” to motivate choice and action at a time of transition. Depending on the refraction index of the transmission medium, pointing white light through a prism can result in the dispersion of light into a rainbow of colors, or it can also be used as a reflection. Like a prism, a transition can illuminate parts of ourselves that are hidden until the appropriate conjecture of perspectives makes available parts of ourselves that remain unrevealed. Self-identity is re-discovered, self-construct is reconstructed, and the “self” is renewed through the enactment and sense-making upon a specific set of circumstances prompted by the disruption. Many scripts within the study are characterized by statements such as “I was surprised at my own … I didn’t know that about myself … I was besides myself when I … ” My body of work offers a framework for individuals to identify within their deep internal structure where cognitive, social and behavioral resources can be strategically marshaled to survive and thrive at a time of change.', 'Happiness is "enacted"', '', 'publish', 'closed', 'open', '', 'happiness-is-enacted', '', '', '2015-07-29 16:46:16', '2015-07-29 16:46:16', '', 0, 'http://kissaah.com/?p=2480', 0, 'post', '', 0),
