(2560, 6, '2013-07-30 19:28:55', '2013-07-30 19:28:55', '<a href="http://www.themoskowitzfirm.com/who.html">The Moskowitz Firm</a>, a law practice focused on technology, trademark, copyright, and related licensing issues.   Suzann works with creative entrepreneurs, technology start-ups, innovative nonprofits and established companies to protect their valuable intellectual property and to navigate the evolving legal landscape, including rules relating to privacy, social media, mobile applications and marketing to children.\r\nSuzann received her B.S. in Policy Analysis from Cornell University in 1998, and graduated Stanford Law School in 2003.', 'Owner, Attorney at The Moskowitz Firm', '', 'publish', 'closed', 'closed', '', 'owner-attorney-at-the-moskowitz-firm', '', '', '2015-07-30 22:43:16', '2015-07-30 22:43:16', '', 0, 'http://kissaah.com/?post_type=tw_team&#038;p=2560', 0, 'tw_team', '', 0),
