(25977, '10 years from now, I see myself in San Francisco, CA working at Dropbox. ', 645, 44, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25978, 'Hopefully, I will be with many of my colleagues who also joined Dropbox as part of the Rotational Program in 2014. ', 645, 45, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25979, 'I see myself as the Head of Business Development and Partnerships at Dropbox (or a similar senior-level position). ', 645, 46, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25980, '9aead632349fc12e86174f3fbf3cd829.jpeg', 645, 91, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25981, 'ad4aeea86380a5b1d46835d0af1b00b8.jpeg', 645, 92, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
