(25988, '2572c67425373da891d2b4ca29fcc35a.png', 645, 99, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25989, '7a9d751d1dc1450fc7ab57005ea4657a.jpeg', 645, 100, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25990, 'Join the User Operations Team at Dropbox. ', 645, 105, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25991, '1) With countless new Dropbox features in the pipeline, there will be much flexibility in my daily work. This will ensure I am constantly learning and remain an uncarved block (Mission A). \r\n2) As part of User Operations, I will constantly interact with engineers and obtain deep product expertise. A comprehensive technical understanding is required for the Head of Business Development and Partnerships position.      \r\n3) All Dropbox employees are encouraged to allocate approximately 40% of their time to pursue projects beyond their core job function. This will offer me an outlet for entrepreneurship and creativity.    \r\n4) User Operations is highly analytical and involves monitoring multiple key metrics. This will prepare me well for a business development role, which requires a comprehensive understanding of key performance indicators.\r\n5) As part of User Operations, there is enormous potential for me to make a lasting impact. If I design a new feature, I impact the lives of 200 million Dropbox users.\r\n6)  The User Operations team is small. I will have significant accountability, which will prepare me well for an executive level position, which entails managing an entire team. ', 645, 106, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25992, '1) Dropbox users: Users face bugs, technical issues, and frustration with limited features. The need someone with the engineering expertise to solve technical challenges and build new features. \r\n2) Other Dropbox Rotational Program members: I will be working alongside approximately 12 members of the rotational team. As they face job stress, relationship issues, mid-life crises, they need empathy, constant support, and a listening ear. \r\n3) Head of User Operations: The Head of User Operations may face low levels of user satisfaction and product innovativeness. He/she will expect innovativeness to design new feature designs and implement high-demand features. \r\n4) Senior team members: Senior members of the leadership team are concerned about ensuring the long-term growth of the company. The expect me to demonstrate strong leadership potential and solid understanding of the product ', 645, 107, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
