(25993, 'I will develop a five-tiered marketing plan: \r\n1.  The cognitive component of my plan involves making the Dropbox senior management aware and knowledgeable of my &ldquo;product&rdquo;. To do so, I will engage in direct mail and email (outbound) marketing. In-person and via email, I will offer my time to assist with any pending projects. This will allow me more opportunities to demonstrate my value. \r\n2.	Making the deal:  The affective component of my marketing plan involves ensuring that customers like and prefer my product. This is essential - consumers often use emotions as a basis for judgment. To accomplish this, I will engage in product placement (outbound) marketing tactics. At breakfast, lunch, and dinner, I will make an effort to sit at the same table as senior leadership members. I will listen empathetically to problems they are currently facing and establish personal connections to increase their preference for my product. \r\n3.	Innovate in sales:  When offering my time to assist with projects, I must tailor my sales pitch to each division. While the Engineering team may be most concerned about technical feasibility, the Product team may be more focused on level of innovation. \r\n4.	Delight: The behavioral component of my integrated marketing campaign encourages customer conviction. I will delight my customers by submitting posts on the Dropbox blog. This will establish my thought leadership and demonstrate my understanding of key industry trends. Senior members will begin to seek my advice. \r\n5.	Profitability: I will avoid monotonous, low impact projects (data entry, monotonous customer outreach, etc.). I will evaluate each potential projects based on the level of impact. Will this project fundamentally change the Dropbox product within the next year? ', 645, 148, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25994, 'I will thrive in a location with warm weather (an average Dec. high temperature of &gt;55 degree Fahrenheit is ideal), significant average annual sunshine (over 3,000 hours is ideal), a safe environment (a murder rate of less than 0.01% per person is ideal), close connection to friends, and not too distant from my family members in Toronto, CAN. \r\n\r\nI will thrive in an industry that is immersed in one of top 10 tech trends of any given year. Given my love for entrepreneurship, I will only consider companies at the vanguard of technological innovation - the visionaries on Geoffrey Moore&rsquo;s Crossing the Chasm model about to cross the chasm. As visionaries, their primary motivation is to gain dramatic advantage through technological breakthrough. My top three companies, Dropbox, Google, and Microsoft, are all focused on tackling one of top 10 tech trends of 2014 . As visionaries, they have a product focus rather than an outbound focus and are dedicated to developing a new innovative product. ', 645, 154, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25995, 'I offer a differentiated &quot;whole&quot; product. \r\nComplementary Products: \r\n1.	Hardware: A former competitive swimmer, I have a performance battery that keeps me highly functional even with minimal sleep. Unlike my competitors, I am naturally energized and can work long hours without charging. \r\n2.	Software. I was wired at Stanford University by the Management Science and Engineering department. My software is state-of-the-art and features an award academic distinction as an undergraduate and a 4.1 GPA as a graduate student.  \r\n3.	Peripherals: I have worked in a variety of different sectors, including healthcare, mobile, and education. Like an integrated media system, I can draw from my familiarly with a wide range of industries.  \r\n4.	Connectivity: I am well connected to entrepreneurs and startups from across the world. I feature touchscreen integration with the unique talent that I have in my network. \r\n\r\nComplementary Services: \r\n1.	Consulting: My connection to prospective Dropbox candidates at Stanford is a key differentiator in helping me advise on new hires. \r\n2.	Post-sales service and support: I never renege on a commitment and, thus, come with a solid warranty to be loyal to the company for many years to come. \r\n3.	Pre-sales services: As a paid user, I am familiar with the Dropbox. Before signing with Dropbox, I often posted comments on Dropbox forums to help users with bug fixes, etc. \r\n4.	Legacy interfaces: At 22 years old, I have longevity and am young and healthy. ', 645, 149, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25996, 'I have several channel partners. \r\n1) Jurassic Partners: Venture capitalists: Manish Patel (Highland), Anne Miura-Ko (Floodgate), Sven. Stohband (Khosla). As I move to more senior positions at Dropbox, my Jurassic partners will advise me on effective management strategies.   My Jurassic partners are merciless. They request my time and effort to help them connect and network with entrepreneurs. \r\n\r\n2) Love Partners:  Parents, grandparents, brother, and other family members. ', 645, 150, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25998, 'For technology companies \r\nWho aim to position themselves as leaders in innovation, \r\nRebecca Hinds is a leader-by-example \r\nwho helps companies develop and implement solutions to bring cutting-edge technologies to mass market. \r\nUnlike other prospective hires who are satisfied with the status quo, \r\nRebecca uses design and strategic thinking to help companies meet their objectives for growth. ', 645, 183, 483, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
