(26122, 'I try not to think about these things too much. Right now I am prepared to be a consultant at Accenture because: 1.) they told me I am and hired me! and 2.) I think my education has prepared me for this entry role. Later in life I would like to jump to a more prominent leadership position filled with responsibility and people management and I believe that I have a lot of progress to make before I am ready for such a role. The best way to prepare is to continue learning and improving as a person.', 651, 148, 53, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26123, 'I thrive most in cultures with transparency, candor, optimism, dynamic, feedback-drive, challenging, impactful, fun, flexible hours, excellent mentorship, and intellectual and inspiring colleagues.', 651, 154, 53, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26124, 'I compete by being myself and focusing on what matters most in life: constantly improving who I am as a person and finding happiness along the way.', 651, 149, 53, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26125, 'I don''t think anyone can achieve the wildest success without others. Most of my own success has been built on the shoulders of family, friends, mentors and other loved ones. I am not sure who will play the most impactful role moving forward, but I like to ascribe to the policy of being as helpful to others as I can. I am very aware of the privilege I have been given and so I am constantly seeking opportunities to give to others in the way I have been given.', 651, 150, 53, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26126, 'There are so many life obstacles! The biggest one is just remaining grounded in what makes me happy. Life can become complicated, but it''s often best to keep things simple. I hope to keep focused on staying healthy, fit, intellectual curious, driven, and challenged.', 651, 155, 53, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
