(26267, 'Marketing and Pricing Analytics for a growing tech company in the Bay Area?', 658, 105, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26268, 'It will round out my lack of private sector experience. Moreover, it will encourage me to empathize more with the pain and challenges of my customers.', 658, 106, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26269, 'My stakeholders will expect clear, thoughtful analysis that is accurate and will resort in profitable outcomes.', 658, 107, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26270, 'I will continue down my educational path by pursuing an MBA at Berkeley.', 658, 148, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26271, 'I like cubicles. I like being able to do deep dives and focus for hours on end. That being said, I realize my mind is fine instrument and can only operate for a few hours before exhaustion sets in. I want to be able to go home by 8 and sleep in my bed every night.', 658, 154, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26272, 'I differentiate myself  as an exclusive and selective product, possessing both deep regulatory and market knowledge that can navigate  treacherous and unclear paths. I can interface with both technical and business people throughout at organization''s hierarchy. I  am a complete package.', 658, 149, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26273, 'Friends and Colleagues at other companies can help me launch myself into the private sector. I can reciprocate with regulatory knowledge as well as act as a matchmaker across my vast social network. I help the world by guiding individuals to the people who need them.', 658, 150, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26274, 'The risks I face are the reputational risk of my former institution. Sharp changes to the economy can influence how I am viewed. I could repudiate my institution but that involves another sort of risk.   \r\nThese risks cannot be avoided but can be mitigated by not tying my brand exclusively to one firm.  \r\nThe other consideration is that ongoing health issues may prevent me from taking jobs that I would otherwise desire.', 658, 155, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26275, 'For Companies that are data oriented and highly regulated\r\nWho  need actionable information from internal and external data\r\nDavid Lang  guides firms, consults clients, and makes markets\r\nUnlike Other Consultants and Analysts\r\nWho are not subject-matter experts\r\nDavid Lang focuses on products that he knows and work that he can do with certainty.', 658, 183, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26276, 'Outreach and Engagement from within the Federal Reserve.', 658, 109, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26277, 'I will continue to build key relationships with my organization by presenting new opportunities to capture new audiences using social media. In addition, I will provide meaningful analytics to justify being entrusted more responsibility .', 658, 110, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26278, 'My customers will be senior management with my organization. They will need a way of communicating these activities our board of directors in a meaningful way.', 658, 111, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26279, 'I will learn more about reputational risk management through the Corporate Executive Board courses and I will engage key members of our Board of Directors so I can learn their thought process and anticipates their concerns.', 658, 156, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26280, 'I am on the top floor of my office in the Financial District. I can see the Ferry Building and both bridges on a clear day. I am working in government. The culture is hierarchal and I have time to calculate each and every decision.', 658, 112, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26281, 'I differentiate myself as knowing the tools of social media but having the risk aversion and caution  that government usually has. I know a hawk from a handsaw at all times.', 658, 113, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26282, 'My Meetup colleagues will help me learn the social media skills needed. I will reciprocate by teaching datamining skills. I help people communicate more effectively to their peers and understand the world as it truly is.', 658, 114, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26283, 'I may push my organization too fast and  social media or a viral video could blow up in my face.  I can mitigate this risk by developing crisis management and communication lines before I engage in high-risk outreach. I can accomplish my long-term goals.', 658, 157, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26285, 'I am an entrepreneur in a the mobile payments industry. My  product is a form of Mobile Escrow Payment that guarantees indivuals will show up for certain events or be fined for it.', 658, 58, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26286, 'I will go to work for Visa, Paypal, Square, or another payments firm to learn about payment systems and app design.', 658, 59, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26287, 'My target customers will need an  easy to use application that doesn''t charge an outrageous service fee.', 658, 60, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26288, 'My qualifications are knowledge of network economics. I hope to develop my idea through the existing interchange fee systems of my firm.', 658, 118, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26289, 'I am an executive in Silicon Valley. I actively engage, challenge, and frustrate my employees with tight deadlines and new ideas. ', 658, 115, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26290, 'My product is differentiated because it insures against people cancelling on you.  Existing market data and network effects will allow me to grow faster than new entrants.', 658, 116, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26291, 'Executives in Payments Systems will help me. I will offer equity as well new business development cases for these firms. The impact of my product will be I will help hundreds of thousands  keep their time from being wasted.', 658, 117, 152, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
