(26641, 'I would be extremely excited about doing a fellowship in the hospital for special surgery in new york or being a visiting physician at this hospital for parts of the year. I think that the opportunity to learn from experts in the field at one of the most technologically advanced centers in the world for sports medicine would give me the opportunity to help athletes return to doing what they love quickly and would provide and extremely rewarding experience. ', 664, 101, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
