(26733, 'Mid Size Startup', 664, 109, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26734, 'Long term vision is to become founding partner of a VC firm. Working at a successful medium size startup will give me the network that I need to make successful investments in the future. It will also teach me how to identify a successful team and how to cultivate a company from idea to a working product. This gives me the opportunity to mentor entrepreneurs when they receive funding and increases the likelihood of success. ', 664, 110, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26735, 'Customers: \r\nEmployee - will need someone who can work effectively as a team member and be dependable, perseverant, and with a positive attitude. Moreover, I must show initiative. I must be able to create my own work and complete it on time while developing an understanding of what the market is for the product and what the customer will need. Must be able to prioritize my work and have good time management and get things done efficiently. ', 664, 111, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26736, 'As a student athlete at Stanford I have vast experience working as a member of a team. I know how to communicate with individuals of vastly different backgrounds and can rally them around a common goal. I am comfortable being depended upon to perform and can take responsibility of leading a group of individuals towards a goal. I have learned to manage my time extremely efficiently and prioritize tasks based on importance and the impact that they can have. \r\nMoreover, through my classes in MS&E I have learned how to understand the customer. I realize the importance of reaching out and testing hypothesis early on in product development as well as the need to understand the customer segment when designing a product. I think about problems creatively and try to understand something from a customers perspective. \r\n', 664, 156, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26737, 'A professional environment has to be relaxed and fun loving. I think this allows me to be more creative and comfortable talking to my peers which can lead to better idea generation. \r\nMoreover, I thrive when the individuals around me are extremely good at what they do. This motivates me to improve on my skills and execute to a higher degree making me a better worker and allowing me to grow as a professional. \r\nI also believe that being in an environment where you are surrounded by individuals of various backgrounds makes collaboration much more effective and can lead to more creative solutions/better teamwork on projects. \r\nFinally, I want to be part of an environment where people enjoy each other''s company. They are at work because they truly like the people they work for and enjoy spending time with one another. ', 664, 112, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `prod_answers` (`id`, `answer`, `user_id`, `configure_id`, `user_game_status_id`, `created`, `modified`) VALUES
(26738, 'My differentiation from others comes from my vast experience working on teams. As a former athlete I really understand the importance of working with others and appreciate the different styles that people have. This gives me a unique leadership skill of being able to rally people to work with me and understanding how to motivate others to bring their best. \r\nMoreover, as an athlete I have vast experience performing under pressure. I can handle large responsibilities and be depended upon to execute on these. ', 664, 113, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26739, 'My family has always been instrumental to helping me achieve my goals. They provide the support and guidance I need when making decisions and have been a great outlet for me. Whenever I need a break they make me laugh and remind me how to enjoy every day. \r\nI will reciprocate by continuing to include them in my life and help bring laughs to their days too. I will also provide the same support to each one of them. I will always make myself available and ultimately would want to provide for my parents so they can enjoy their retired years without any worry. \r\nMy impact on the world around me stems from my desire to give others the opportunity I have had in my life. I want to help others reach their goals and dreams through mentorship as an interested and knowledgable investor in their company ', 664, 114, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26740, 'The major obstacle that I face is becoming too insular in the startup I work for. I think it will be important to continue to cultivate my network outside my workplace and make it a point to reach out to new individuals who I can learn from or keep in touch with those who I know can help me continue to grow. \r\nCultivating this network will ultimately be instrumental to achieving a goal of starting a VC fund. ', 664, 157, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26741, 'I want to start a VC fund that truly helps entrepreneurs of all ages understand and learn the path to building a successful company and being a leader for others. ', 664, 184, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26742, 'Ice cream shop by the beach', 664, 58, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26743, 'Startup to Medschool', 664, 105, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26744, 'I hope to become a practicing physician specializing in sports medicine. However, I want to practice medicine in a creative manner similar to a Silicon Valley startup. I believe that I can innovate on this field if I go into med school with the perspective of having worked in a startup where I can gain experience iterating quickly on a project to address issues as they arise, executing on ideas, and leading teams towards acheiving common goals. ', 664, 106, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26745, 'Customers: \r\nEmployee - will need someone who can work effectively as a team member and be dependable, perseverant, and with a positive attitude. Moreover, I must show initiative. I must be able to create my own work and complete it on time while developing an understanding of what the market is for the product and what the customer will need. Must be able to prioritize my work and have good time management and get things done efficiently. \r\nMedical School Admissions Board: \r\nWill expect a dedication to medicine and helping improve patient health. \r\nThey will want me to have completed medical school required curriculum. \r\nAnd a high score on the MCAT. ', 664, 107, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26746, 'As a student athlete at Stanford I have vast experience working as a member of a team. I know how to communicate with individuals of vastly different backgrounds and can rally them around a common goal. I am comfortable being depended upon to perform and can take responsibility of leading a group of individuals towards a goal. I have learned to manage my time extremely efficiently and prioritize tasks based on importance and the impact that they can have. \r\nMoreover, through my classes in MS&E I have learned how to understand the customer. I realize the importance of reaching out and testing hypothesis early on in product development as well as the need to understand the customer segment when designing a product. I think about problems creatively and try to understand something from a customers perspective. \r\n\r\nIn addition, I have taken and done will in all my required premed courses as well as have signed up and made plans to prepare for and take the MCAT this spring. Moreover, I believe that the mere fact that I have explored other career options before committing to a career in medicine will show that I am serious about my decision when it comes time to apply and will give me an advantage over other applicants. ', 664, 148, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26747, 'I thrive in a collaborative environment. One that uses teamwork to work together to solve problems in a new more efficient way. I think an area such as the Sillicon Valley where team work is understood and encouraged will be a strong environment for my style of work. The professional environment must also be a friendly one, where people enjoy one another''s company and express humor. ', 664, 154, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26748, '45eb4bde1e6e28a91a87e3aa6f4ee5fe.jpg', 641, 100, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26750, 'I want to be a product manager.', 641, 109, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26751, 'Product manager is a role connecting engineering and marketing, from which I can learn most about both the product and people and developing my skills to communicate with people from different backgrounds.', 641, 110, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26752, 'For engineers: to deliver clear product requirements\r\nFor marketing peopleï¼š??\r\nFor colleagues: be a reliable, supportive, and fun person to work with', 641, 111, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26753, 'I would like to work in a place where people are enthusiastic about what they are doing, a place where I can learn different things. ', 641, 112, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26754, 'I am an industrial engineer and I take courses related to strategy and marketing. I speak both engineer''s languages and marketing people''s language.', 641, 156, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26755, 'I am a good listener and I care about what people really wants. I can use my decision analysis mind to look at the conflicts between different groups. I can see a big picture instead of focusing only on technical or business side. ', 641, 113, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26756, 'I have some friends working as a product manager before. I can ask them for advice.  Help deliver a better product for others to use.', 641, 114, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26757, 'Obstacles: My programming skill is rusty now. I need to take some programming courses and practice programming to pick it up.\r\nRisks: Most of the employers are looking for MBA student to be product manager.  \r\nIt aligns with my value as I enjoyed working with a diverse group. ', 641, 157, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26758, 'For my future employee who needs an industrial engineer with decision analysis background, Suhui Chen is an caring/curious engineer who is enthusiastic about healing the pain for customer and helping them to achieve clarity of action and continuous improving. Unlike other engineers, she has a global mind, speaks two languages, care about other people''s well being and willing to listen to their concerns, and help them to solve their pain through her strong technical analysis skills.', 641, 184, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26759, 'I want to be a system integrated consultant focusing on operation, supply chain or global business expansion.', 641, 58, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26760, 'To develop network, and get familiar with how to start a business in China.', 641, 59, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26761, 'Clients: solve clients problem and help them to implement the solution\r\nManager: deliver good results based on what clients need\r\nTeam members: support each other, be reliable, be fun to work with', 641, 60, 549, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26762, '9d0509587f717ed78c04255eed464af5.jpg', 647, 2, 338, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26763, 'My differentiation from others comes from my vast experience working on teams. As a former athlete I really understand the importance of working with others and appreciate the different styles that people have. This gives me a unique leadership skill of being able to rally people to work with me and understanding how to motivate others to bring their best. \r\nMoreover, as an athlete I have vast experience performing under pressure. I can handle large responsibilities and be depended upon to execute on these. ', 664, 149, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26764, 'b64a89da9ce563d18ce6d81fd499b187.jpg', 647, 3, 338, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26765, 'I will need a lot of support in or to become a physician of the caliber that I hope to  be. I will have to develop strong relationships with mentors in med school who I can learn from and call upon for advice over the years. \r\n\r\nI will also need support and patience from my family. Medical school is a long career  path and requires heavy investment from the individual. Family will be less able to see me during the early years of my career and this will make it difficult for all of us since we are very close. \r\nI will also need some sort of financial support to pay for my tuition and living expenses. \r\nI will reciprocate by promising to be there when I can and carving out time to help mentor others going through the process with what I have learned. \r\nI think the impact I will make on the world is to bring out a different side of medicine in practice. One that moves more quickly, collaborates well and creatively solves problems by finding new ways to help the patient rather than following a one size fits all protocol mentality. ', 664, 150, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26766, '7a921eee73ae3502538a7d05587c921b.jpg', 647, 4, 338, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26768, 'I think one risk that I face in the application process will be having such a different background from traditional medical student. I believe that my background can serve to my advantage if a med school sees the benefit that I do but I always run the risk of a traditional admissions officer who resists change and finds my path insulting to medicine. \r\nI also run a risk of never reaching med school because I become caught up in making money in the startup world and can''t make myself get out of this scene to invest a major portion of my life in paying for more school. \r\nI also run the risk of medicine become so bogged down by more regulation from the affordable care act that I will be kept from ultimately practicing in a manner that I find exciting. ', 664, 155, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26769, 'I have experienced working with real people in a fast paced environment where we have to understand our customers pains and collaborate to come up with creative and new solutions to address these problems. I believe that the skills I have developed from my work will translate extremely well to a career in medicine where everyday you have to understand the patients struggles and work with your care team to address this. ', 664, 183, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26772, 'I will be able to bring joy and sweetness to every vacationer being forever associated in their memory with carefree summer days and a simple relaxing times. ', 664, 59, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26773, '66c21b391f3a77bd0f48234c9a88eda5.jpg', 647, 35, 338, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26774, 'My target customers will need a friendly disposition. Good conversation and quality ice cream available at all times of the day. ', 664, 60, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26775, 'I have an expert sweet tooth. I love food, love kids, and love the beach so I can relate well to a family bringing the whole gang including the dog over during a messy afternoon to get some refreshing ice cream!', 664, 118, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26776, 'A smaller town by the ocean near a larger urban area. Needs to be clean and family oriented which attracts lots of beach goers during most weekends and vaction times. Warm year round. \r\nI want there to be a solid community of educated individuals who live year round that can help build trusting relationships and for good conversation. ', 664, 115, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26777, 'Home made local ice cream. Customers can vote on a flavor each week. ', 664, 116, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26778, 'I will need help from dairy farmers and producers in the area. \r\nWill need employees to help run the store and make the ice cream. \r\nI will provide a stable friendly environment for them to work in. \r\nI will have a unique place where families can come be themselves and be totally relaxed when they seek to get away from their work lives. ', 664, 117, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26779, 'I face not making enough money to keep working. Living a slow paced life that is not necessarily intellectually stimulating. ', 664, 119, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26780, 'I will provide a fun environment for all to come be themsleves relax and enjoy good company', 664, 185, 198, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
