(26912, 'I want to change society and make it a better place', 667, 106, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26913, 'To know that what I think and plan and execute will work', 667, 107, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
