(26915, 'Open, creative, flat, imaginative', 667, 154, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26916, 'Solving the crux of issues rather than just meeting demands.', 667, 149, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26917, 'A strong technical team. I want to make the world a better place and hope that the team believes in my vision. I will reciprocate by providing all the resources they require and a concrete direction.', 667, 150, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26918, 'Competition and rejection by customers. Self doubt. I''m taking small steps towards my long term goals to validate myself along the way.', 667, 155, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26919, 'I offer a critical analysis of societal and cultural issues to try and make society a better place while imagining and forecasting an improved future state that stretch beyond my lifetime, unlike other people who work to achieve short term returns and wealth.', 667, 183, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26920, 'An innovator', 667, 109, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26921, 'Helping other companies to innovate and succeed would train myself to be a better innovator and improve society along the way', 667, 110, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26922, 'Ideas backed by research and solid understanding of users', 667, 111, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26923, 'UX experience and training gained through college and personal projects', 667, 156, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
