(26925, 'I avoid ideas that have a long history and traditions, and seek those that are unique in the field by being inspired by experiences in other unrelated sectors.', 667, 113, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26926, 'I provide original and imaginative solutions to problems in consumer facing products that are inspired by products in other sectors, creating products that are unique in the industry.', 667, 184, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26927, 'Insiders of innovative companies would help me to be inducted into the community. I offer full support of their endeavors and active interest in their lives.', 667, 114, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26928, 'Lack of proven track record. At the moment, working and completing pet projects would help.', 667, 157, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26929, 'Teacher', 667, 58, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26930, 'Inspiring young people to see the problems in the world and work to solving them instead of only for wealth.', 667, 59, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26931, 'Experience and connections to people that can help them achieve their dreams', 667, 60, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26932, 'Accumulating life experiences possibly through failures in other paths while always looking to teach and convey the lessons i learn. Also to keep in contact with the peopl i meet from diverse backgrounds.', 667, 118, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26933, 'An environment with people willing to experiment and break conventions', 667, 115, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26934, 'I believe that teaching about life is more important than anything and teachers should be a guide rather than an instructor.', 667, 116, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26935, 'Educators who are strong with knowledge and content who can instruct better than me. ', 667, 117, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26936, 'Because my goals in this path are not in line with present trends of what people value, i may not be well valued. I would seek out places where my goals and skills would be valued', 667, 119, 344, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
