(26962, 'As compare to other fresh grads, I have 1 year working experience in Silicon Valley as a developer. I understand the working standards and culture in Silicon Valley and this experience is certainly a great advantage for me.\r\n\r\nBesides that, I am a highly motivated and determined individual. Having an adventurous characteristics and passionate heart make me different.', 656, 149, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26963, 'The connection that I established during my Silicon Valley NOC Program will definitely helps if I decide to come back. \r\n\r\nI will pass on the help to my other peers or juniors if they share my aspiration. ', 656, 150, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26964, 'My non-programming background might put me in a disadvantage position. However , I could compensate that with my own learning. If I decide to start a technology start-up in the future, the expertise I attain throughout the years will definitely help.', 656, 155, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26965, 'Learning is a skill, and it is what I practice everyday', 656, 183, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26966, 'I want to be involved in the Business/Finance sector after 5 years as a corporate consultant', 656, 109, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26967, 'Being in those sectors will broaden my world exposure as Finance is always an international subject. Exposure can help me see the opportunities lie ahead of me.', 656, 110, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26968, 'Business/Finance sector is totally a new/unfamiliar area for me. If I were to go into the sector, I will need to adapt to the new environment real quick and learn incredibly fast.\r\n\r\nAlso, a degree in MBA is required from me as well. Therefore, going back to school after I have accumulated a few years of working experience is included in my long term plan too.', 656, 111, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26969, 'The first step is to get a related internship during my study in University first, so that I will be able to familiarize myself with this new area.  Internship experience plays a vital part in the Business/Finance sector.\r\n\r\nAlso, I will have to take some Finance/Management modules back in university so that at least I will have some basic understanding on those subjects.', 656, 156, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26970, 'As a world financial hub, Singapore is undoubtedly the best place for me to thrive. However, I see Singapore is at a cross-road now. In the coming 10 years, there will be a drastic change in its structure.  Therefore, I need to be flexible in making this decision.', 656, 112, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26971, 'Lacking financial background is my biggest disadvantage. However, possessing a certain skills is not enough anymore, the ability to learn fast is the only sustainable way. And, I learn fast. \r\n\r\nAlso, I need to get a MBA first before I jump into this completely new aspect.', 656, 113, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26972, 'It is all about networking n the business world. Who I know is much much more important than what I know. If I were to choose this path, I will definitely need to start preparing myself now. For example, establishing my "financial/business" network.', 656, 114, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26973, 'My biggest obstacles is having zero financial/business background. I will have to start preparing myself from now on if I were to venture in this unfamiliar area. Otherwise, I do not stand a chance with my Engineer background.', 656, 157, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26974, 'Learning is a skill, and that is what I practice everyday', 656, 184, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
