(27092, '10 years from now on, I will see myself in Saratoga. ', 671, 44, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27093, 'Hopefully I will be with my wife, son, daughter and parents', 671, 45, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27094, 'I will be the president of my own company.', 671, 46, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27096, 'ecb6261d704504accad9eaa546a882ea.jpg', 671, 91, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
