(27106, '7fd552cb7cdee9d82bfd4e36a5a5666c.jpg', 671, 99, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27107, 'NVIDIA is my first path I want to explore. ', 671, 105, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27108, 'NVIDIA is the leading innovation company in graphics. I am in the system design team which gives me the opportunity to get touch on the world leading team in design, manufacturing and management. In addition, NVIDIA provide self improvement program to get management graduate certificate at Stanford. I wish I could get access to the product management role and build my personal network with executives. ', 671, 106, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27109, 'I am innovative and would bring new technology to designs. I am taking management course so that I can prepare myself for the product management role. ', 671, 107, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27110, 'I am skilled with my current position and filed patents; I am owner of system design guides. My work is influencing every design team. I should take more responsibility to join the product team.   \r\n\r\nMy plan to meeting the expectation is \r\n1) take stanford management course to improve myself\r\n2) switch the team from internal infrastructure to product team\r\n3) take project manager first and then step up', 671, 148, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27123, 'I would like to stay in silicon valley where it is close to VC and talent people I need for the future company. I would like to stay with top notched company to get access to the state-of-art high tech. But I would also like start-up environment in fast pace, fast learning and  creativity.   ', 671, 154, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27124, 'Currently, my work gives the value of multi-sources of component supply chain protection, which is key to the sustainability of company dealing with huge volume of mass production.  No one did this before. \r\n\r\nWith this capability,  we can also bring down the cost by nature competition between vendors.  ', 671, 149, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27125, 'My mentor might help me as he did before on technical side. He is product manager right now. I could help him to faster the process the deliver design on time. \r\n\r\nAfter three years working in NVIDIA, I already got familiar with the design flow and most vendors and establish a good relationship with major manufactures around bay area. This is good resource for my future.\r\n\r\nI need more mentors and virtual board directors to help me to achieve my goal. I need more net working.', 671, 150, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27126, 'My real obstacles are the access and visibility to the higher executive board and success delivery of real products. \r\n\r\nI need opportunity to demo my capability and prove myself. I intent to take over management role in the future. It is quite challenge since I am still new in the company compared to other managers.\r\n\r\nI am accomplish my long term goals. I am taking GEM class part time which is  my designed path to the future.\r\n', 671, 155, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27127, 'I would like to take challenges and responsibility at my role. I wish to establish more net work with higher executives members so that I would be gain visibility of my work to move up in career ladder.', 671, 183, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27128, 'The second path I like to explore is through Stanford MSE classes.', 671, 109, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27129, 'Stanford MSE classes will expand my vision on marketing and entrepreneurship, which helps me in either my career path to executives role or start my own company. In addition, through MSE classes, I got chances to get connected to many people such as Tom and VCs in the future classes.   ', 671, 110, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27130, 'My stateholders should need someone has deep knowledge in technical skills but also know management and vision for market.  I actually would like strategic marketing more after I take MSE271. I think there is more fun, chanllege and creativity in this role.', 671, 111, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27131, 'I have gained experience in technical skills. But I have not try and work in market and management role yet.\r\n\r\nMy plan will seek out opportunity in strategic marketing manager role after I finish the MSE271. ', 671, 156, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27132, 'I will stay in bay are in next 3-5 years, in high tech industry; will seek change from engineer to marketing manager position.', 671, 112, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27133, 'I am the lead system design engineer; I know more details in my designs than others; I am the interface of our internal design to external vendors; so I have the best relationship for support; I am learning marketing and management.  ', 671, 113, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27134, 'I found Tom is very help to expand my profession network. I like him. In addition, he is full of humor and I enjoyed fun from this GEM class.  I would like to discuss more about my ideas of my own start up company with Tom later in this class.', 671, 114, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27135, 'MSE271 is my second class in management and marketing. I think I still am a newbee in management and need to learn more about it.\r\n\r\nI plan to take more classes in MSE to overcome these obstacles.\r\n\r\nAt this moment,  I am still fresh in marketing and entrepreneurship. I do not  know to make good business plans, sharp business models; find key person to help me to launch my website on internet and mobile phones.  ', 671, 157, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27136, 'I am ready to apply what I learned from class to my real daily work such as how to use reciprocal theory to get more things done. \r\n\r\nI am going to net work with more people and be more active in getting touch with  VPs and executives. ', 671, 184, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
