(27145, 'I want to explore the third path to start my own company. ', 671, 58, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27146, 'The third path is the direct way to my long term vision. With my own company, I assume I will be financially independent; I can travel to the places that I never been to; spent more time with family and friends; bring kids to good school; have parents live close by if they like. I can have tea with Tom in the weekend; discuss new ideas and business model to create new opportunities.', 671, 59, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27147, 'My target customer will be everyone who need a car.', 671, 60, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27148, 'I am learning from MSE class on how to make business models and how to delivery ideas to market and monetize.  \r\n\r\nI need people who could make web and mobile APPs. I am thinking to build them by my own but may need to discuss more with Tom and VBD.', 671, 118, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27149, 'My company will located in bay area. The industry will be automobile industry.  I would like to build a culture with high dynamics and creativity. Sales and Marketing will be the major function group of my company. ', 671, 115, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27150, 'My business model will help individual to save money and take care of the hassles. ', 671, 116, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27151, 'I have not started to reach out to find  partner yet. I am still in research to find out more details and analyze how to do the first step.  ', 671, 117, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27152, 'I need to create my own company website, mobile APPs and establish partnership with automakers.', 671, 119, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27153, 'I think my company will help each of us as long as you drive. Some companies already start the business but they are not focused. ', 671, 185, 585, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
