(27201, 'I don''t know where I''ll be, but wherever I am I see myself settled. I will likely be in the States. Maybe here, in the Bay Area, where my family is. Or maybe in a small town somewhere. But at the end of the day, it''s impossible to know.', 642, 44, 263, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
