(27203, 'I will be happy, likely beginning a family of my own. Family is the most important thing to me in life. I want a satisfying career, and I hope to find fulfillment in that area of my life. Perhaps I will be working in BD in a company. Or maybe I will be working (perhaps on a volunteer basis) for a non-profit or organization I believe in. ', 642, 46, 263, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
