(27271, '10 years from now, I see myself in Either Silicon Valley or Singapore. I would be in Silicon Valley if opportunities and resources pertaining to my pursuits here prove to be more abundant than back in Singapore. I would be in Singapore if there exists a huge potential for me to extend my reach to the entire South-East Asian region.', 678, 44, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27272, 'Hopefully I will be with my family so that they could be my emotional anchor and empower me with a steady stream of positive emotional resources to fuel my passions in life. At the same time, I would also be working alongside a dedicated and diverse team of individuals whose vision aligns with mine.', 678, 45, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27273, 'I will be working for my startup which will be of B2B in nature and targets a regional market. Should my startup ambitions not materialize or follow through, I will be working at a strategic position for an established financial institution.', 678, 46, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
