(27389, '7337b66eb7584259c1565fc5d15987b7.jpg', 648, 100, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27391, 'First path: I want to be good at software front-end, that means being both a designer and a front-end engineer. The Front-end guy.', 648, 105, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27392, 'Anything and everything software to websites to mobile requires a front-end guy. \r\n\r\nGoogle has lots of data, but also needs the front-end guy to properly show all the data. \r\n\r\nFacebook is a social media platform, for which the front-end guy is even more important; to display information correctly and accurately.\r\n\r\nAnd being a front-end guy myself I can decide on how my future company will look like on screens and devices.', 648, 106, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27393, 'Bug-free, perfect, intuitive UI/UX experience.', 648, 107, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27394, 'I''m currently working at a start-up as an front-end engineer, improving my front-end coding as I work. When I am free, I enroll myself in graphics design classes to improve on my photo', 648, 148, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27395, 'Being in the bay area, I believe this is the best place for an front-end engineer who can also design.', 648, 154, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27396, 'When it comes to design, there is a lot of opinions and personal preference involved. I guess I just have to try to make my UI as intuitive and bug-free as possible.', 648, 149, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27397, 'Mentors whom I have met on my NOC exchange, friends whom I''ve had the chance to know here. All of them can give me opinions and suggestions on my design. \r\n\r\nHopefully, my design will help more people than my targeted customers.', 648, 150, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27398, 'Time Management. Learning to design and mastering the art of design takes time. Perfecting my coding habits takes time. Learning about management takes time too. \r\n\r\nThey cannot be avoided, in fact they should be embraced. The more mistakes I make, the better I will be at them. Yes, I am coding everyday and learn graphics design whenever I have a chance.', 648, 155, 28, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
