(27480, 'Employee at Valve', 666, 105, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27481, 'It will give me experience in production of triple-A quality entertainment, as well as working with some of the best talents in the industry and gaining valuable contacts.', 666, 106, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27482, 'A in-depth knowledge in a specific technology, or experience in designing or producing top selling games.', 666, 107, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27483, 'I have a computer science degree which could get me into an entry level programming position. I have produced a few mobile games though they are not top-selling. I will need more qualifications if I want to get into a more advanced position from the start. In terms of experience, I am planning to produce more games in the future trying to get a big hit. In terms of academics, I could do a masters in game design in UCLA or UC Irvin which have strong industrial connections with Blizzard Entertainment.', 666, 148, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27484, 'I love staying in the California region because of the great weather, and being the central hub of the global game industry. Blizzard Entertainment is situated in Irvine near LA, one of the best locations I could hope for. Blizzard Entertainment is also one of the leaders of game industry, similar to Apple in technology, producing high budget and polished games with a huge following all over the world. If I want to work for a company in the game industry, this would definitely be one of it. In terms of culture, Blizzard Entertainment has a fun loving culture similar to most game companies out there. However, one negative point is that most jobs there are hyper focused on a single area of game development. Therefore, it would probably not satisfy my desire for change and variety.', 666, 154, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27485, 'ee2a75e4dce6c7911183a2d567ba71fe.jpg', 682, 2, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27487, '3dab0808eda053e1c07142c413d2574a.jpg', 682, 3, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27489, '48cdf8a0f71d3d1fa6ffb53c0d172058.jpg', 682, 4, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27502, 'e3b5f563854d33036aa3305abd6308e6.jpeg', 663, 99, 423, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27509, 'I have been playing games since 5 years old, developing games since 10 years old. I have years of knowledge in music, programming and design, all of which are things one need for developing a game. I also have experience in starting my own game company, leading a team to produce original products. Other than that, I also have a degree in computer science from NUS. Also, I have a certificate for game design programme from MIT, with it being one of the top 5 game design post graduate programmes in the world. Of course, I also took Entrepreneurship classes here in Stanford, something they might be interested in if they wish to create new value within their company.', 666, 149, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27510, 'I would be contributing to a quality piece of entertainment enjoyed by millions of people in the world. Possibly, I could be in charge of creating new intellectual property franchise that would leave a legacy for tens of year to come.', 666, 150, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27512, 'Continue in NVIDIA Architecture', 663, 109, 423, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
