(27531, 'In 10 years I will be with my husband and our toddler.', 682, 45, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27532, '10 years from now, I either see myself settled down with my family in Southern California, close to my parental family.', 682, 44, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27533, 'Stable job in an area I love. Moves away from hardcore engineering', 663, 59, 423, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27534, 'Using technical knowledge built up in architecture and transferring it into a different area of the comapny', 663, 60, 423, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27535, 'Need to show  broader understanding of business considerations', 663, 118, 423, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27536, 'One obstacle is that I will need a US work visa as I am Singaporean. Although this is a lot easier as I am Singaporean, but if I would get a Masters it could be made even easier.', 666, 155, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27537, 'I will be a leader at a company, where I enjoy the work that I do everyday and I enjoy who I work with.', 682, 46, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27538, 'Collaborative team, closer to customers and user-feedback. Less reliance on pure engineering skills', 663, 115, 423, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27539, 'PhD qualification and understanding of architecture will allow unique insights into product strategy', 663, 116, 423, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
