(27578, 'I will need to have some knowledge in chemical and mechanical engineering. I will need to be able to manage a company with more than 200 employees in it''s growth stage and direct it to IPO. I will need to have skills in B2B sales, marketing and negotiation.', 666, 111, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27579, 'I have started my own game company, as well as managed a team to release a few products. It is a bit different as it''s a B2C company and have a much smaller scale, but the management experience definitely would help. I also took management classes in Stanford, especially the current GEM course which gives me more practical experience in both B2C and B2B marketing. To further my qualifications for this path, I am also planning to take a MBA in Harvard.', 666, 156, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27580, 'The company is located in China, near Shanghai. It''s not as an ideal of a place as Silicon Valley, but in terms of weather and lifestyle, it is rather similar and I would not really mind. Being in Asia, there is also the advantage that it is not too long a flight away from relatives. The semiconductor industry is not one that I am particularly interested in. However, being a family business in it''s transition from private to public, I am excited about having the power to be able to shape it''s culture to one which the people there will love. ', 666, 112, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27581, 'My customers will expect me to be extremely organized while planning/creating/budgeting/etc events that help the community flourish and build awareness. ', 682, 107, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27582, 'As it is a family business and I am the only child, there is not much of a competition. The only other possibility would be to hire an external CEO. However, it is always a less appealing choice as an external CEO could never be as trustworthy as family member for a family business.', 666, 113, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27583, 'The biggest obstacle I face right now is the lack of professional experience in a community manager/marketing role.', 682, 155, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27584, 'The factor that makes me unique is my willingness to learn and my passion to be better. While I may start out as an underdog, my eagerness will help me go the extra steps that will put me ahead.', 682, 149, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27585, 'To achieve this goal, I would depend quite a lot on my parents, both in sponsoring my Harvard MBA as well as the company itself. Though in return I would build the company into one of the greatest in the industry and my father would be able to retire when I take over. However, this is definitely not my end goal. Once the company goes IPO, I would want to use the new financial resource to go into an industry I am more interested in impacting, such as the game industry.', 666, 114, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27587, 'CEO Sabaton Games', 666, 58, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27588, 'My ideal environment is one where the focus is on the work and not on the outer appearance. I like company cultures where you can dress casually to work and where the company values your well being above all else -- a happy worker creates great work.', 682, 154, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27589, 'My support group (family and friends) will keep me motivated in the search for a job. I will reciprocate by making sure that I am supportive in the endeavors that they choose to do.', 682, 150, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27590, 'My qualifications come from my work and academic experience. I plan to meet these expectations by applying to various jobs and being persistent in the application process.', 682, 148, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27591, 'Instead of working in a game company to gain experience, or work for money, I could just work towards what I want in the first place. Having my own game company accumulating intellectual properties, reputation and talents, I would have the power to impact the industry greatly. It will also provide me financial freedom and a place I would love to work in.', 666, 59, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27592, 'For customers, producing games that could really entertain them. For employees, building a great work culture and environment, produce profitable games that keeps the company going. As well as building a talented team where people will be motivated.', 666, 60, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27593, 'I already have built a team and released a few games. Although the results are not that great. But I am learning so many things from these everyday in terms of marketing, customer acquisition, product design and implementation that I am confident in producing a much better product every single time.', 666, 118, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27594, 'Right now the company is registered in Singapore. However, I really like the weather in Silicon valley as well as the vibrant game development industry here. In terms of culture, it is impossible to produce an entertainment product that could be enjoyed by the biggest game-consumer market US if we do not even understand the culture. Staying in the place where you want to produce your products to is essential in it''s success. Hence, I would move the company here if possible. For culture, I really love Valve''s idea of a flat management hierarchy. They have no such thing as management position. Every employee could do whatever they want, both in creating new products, or joining product teams. It is their freedom to express their talent and creativity. This is also what made their per-employee profitability higher than Apple or Google. This is a culture I want to create in Sabaton games, where talents have the freedom to utility their abilities to their best.', 666, 115, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27595, 'For companies that are part of both tech and entertainment industries, who are looking for a community manager that goes above and beyond, Marielisa Argueta is an aspiring community manager that has cultivated a passion for technology that solves business problems, communicates ideas, and entertains and captures customersâ€™ attention, unlike other applicants, who are only looking for a means to pay the bills', 682, 183, 365, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
