(27605, 'For entertainment, it is usually not about the idea but the execution. With a culture that let creative talents utilise the best of their abilities, our products will have an execution unmatched by most others. ', 666, 116, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27606, 'To achieve my goal, I will need some funding. The current team working with me are not taking a salary and took equity instead. However, this is only possible as they were still students and could afford to not have an income. However, for them to work full time now after they have graduated, I will need funding to at least pay them a decent salary. To get this funding, currently I have 2 options. I could get a few hundred thousand dollars of funding from parents in return for shares in the company. Alternatively, the currently company Appsverse Inc. has expressed interest in incubating Sabaton Games. I believe that if this is successful, Sabaton Games will create some of the greatest masterpiece the world will ever see.', 666, 117, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27607, 'One risk is that the funding could run out and none of the games we produced made much money. This is rather likely. To reduce the risk, we will have to keep track of data consistently and learn from every single failure. An improvisation could be to produce smaller and simpler games in a much shorter duration for the purpose of purely understanding the customer base and gathering data.', 666, 119, 193, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
