(27687, 'I will achieve my goal by building a world-class team committing to build a world-class product/solution.\r\nThis product/solution will solve a great need in the world and be a step forward in the story of human progress.', 683, 150, 522, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
