(27737, 'product marketing manager at a tech company (e.g. Google)', 680, 105, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27738, 'I will work in a large international company, will be able to travel for work, have a well-recognized and respected company name, will use the latest technology and will try to think creatively to solve their problems', 680, 106, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27739, 'They would expect me to have superior marketing and communication skills, interpersonal skills, ability to work many hours and manage my time, ability to work on team, think creatively and be proactive', 680, 107, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27740, 'I have good communicational and interpersonal skills, and I''m good at teamwork. I don''t have any marketing experience yet, but I''m taking a GEM class and hope to get a marketing internship over the summer. I am trying to think creatively and I am active in life.', 680, 148, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27741, 'It''s in a big city with lots of people working together in an open space, everybody is collaborating and helping each other, there is no competition at work and co-workers hang out together after work, it''s either tech or cosmetics or non-profit, but it''s definitely a place that cares about giving back to the community. And it''s also a large multi-national company with offices all over the world, that gives you the ability to travel and work from different offices.', 680, 154, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27742, 'I don''t like to compete, I like to help and collaborate. However if I do compete, I''m trying to do my best and I never do something bad or dishonest toward my competitors. \r\nWhat differentiates me? I''m a good person, I speak 4 languages, I lived on 3 continents, I''m very open and sociable, I love learning and I learn very fast, I''m funny and easy-going, I''m intelligent and smart, I like everything new and diversity, and I believe that good work depends not only on how qualified you are, but also who you are working with.', 680, 149, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27743, 'Stanford will help me achieve my goal. I''ll try to leverage my network of friends and faculty here to get to the places I want. I don''t think I have an impact on the world so far, and I don''t have big goals of saving all the starving children in Africa, I think I can make this world a little better helping one person at a time.', 680, 150, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27744, 'My main obstacle is that I don''t have professional and technical experiences. I love my education, but I think that  all these interesting liberal arts classes didn''t tech me any skills I would need in my professional life. This can be mitigated by gaining experience in summer internships and taking more practical courses at Stanford. I also don''t have enough connections here and speak English with an accent. This can be mitigated by networking. ', 680, 155, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27745, 'I''m a passionate and motivated person with a lot of international experience and great communicational and interpersonal skills, I''m a fast learner and I have always achieved my goals. I am very well educated and am passionate about learning more. I''m an easy person to work with and have a proactive life position.', 680, 183, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27746, 'a specialist in the UN or one of its divisions', 680, 109, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27747, 'I''ll be working in a global organization with offices all over the world. I''ll feel fulfillment from my job, I''ll be surrounded with smart people, I''ll learn a lot, and I''ll work for a well-recognized and respected company', 680, 110, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27748, 'They would need analysis, communication, writing papers, research', 680, 111, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27749, 'I''ll have a graduate degree, I speak 3 out of 6 UN official languages, I have degree in international relations and I am very interested in global affairs, I can also do research (I think) and have analytical skills (I suppose)', 680, 156, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27750, 'A large office in a big city where everybody is dressed up professionally and has his or her own room with big windows, a lot of meetings, team projects and travel to other countries', 680, 112, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27751, 'Stanford network, mainly (hopefully) professors could introduce me to people there. My impact would be working on very important projects that would either foster international relations or would help developing countries.', 680, 114, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27752, 'I speak 3 of the 6 official languages, I have extensive knowledge on international affairs, I lived on 3 continents, I have experience of Model UN and I''ll have a Stanford network.', 680, 113, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27753, 'I don''t have experience working in an NGO, I don''t know anybody who worked in the UN, this would be a low-paid job and I heard that there''s a lot of bureaucracy there.', 680, 157, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27754, 'I''m a global citizen who lived in 3 countries, studied international relations and got a Master''s from Stanford, I speak 4 languages and I''m a fast learner. I work well on a team and am passionate about your mission.', 680, 184, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27755, 'Researcher in a private research company', 680, 58, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27756, 'I''ll be working in a research company. I''ll learn a lot, spend time with interesting and intelligent people and will have flexibility in terms of hours/location.', 680, 59, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27757, 'Professionalism, research skills, foreign language skills', 680, 60, 44, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
