(27845, 'Researcher for Google', 684, 105, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27846, 'Google is a well funded business with diverse goals. One of their goals, to advance technology for the betterment of mankind, aligns with mine.', 684, 106, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27847, 'My intellect and dedication to my work and cause.', 684, 107, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27848, 'I''m an electrical and electronic engineer. I would undertake a masters programme after my undergraduate education. At the same time, I am developing skills relevant to my goal and striking relationships with people who can be of help with me in the future.', 684, 148, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27849, 'An environment that allows me to focus on my work but without unreasonable deadlines, a great and supportive team and excellent leaders. Singapore would be a great place, but I am not ruling out other countries such as the United States, Japan and parts of the European Union. Being able to stay with my loved ones will be a strong factor.', 684, 154, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27850, 'I am a fast learner and think quickly and creatively. Very often, I cross multiple fields of work and can come up with new products and solutions that combine the best of multiple fields.', 684, 149, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27851, 'My teachers and mentors, the support of my loved ones and contacts who help me along the way. I will reciprocate by helping them out in any means I can, and to be appreciative of how they have helped me. Hopefully, what I do will help further science and technology and make lives better for people.', 684, 150, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27852, 'Others reach my goal before I do, Google closes, Singapore or the world goes to war. These are out of my control. What I am in control of is to ensure that I learn what is necessary, do what is necessary and adapt to this ever-changing world, all whilst not overstretching myself. So far, I am only at the preparatory stages of my long-term goals, but I am doing well.', 684, 155, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27853, 'For the companies who need creative answers to complex problems, Liwei is a polymathic engineer that utilises vast knowledge and ingenuity to bring you effective and elegant solutions. Unlike run-of-the-mill engineers today, Liwei has true passion for solving problems.\r\n\r\nThinker, Hacker, Pioneer.', 684, 183, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27854, 'Founder of a technology research business', 684, 109, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27855, 'This is as direct as it gets to achieving my goal to advancing technology for the betterment of mankind.', 684, 110, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27856, 'The best researchers that I can find, working on technologies and products that affordably helps people, while keeping the business profitable.', 684, 111, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27857, 'Over the years I have been interning or working at different research agencies in Singapore and have put in efforts to keep in contact with them. My current stint in Silicon Valley is also gaining me a lot of contacts in the technology and business side of things. I am currently taking a minor in Technopreneurship and wish to take an MBA alongside my Engineering graduate studies.', 684, 156, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27858, 'My long-term vision is to utilize my abilities to their fullest potential by translating them into actual value. Having come from a technical background, the position as a CTO provides the role that permits me to bring the most value to my company. ', 678, 106, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27859, 'The relevant stakeholders are my co-founders and investors of the company. They expect me to be competent in my role and stay true to my vision of the company.', 678, 107, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27860, 'In order to qualify technically, I will finish my Computer Science degree and also stay updated with the latest technological developments. More importantly, I must develop an acute sense of judgement for technological trends. As an entrepreneur, I will expose myself more to the investor scene and develop deep understandings of the investors'' agendas and how I could fulfill those interests as a CTO.', 678, 148, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27861, 'To attain competitive advantage, my startup will focus on a niche target and compete on price through economies of scale and service through technological integration. Due to the disruptive nature of the business, my company would also have the first-mover advantage in the market.', 678, 149, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27862, 'I will be in either Silicon Valley or Singapore, places where resources and capital for technology is abundant and well established. My startup will revolve around the Art as I have identified that it represents an industry that is the slowest in catching up with technology. To me, this represents immense opportunity in revolutionizing an industry that has hardly changed since the renaissance.', 678, 154, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
