(27878, 'Unitarianâ€“Universalist fellowships will provide support and encouragement for my creativity, and I will reciprocate with inspirational and challenging materials. My impact on the world is a lifelong everyday ministry.', 652, 150, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27879, 'I face primarily the risk of losing my job at Fenwick & West. Iâ€™ll minimize this risk by applying my integrity and industry to my work. Working at Fenwick & West will give me the flexibility I need to engage in my lifelong everyday ministry.', 652, 155, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27880, 'For free thinkers who believe that we must give meaning and purpose to life, Iâ€™m a resource and friend possessed of insightful perspective relevant to their spiritual journey.  Unlike many career ministers, I offer personal experience applying spiritual principles in the everyday life of a working professional.', 652, 183, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
