(27886, 'I possess singular creativity, intellect, and integrity, which would together make me particularly well suited for full-time ministry.', 652, 113, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27887, 'My divinity school and my Unitarianâ€“Universalist fellowships would help me achieve goals on this path.  I would reciprocate by engaging my values and serving wholeheartedly.  Every day, I would have a direct impact on my community.', 652, 114, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27888, 'Iâ€™d have to get accepted at divinity school, and Iâ€™d have to get placed as a minister.  Iâ€™d mitigate these risks by continuing to work hard, applying myself wholeheartedly to the path.  Iâ€™d face financial uncertainty, too, which Iâ€™d mitigate by living my values of industry, simplicity, and conservancy.  This path would straightforwardly accomplish my long-term goals.', 652, 157, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27889, 'For free thinkers who believe that we must give meaning and purpose to life, Iâ€™m a resource and friend possessed of insightful perspective relevant to their spiritual journey.  Unlike many career ministers, I offer personal experience applying spiritual principles in the everyday life of a working professional.', 652, 184, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27890, 'small-business owner or independent creative', 652, 58, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27891, 'On this path, Iâ€™d be able to choose my everyday activities, as well as my medium- and long-term projects, to match my long-term vision of serving others through everyday creative ministry.', 652, 59, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27892, 'My customers and stakeholders would expect meaningful creative works from me.', 652, 60, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27893, 'I have a uniquely strong intellectual and spiritual background, together with a good share of creativity, that would enable me to meet expectations.', 652, 118, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27894, 'Iâ€™d likely want to own a publishing company, or at least, to publish my own creative works.  By working independently in this way, Iâ€™d enjoy complete freedom to pursue my dreams.', 652, 115, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27895, 'My creative works would contribute my unique, creative, and thoughtful voice to important aspects of everyday life.  Iâ€™d contribute by making sure that I not imitate but innovate.', 652, 116, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27896, 'My family and friendsâ€”particularly my life partnerâ€”would help me by supporting and encouraging me.  Iâ€™d reciprocate by supporting and encouraging my family and friends.  My impact on the world around me would outlive me, if I were to follow this path.', 652, 117, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27897, 'This path implies thoroughgoing uncertainty, which largely cannot be avoided; at the same time, however, this path would most directly enable me to pursue my long-term goals, regardless of material success or failure.', 652, 119, 325, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
