(27956, '10 years from now, I see myself with the starting of a family.  I will be close to my parents and hopefully my siblings.  I will be working a management/coordination job.  I want to be in the United States to be close to family.  It will be on the Coasts, either norther California, Seattle, or San Diego, or on the East Coast in Boston, Washington DC.  Posiibly Colorado if it captures my heart.  I think I would like Seattle or San Francisco most.  Mild, on the coast, lots of hiking opportunities.  ', 687, 44, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27957, 'I will be a wife, good friends, and a supportive community.  Hopefully that community will be Jewish, but it just needs to be a community.  I want my family close at hand.', 687, 45, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27958, 'I will be doing something creative bringing happiness to friends and coworkers.  Ideally I will be in an organization that is improving the lives of those around us.', 687, 46, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27959, '8ea6c5d9ec323201c21e1aaaadb60ec9.jpeg', 687, 91, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27961, '50300052eadf42c08bd49934513d1d8f.jpg', 687, 92, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27963, '28f92710650be7eab2d6ac7914e343e7.jpg', 687, 93, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27965, 'Creativity Coach', 687, 109, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27966, 'This path will allow me to develop my skills as a creative consultant to unlock the creativity in others.  This path will give me practice on how to interact with others and augment their potential.  It will allow me to practice being creative in my everyday life as well as give me experiences of coaching and leading others.  Because this is a coach-type of position, it leaves me time for work/life balance.', 687, 110, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27967, 'My target stakeholders will expect me to be on-call and to help them. They expect me to deliver.  They expect me to have a portfolio of successes and prior experience.  They expect me to have answers and to be able to find the answers that I don''t have.', 687, 111, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27968, 'Experience, experience, experience.  Having an academic background will be a plus for helping prove my techniques are effective.  Otherwise, I need the portfolio.  Ideally I would have the stability of working inside a corporation/organization rather than doing freelance work.  Still, I need to take on projects where I can find them and then follow those projects through and document them. Once I start the documentation process, I will have my base of understanding.', 687, 156, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27969, 'I need a culture that is ok with taking a few risks and doing things in not always the most efficient manner.  I need a culture that demands success and will not let me get away with doing something half-way.  I need a culture that is forgiving and willing to give second chances.  I need a culture that supports work-life balance and has a sense of office camaraderie.  ', 687, 112, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27970, 'I combine rationality with emotion, quantitative problem solving with qualitative approaches.  My passion is people, and I use all the skills available to bring people and ideas together.  I do not shy away from something new, I do not give in until I am told to stop.  I can provide the detailed resources to help people unlock their creative potential while focusing on the big-picture elements driving success forward.  I consider myself a jack-of-all-trades with a dedication to people.  I make people feel comfortable, taken care of, and assured.  That sense of assurance is what I bring to my interactions and to my work.', 687, 113, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27971, 'My mentors and project parters will be my biggest help.  My "product" is the sense of assurance I deliver through my patience, kindness, and competence.  These are not traits easily communicated through a job interview but are communicated trough my work.  Instead, I will rely on the recommendations of my previous employers and their networks to introduce me to new opportunities.  In that case, my reciprocation is to pay it forward.  By having a strong work ethic and providing quality work to my employers and clients first, it gives me a position with which I can ask them for advancement and let them bring opportunities to me.  If the relationship is built such that they feel like I am going out of my way for them, most of the time, they will want to go out of their way for me.  It is passing on the kindness and respect, which irrespective of the creative good I bring will, impacts the world positively.', 687, 114, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27972, 'My weakness is my sense of living too much in the moment and the ability to justify decisions after the fact.  This means I will get fixated on one project which could derail my ability to tackle other opportunities in life.  This can be avoided by constantly referencing the big picture of where I want to be going.\r\n\r\nThe other obstacle I face is the challenge of having a family.  If that comes up, it is something I want to embrace and is something I do not want to avoid.  I would rather have a family once I am more established with my career, but there are many things in life I would not want to avoid and that I would not want to control.\r\n\r\nI also may find a new passion.  If that is the case, I should throw myself into it and not be boxed in by the plans I set.', 687, 157, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27973, 'For:  People in companies and organizations, for-profit or non-profit,  who want to unlock the creative potential of their organization and employ ways of having fun to accomplish goals that improve life.  I am someone who can provide those experiences in a caring and exciting manner that unlocks the potential of those I work with.  Unlink other creative consultants, I do not live in the creative clouds but focus on crafting lasting communities of support that uphold values leading to creative thinking and cooperation.\r\n', 687, 184, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27974, 'Manager Health Non-Profit, vaccines or health-tech', 687, 105, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27975, 'By being a manager, it allows me to be around people, to help coach them, to help them unlock their potentials, and to engage with problem solving on a daily basis.', 687, 106, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27976, 'My stakeholders will expect me to be there for them.  I need to be a competent manager and politician and be able to provide for my stakeholders in a shifting environment with many options.  I will need to make myself available and be accessible.  My stakeholders will want me to treat them with respect.', 687, 107, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27977, 'I need experience of managing products, campaigns, and people.  I will need to build up a portfolio of my experiences abroad and in the field.  I have my thesis, research experience, and academic experiences to rely upon, but I need field experience with organizations and current projects to build up my experience.  For me, my experience correlates strongly with my confidence.  If I know what I need to do, I can easily divide up the work and bring stakeholders in.  When I do not know what to do, I tend to make an ineffective manager.', 687, 148, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27978, 'A professional environment where I would thrive is one that has an open office where mingling can occur.  I want an environment that includes many meetings, many chances to interact and manage others.   I want a culture that is forgiving and a culture that has a strong work-life balance built into it.  I want to work with competent and driven people.', 687, 154, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27979, 'I come from an engineering background with practice in data analysis.  While my analytical abilities are not as strong as a social scientist, I have the training to pick up technical skills and information quickly.  I am able to adapt to new technology and apply them to solve new problems in the field.  My creative background keeps me open minded and my interest in people makes me amenable to bringing different cultures together.', 687, 149, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27980, 'Paul and Rajaie will help me start out with my goal as my mentors and contacts into the health policy world.  From there, I will rely upon the work I do for them as proof of my quality.  When I go above and beyond for my mentors, it generates the feeling to go above and beyond for me.', 687, 150, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27981, 'I face the obstacle of bureaucracy.  I enjoy flexibility and directness in my work. and would not want to get bogged down by excessive rules and layers.  I also would run into the obstacle of loosing interest.  If I am on a project too long, I might be sloth to keep putting my all forward.  I might also fail a project.  If it does not succeed, I would need a backup plan to help turn the failure into a learning experience rather than just a failure.\r\n\r\nThese are in addition to the risks proposed by having a family and finding a new passion.  Those I would not want to avoid, because if they happen, then it is for a good reason.  (Using family planning techniques is a given, this is more the risk of having a discussion with my significant other that now is the right time to start a family, a time earlier than I would have expected)', 687, 155, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27982, 'The people that could help me achieve this goal are my co-founders who have the confidence in me as the CTO of the company. I will reciprocate by fulfilling my role to the best of my abilities as CTO in the company by constantly upgrade myself to be in better positions to develop technological strategies. The impact that I''ll have on the world around me is to bridge the disconnect between art and technology and in so doing, bring about innovation in the art industry.', 678, 150, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27983, 'For those who want to improve lives through innovative health technologies, I am a project manager specializing in launching innovative health projects through patience, skill, and drive.  Unlike other project managers, I use my background in creativity and sensitivity with people to build highly functional and flexible teams to tackle health''s toughest problems.', 687, 183, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27984, 'f4ad7e8b5002053d79174d7c5bc1b28b.jpeg', 687, 98, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27985, 'The Bill and Melinda Gates Foundation represents the ability to improve healthcare and quality of life', 687, 101, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27986, 'ad64d7c17b56eca14afa6ba6053c9b32.jpeg', 687, 99, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27988, '455c9dc2f51331f5daeb653f54750caf.jpeg', 687, 100, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27990, 'Science or Creativity Teacher.  ', 687, 58, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27991, 'It means my work is constantly working with others.  Individually, I will be working to create effective new tools to help improve the experience of others.  With others, my role will be a leader, coach, and counselor helping others to unlock their own potential.  As a college lecturer, I will be working with young bright minds facing lots of uncertainty and lots of decisions so there are lots of opportunities for success.  I would not want to be a researcher, I would want to be a student coordinator sponsoring student groups and projects.', 687, 59, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27992, 'My target stakeholders will expect me to be reachable, responsible, and having practice teaching.', 687, 60, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27993, 'e82cafec7b6d832db00e85337a022b34.jpg', 673, 2, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27994, 'b42dbddde3f773ea0c4f9e5ae34d2e0b.jpg', 673, 3, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27995, '31abe277fe2562966ac952014bc8cb18.jpg', 673, 4, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27996, 'I will need a teaching credential and the relevant education training to craft the appropriate programs.  I will also need teaching experience in the form of programs, classes, and sessions I have taught.  Building up that resume will help me.  I need to refine my class to have a clear deliverable since it will not fall into the normal definition of classes taught in a college setting.', 687, 118, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27997, 'The biggest risk I face is that the fusion between art and technology diminishes the personalized experience of art. This risk could be minimized through carefully designing my business such that it augments artistic experiences instead of replacing them. I am already on the path of accomplishing this long term goal by founding my startup back home in Singapore.', 678, 155, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28005, 'I will need a supportive staff environment.  I will want to teach topics that are uncommon and will need the ability to pursue these projects without resistance.  I will also need to be able to have a secure salary to support my family.  Having the ability to go home in the afternoon will be crucial for finding work-life balance when I start planning for a family.', 687, 115, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28011, 'I am a Stanford-educated professional with a host of experiences that is committed to being there for the next generation of students.  Most people with my education and experience would not go into college classrooms.   I would be an oddball, but I would bring network and experiences that help inspire my students.  I will want to be involved in consulting on the side bringing in those experiences as well.', 687, 116, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28012, 'Family and friends will be the key support.  I give them what they give me and will make sure to show my appreciation.  I will need help from my mentors to help find networks and opportunities to reach the positions I to get me my teaching experiences.  I can and will do my own research, but I appreciate the input my friends and family have.  My clients and other business relationships can help secure jobs and consulting opportunities to ensure I have a stable income.', 687, 117, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28013, 'I face risks of being closed in economically.  If I cannot make the income I need, then that jeopardizes this plan.  I can try to position myself within an environment that helps pay well enough or I can try to secure income either through savings from a previous career or investment or with a job on the side.', 687, 119, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28014, 'In our modern world, art and technologically represents one of the largest disconnects. As an technically qualified individual who recognize this trend, I have the vision and skills necessary to bring about disruptive innovation in this field and be in an influential position pave the direction for technological progress in the arts.', 678, 183, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28015, 'For students seeking a way to apply their science learning to unlock new areas of potential, I am a lecturer who brings my experience from the field to inspire students in new ways of applying their knowledge.  Unlike other professors, my work is grounded on teaching a process of application rather than teaching specific fundamentals of knowledge itself. ', 687, 185, 249, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
