(28056, 'One of my long term visions is to develop an acute sense of judgement and being able to utilize it in the most strategic manner possible. Not only does a financial institution provides the roles to exercise such skills, the use of money as a resource provides a denomination that could accurately enumerate and evaluate my personal development.', 678, 110, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28058, 'Being in a financial institution such as a bank, I''m expected to help my clients derive the highest value.', 678, 111, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28064, 'In order to break into the financial industry, I would pursue an MBA to receive the adequate qualifications and developing the right perceptions. More importantly, MBA provides an immense opportunity for me to diversify and expand my network by getting to know the industry leaders of tomorrow.', 678, 156, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
