(28104, 'New York City- Good friends,  customers of my life coaching, and the wealth of diverse strangers in this massive city\r\nStanford University- Professors, and students\r\nJakarta- Non-profit leaders, people in poverty who are ready to play a role in ending it\r\n', 673, 45, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28105, 'Finding out the most efficient ways to increase access to clean drinking water.\r\nI will have an influential leadership role at an existing non-profit, form my own non-profit, or become an adviser to a non-profit.\r\n\r\nIn New York City, I will enjoy all the activities this large city has to offer, coach people, give speeches on success, compassion, altruism, and happiness, and fulfill my love for frequent interactions with strangers.\r\nIn Stanford, I will work with professors who are doing cutting edge research and I will find Stanford student interns who can benefit from the experience of working with me.\r\nIn Jakarta, among other places, I will work on increasing access to drinking water by working with non-profits as well as people in the area. I will either build wells, use filtration techniques, or use the latest cutting edge tool deemed most appropriate in the future.', 673, 46, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28107, '90f0f643f8f09f49eebfc851598c0ae8.jpg', 673, 91, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28108, 'acb9626f5fe5bc235e403c9dac9dfd66.jpg', 673, 92, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
