(28115, 'Google Project Manager', 688, 105, 603, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28116, 'First position as a manager in high-tech.', 688, 106, 603, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28117, 'My hard work and skills', 688, 107, 603, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28118, 'degree, PM skills', 688, 148, 603, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28119, 'As getting into financial institutions is difficult and extremely competitive, I would need to compete on qualifications and personal qualities. On qualification, not only do I have to attain an MBA,  I must also have extensive experience working in a role that exercises management and strategic planning. On personal qualities, I would need to convince others that I am passionate about my job and is sincere in bringing value to my clients.', 678, 113, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28120, 'The biggest obstacle that I face is the transitional phase from having a technical background to acquiring financial knowledge, both in theory and practice. This obstacle is inevitable and I will have to face it when I pursue my MBA. I am currently reading up on finance and learning from my friends in business. I also push for opportunities to network with investors.', 678, 157, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
