(28151, '3212689153148265e9afe1c54c4b61e9.jpg', 637, 98, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28152, '2674ec4211f18f339316edb2cca34d46.jpg', 637, 99, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28153, '32a66f58b71443f49e7a7e65ee60d457.jpg', 637, 100, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28154, 'The first company that I work for is extremely important in helping me achieve my goal because it has to add strategic value to my career by allowing me to exercise the qualities that I''ll need when I work in corporate finance or investment banking. I will reciprocate by contributing to the first company to the best of my abilities while I work there. The world around me corresponds to the clients of the financial institution, and my impact to them would be helping them to raise the most funds or deriving for the best mergers and acquisitions.', 678, 114, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28156, 'Product Manager', 637, 105, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28157, '1. So far I only have experience working for small tech startup companies. Learning the structure/procedures/methodologies of a big company has significant value when it comes to bootstrapping your own venture.\r\n2. Great source of motivation: These companies offer products being used by millions of users every single day. Having a small impact in their daily lives is the most fascinating accomplishment when innovating or creating new products.\r\n3. These companies lead the future. You can easily identify what the next big trend or wave will be while working for them.\r\n4. I will develop a very strong technical niche expertise (e.g. web performance) which I can exploit in my own ventures in the future.\r\n5. These companies pay top money. This monetary comfort will be of great value when bootstrapping.', 637, 106, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28158, 'My customers (potential employers) want to hire people who can take their companies to new heights. A product manager is said to be a mini CEO within his team.', 637, 107, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28159, 'I already have some experience which can be helpful towards meeting those expectations. My startup experience so far, my computer engineering background and my degree from MS&E at Stanford will be very valuable.', 637, 148, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28160, 'In the short-term I would prefer a city in the U.S (San Francisco, Seattle) but in the long-term I want to return to Europe (London, Athens). I love vibrant offices, workspace with lots of windows and listening to music. ', 637, 154, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28161, 'I believe that I have a unique mixture of skills, traits, working experience and achievements that differentiate me from other candidates.', 637, 149, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28162, 'Personal contacts who can refer me to some of the high-tech companies will be of great value for me. Usually also making them a favor in the future or sending them a gift is a great way to reciprocate.', 637, 150, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28163, 'Get no offers for product management positions (although I already have one). I can avoid that by doing as many interviews as possible before graduating from Stanford.', 637, 155, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28164, 'Passionate for new technologies, web and the mobile world, with strong technical background in computer engineering. Three times founder of venture-backed startups in Greece and graduate student in Management Science & Engineering at Stanford University. I love innovating, designing and building products from scratch which are finally being used from millions of users around the world.', 637, 183, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28165, 'Investment Banker', 637, 109, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28166, 'It doesn''t help realize my long-term vision in a direct way. However, having worked for some of the biggest Financial Services in the world can be a great experience independently of what you are planning to do in the future.', 637, 110, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28167, 'The expect me to have great knowledge of the state-of-the-art investment techniques. Understanding of the market and the long-term trends.', 637, 111, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28168, 'I have taken some Finance classes during my Masters degree at Stanford.', 637, 156, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28169, 'In the short-term I would prefer a city in the U.S (New York) but in the long-term I want to return to Europe (London, Athens). I love vibrant offices, workspace with lots of windows and listening to music. ', 637, 112, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28170, 'I believe that I have a unique mixture of skills, traits, working experience and achievements that differentiate me from other candidates. My disadvantage in the finance sector is that I don''t have prior experience.', 637, 113, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28171, 'Personal contacts who can refer me to some of the high-tech companies will be of great value for me. Usually also making them a favor in the future or sending them a gift is a great way to reciprocate.', 637, 114, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28172, 'I am an individual who recognizes paths and alternative options to reach my goals. Given my technical background and passion for making strategic judgements, I would add great value to the company by having a firm understanding the interest of business clients which are technological in nature', 678, 184, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28173, 'Get no offers for investment banking internship positions. I can avoid that by doing as many interviews as possible before graduating from Stanford.', 637, 157, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28174, 'Passionate for new technologies, web and the mobile world, with strong technical background in computer engineering. Three times founder of venture-backed startups in Greece and graduate student in Management Science & Engineering at Stanford University. I love innovating, designing and building products from scratch which are finally being used from millions of users around the world.', 637, 184, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
