INSERT INTO `prod_answers` (`id`, `answer`, `user_id`, `configure_id`, `user_game_status_id`, `created`, `modified`) VALUES
(28186, 'Trustworthy', 637, 40, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28187, 'Curious', 637, 41, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28188, 'Enthusiastic', 637, 42, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28189, 'Increasing access to drinking water', 673, 105, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28190, 'I will save lives, and increase happiness', 673, 106, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28191, 'Singapore will be a good place to start as I believe it is in the early stages of becoming an Asian entrepreneurship hub. It is also where a lot of great minds converge, with great living conditions and economic stability.', 684, 112, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28192, 'Singapore is in the beginning stages of diversifying from a finance based industry to technology and research industries. More technology firms are opening offices in Singapore and the government is setting up more research facilities. However, the environment is still young and most if not all of Singapore''s research agencies are government, non-profit based. The lack of profit-incentivised competition leads to slower moving research and government support tends to focus on specific fields of development. What my business will focus on is much more diverse and is funded by profit.', 684, 113, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28194, '1346898246196162276a52852ac6cd24.jpg', 637, 91, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28195, '44b8a755fbf8661defa6ac9575323ddc.jpg', 637, 92, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28197, '678d55ec2d13e0df94c43a86ec8c7bcb.jpg', 637, 93, 156, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28199, 'My contacts who have expressed interest in this idea, VCs and other funding sources who will help fund the initial part of the business. I will reciprocate by ensuring that they are a vital part of the business.', 684, 114, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28200, 'Singapore is still pretty much a finance based industry and looking for relevant talents may be difficult. There is also concern that the country may be reaching maximal growth, thus straining resources, leading to future uncertainty. These obstacles can be avoided by importing foreign or nurturing our own talents and in the worst case, starting or moving the business to a similar country, Burma, for example.', 684, 157, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28201, 'Leadership experience, persuasive ability to convince private donors to fund projects', 673, 107, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28202, 'For the people who want a better life, TechCorp is a technology research and innovation agency that focuses on improving the lives of people. Unlike government and purely research-only agencies, TechCorp dedicates most of its effort to accelerating cutting edge research into practical products fit for consumer use.', 684, 184, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28203, 'Currently I have leadership experience from activities at Stanford and a masters degree. In the near future, I plan to get join strategy and sales roles in tech companies that are still private. This often means that they have a large room for growth, allowing me to hone my leadership skills in this area.  Taking charge of sales will make me more persuasive which will be important when I am raising funds for my non profit.', 673, 148, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28204, 'I will travel approximately 20% to 40% of the time for my job. I will work in an industry that saves lives such as health care or water.\r\nI want a work culture where performance and effort is rewarded, rather than following a dogmatic set of procedures.  It is important to me that there is as little power and status play as possible within the organization I''m working in and that employees take time to appreciate each other. In addition, it is important to have optimistic benevolent colleagues who are invested in each other''s growth and who respect each other''s non-work commitments.', 673, 154, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28205, 'I have a strong ability to motivate and keep people inspired. I am good at attracting talent by making them feel appreciated and giving them the responsibility and trust that they desire. I will compete by attracting the best talent by emphasizing the mission of increasing access to drinking water and inspiring them to achieve their highest potential. This will lead to a high efficiency (in terms of cost to bring water to one person, adjusting for factors such as technology used and town/village density)projects which will encourage donors to donate.', 673, 149, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28206, 'An engineer at SingTel', 684, 58, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28207, 'The last of my viable paths. It allows me to put my long-term vision on hold and work in a field I love while I figure things out.', 684, 59, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28208, 'To be a good engineer, to innovate and be an asset to the company.', 684, 60, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28209, 'I''m an electrical and electronic engineer. I would undertake a masters programme after my undergraduate education.', 684, 118, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28210, 'A competitive working environment that keeps me interested and excited about what I''m doing, while having colleagues that know to draw the line between competition and being friends.', 684, 115, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28211, 'In increasing access to drinking water, fellow non-profit leaders will help me by letting me take charge of large initiatives like building a well in a village or analyzing the lowest cost method of increasing access t owater. I will reciprocate by working for free or a low fee in this arena.\r\nThe impact, is a world with less death due to water borne illnesses.\r\n', 673, 150, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28212, 'I am a fast learner and think quickly and creatively. Very often, I cross multiple fields of work and can come up with new products and solutions that combine the best of multiple fields.', 684, 116, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28213, 'My teachers and mentors, the support of my loved ones and contacts who help me along the way. I will reciprocate by helping them out in any means I can, and to be appreciative of how they have helped me. Hopefully, my stint at SingTel will allow me to gain enough experience and perspective and give me sufficient time to carry out my long-term vision.', 684, 117, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28214, 'For the companies who need creative answers to complex problems, Liwei is a polymathic engineer that utilises vast knowledge and ingenuity to bring you effective and elegant solutions. Unlike run-of-the-mill engineers today, Liwei has true passion for solving problems.\r\n\r\nThinker, Hacker, Pioneer.', 684, 185, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28215, 'For increasing access to drinking water, my main obstacle is a lack of knowledge of water engineering. In addition, I currently do not have much non-profit expertise. I can read many books or take a few classes part time to become savvy enough to understand the basics of water engineering. In addition, I will stick to the business side of increasing access to drinking water.  To build non-profit experience, I will do some pro-bono work for free while working in my first few jobs in the for profit sector. Yes, I am achieving my long term goal of saving lives by increasing access to drinking water.\r\n', 673, 155, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28216, 'I run my organization with highly ambitious and talented employees and we are rapidly making lack of access to drinking water become a problem of the past.', 673, 183, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28217, 'My skills become irrelevant too fast, SingTel closes, Singapore or the world goes to war. These are out of my control. What I am in control of is to ensure that I learn what is necessary, do what is necessary and adapt to this ever-changing world, all whilst not overstretching myself. So far, I am only at the preparatory stages of my long-term goals, but I am doing well.', 684, 119, 635, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
