(28243, 'I want to be a freelance web developer as it would grant me the freedom and control over my schedules. As a freelance web developer, I could work from my home and thus spend more time with my family.', 678, 58, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28244, 'Travelling life coach', 673, 109, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28245, 'Increase happiness, altruism, and compassion in the world', 673, 110, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28246, 'Persuasive personality, ability to motivate, speaking experience, life coaching experience, wide network of friends to source advice from', 673, 111, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28247, 'In order to be a paid life coach and speaker, I will first coach and speak for free. Gradually, I will start charging for these services.', 673, 156, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28248, 'I will travel approximately 20% to 40% of the time for my job. I will work in an industry that saves lives such as health care or water.\r\nI want a work culture where performance and effort is rewarded, rather than following a dogmatic set of procedures.  It is important to me that there is as little power and status play as possible within the organization I''m working in and that employees take time to appreciate each other. In addition, it is important to have optimistic benevolent colleagues who are invested in each other''s growth and who respect each other''s non-work commitments.\r\n', 673, 112, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28249, 'To earn a lucrative salary from being a life coach and speaker, I will package my product differently and initially work on a targeted niche. I will find complements to my services such as books, and other seminars. This will provide better value for my clients and the decrease in profit margin (due to offering packaged services) will be offset by greater sales volume. In addition, I will carry some of the meetings in groups to give my clients a sense of camaraderie with each other. By targeting a niche group such as young adults in their 20s who have graduated college who enjoy the comaraderie of some group sessions , I can reduce competition with more established life coaches as well as charge a lower fee per person to cover costs.', 673, 113, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28250, 'To become a well sought after life coach and speaker, my network of friends will help me. To reciprocate, I will provide all friends who refer clients, free life-coaching services to them and all their families. I will provide advice to their children on college application for free. To friends who play a role in helping me secure high paying speaking gigs, I will give them a share of my income proceedings from those gigs. I will help more people achieve their goals and increase happiness in the world.', 673, 114, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28251, 'To become a sought after life coach, my main obstacles are credibility and getting people to pay for a product where some substitutes are free (advice on the internet). To establish credibility, I will need to first coach people for free and receive favorable reviews. To compete with free advice from the internet, I will need to be an extremely good listener and provide advice tailored to each specific individual. I will need to mentor each client by in person or video conferencing, rather than only corresponding by emails. I am accomplishing my long term goal of increasing people''s happiness and success.', 673, 157, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28252, 'With years of experience, I will help you better understand both your conscious and subconscious goals, and discuss the  options you have to make your dreams reality. Employing me as your life coach is the difference between walking to your destination and hopping in a car to get you there.', 673, 184, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28253, 'One of my long-term vision is to be someone who derives strong emotional support from his family. Being able to spend more time with my family allows me to develop stronger bonds with them, thereby fortifying my emotional and spiritual well-being.', 678, 59, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28254, 'afb990471038684716f9c37d757c6653.jpg', 672, 2, 314, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28256, 'c40b5a57802b9f0993dc9959c845be6f.jpg', 672, 3, 314, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28258, '0645bbf1e75a58d7c5f8222887ff25e7.jpg', 672, 4, 314, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28260, '86a0f6a4f2cf4befcbd5c1376f5926ba.jpg', 672, 35, 314, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28277, 'My target customers are people who requires project-based web projects. They would expect me to deliver and construct the website by the negotiated project deadlines and according to the given specifications. My target customers would mainly be companies that would require an online platform but do not have the expertise/experiences to build one. For startups pursuing an online platform, my skills would be would be appropriate for the development of a MVP.', 678, 60, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28284, 'Trustworthy', 672, 40, 314, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28285, 'As I have been doing web development and come from a technical background, I am already equipped with adequate skills to start off as a web developer.', 678, 118, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28286, 'Loving & caring', 672, 41, 314, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28287, 'Humble', 672, 42, 314, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28288, 'As the purpose of being a freelance web developer is so that I could have flexible schedules and spend more time with my family, I would work from Singapore. As Singapore''s startup ecosystem is taking shape, the demand for web developers would inevitably increase over the next few years. This also means that the job opportunities as a freelance web developer are plentiful in the next few years.', 678, 115, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28289, '4cb858cb58b08280a1a79d854068eafc.jpg', 685, 36, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28290, 'a61aac2850439c89ad3afa97b8d89b04.jpg', 685, 2, 174, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28291, 'Being in the startup community in Singapore, I understands the requirements and perspectives of startups. Hence, beyond developing the website for these startups, I could differentiate myself by offering relevant advice on how the website to help better augment/support their businesses. Fundamentally as a freelance web developer, I have to compete on my competence. To that end, I would need to build a good track record and gradually tackle larger projects and in so doing, build up my project portfolio.', 678, 116, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28293, '52219212b7603494b9b9bfa8f0dfcf3b.jpg', 685, 3, 174, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28295, 'I will spend more time on my writing and publish more books', 673, 58, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28296, 'As I will be working alone, there is no one that would directly help me. My impact would be on the startup community as I build the online platforms that would support businesses.', 678, 117, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28297, 'The more I write, the more I reflect. I will understand people better and will try to help other people do the same , through my writing. This will increase compassion in the world since through my stories, people will learn to empathize with others more.', 673, 59, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28298, 'The key obstacle as a freelance web developer is the income instability associated with the job. This could be minimized if I could build up my portfolio to a point where I could acquire large projects offered by big corporations that offers greater pays.', 678, 119, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28299, 'My readers will expect a concise story that is novel. In addition, they will expect the price to be low. I will publish using Amazon Kindle publishing since they only take 30% of royalties.', 673, 60, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28300, 'I have written regularly for the past 3 years. I have led a very interesting life. I will continue to do so, and will use this to my advantage when crafting my stories. Unique people that I have met and will meet in the future, will provide plenty of material for my stories to be novel. In addition, meditation and reflection will help me understand human nature better and hence construct stories with a lot of depth.', 673, 118, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28301, 'I will continue to cultivate my writing skills during my first few full time jobs. I will work in jobs that have a good work life balance so that I can devote enough free time to writing. \r\n\r\nI want a work culture where performance and effort is rewarded, rather than following a dogmatic set of procedures.  It is important to me that there is as little power and status play as possible within the organization I''m working in and that employees take time to appreciate each other. In addition, it is important to have optimistic benevolent colleagues who are invested in each other''s growth and who respect each other''s non-work commitments.', 673, 115, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28303, '1ae9497095861bcfceb7c1c15fe7bbe1.jpg', 685, 4, 174, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28313, 'Beyond having the skills required for web development, I also understand the demands of businesses and would provide insightful advices on how the website would better augment/support the business model.', 678, 185, 261, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28314, 'I will write a side of the story with a combination of characters that no one has seen before. I will compete by getting celebrities to endorse my product. This will make sales increase rapidly. I will convince celebrities to endorse my product by finding a famous celebrity to write an biography for. By this exposure, the sales of my more philosophical books will increase.', 673, 116, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28315, 'I will enlish celebrity help to promote by book. I will recriprocate by writing about them in a good light. The best celebrities to target will be the ones who are misunderstood and are going through a time where the media dislikes them. I will write a book that paints them in an honest but more flattering light. The impact from writing about the celebrity is not much. However the impact from the exposure will lead to people reading my other more philosophical books which will increase compassion in the world since people will empathize with the characters in my stories, and by extension people they encounter in everyday life who bare resemblances to these characters.', 673, 117, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28316, 'It will be very difficult to sell my first book. To avoid this problem, I will gather a lot of first time authors and read their books for them in exchange for them to read my book and leave me a review. In addition, celebrity endorsement will get me exposure which will increase sales. I will accomplish my long term goal of increasing compassion in the world by exposing my readers to the complex characters in my stories. This will train their empathy muscle.', 673, 119, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28317, 'Real insights occur when you peal away at the surface of perceptions. I''ll be your guide as I turn your everyday life into a roller coaster ride. Shock yourself as you start to see people in a completely different light, loving them despite all their flaws, and adding multiple dimensions to your perceptive abilities.', 673, 185, 199, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
