(28521, 'Getting a MBA is not about learning how to run a business, it is about getting into the resourceful alumni community. The access to the business community is priceless, as I will be able to tap into the resources in the future for my own venture.', 656, 59, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28522, 'As I said, the point of getting a MBA is to access the community. Therefore, choosing a renowned school is extremely important. I will need to accumulate a few years working experience first and get some good quality recommendation to get into those renowned schools.', 656, 60, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28523, 'Coming from an Engineering background, I certainly have to read up more about management and finance on my own to get up to speed. Be prepared is always the key to success.', 656, 118, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28524, 'Business School at Stanford, Berkeley or Harvard are my best options as they have a very strong and resourceful community. However, the final decision will still base on what kind of network I wanted to establish.', 656, 115, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28525, 'I have a strong desire of running my own venture in the future and I am very clear about my objective of going back to school. Unlike most of the students, I already know what I wanted to achieve in my life.', 656, 116, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28526, 'My employer/mentor and school professors play a vital part in this section. To get into a good school, having a good result is not enough, most of the time is also depends on influential referrer.', 656, 117, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28527, 'The primary obstacles is the competition and the only way to come out on top is to be at the top. If I am really serious about getting a MBA, I need to start taking action by preparing myself for all sort of test.', 656, 119, 304, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
