(28742, 'A modern social enterprise', 677, 101, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28745, 'I want to be an entrepreneur and pursue my own venture. ', 677, 105, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28746, 'This path is aligned with my overarching pursuit of doing inspired work that I enjoy. Working on my own venture will truly allow me to live life on my terms. It has been seen time and again that when innovation and technology come together,  it can have a massive impact. By working in this space I would hope to leave a mark in people''s lives and this would leave me with a sense of contentment in the long term. ', 677, 106, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28747, 'My target customers and stakeholders will first and foremost expect complete dedication and commitment from me towards my work. As a founder, it will be important for me to lead by example. At the same time, they would expect me to either have or gain relevant experience and knowledge of the industry and market I am working in. In addition, they would expect me to have a clear understanding of their expectations and interests. ', 677, 107, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28748, 'My track record of having worked with numerous startups in Singapore combined with my experience in the Bay Area as an NOC student puts me in the unique position of being aware and exposed to leading startup ecosystems. I plan to continue to build my network in startup communities around the globe to put me in a unique position to put all the best practices together and hope to be able to see effective synergies and opportunities where others don''t. ', 677, 148, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28749, 'Having worked in a startup environment numerous times I can vouch for the fact that I thrive in the vibrant atmosphere prevalent in most startups. Hence, the perfect environment for would be to be surrounded by passionate and drive team members working to solve a problem that we truly care about in a market that I understand - Singapore, the Bay Area or India. ', 677, 154, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28750, 'This may sound run of the mill, but one my main differentiating factor as a founder would be the willingness to do whatever it takes to succeed.  I am aware of the challenges it takes to make a business successful, I never hesitate to roll up my sleeves and do any sort of painstaking groundwork that would be required. ', 677, 149, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28751, 'I will primarily rely on my existing network in the startup ecosystems in Singapore and the Bay Area to help me achieve my goal. This network consists of fellow entrepreneurs, investors, industry leaders and university faculty. In return, I would give back to the ecosystem by helping in anyway I can in terms of helping people build their network and giving back to those who helped me. I also hope that my work will display such integrity and that those who have helped me feel happy and proud that they were behind my success. ', 677, 150, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28752, 'The biggest risk I face is failure as an entrepreneur. There is no guaranteed success strategy but I can ensure that I try my best to avoid failure and minimize loss by using frameworks such as the lean startup methodology. By going through the various stages of validation, me and my stakeholders would be better positioned for success as compared to those shooting in the dark. However, even if I do fail I would have moved closer to my long term goals as the entire process would be a great learning experience. ', 677, 155, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28753, 'A budding entrepreneur fueled by the burning desire to leave a mark and make a difference through innovation in the online and technology space. ', 677, 183, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28754, 'I want to be a consultant at one of the major firms - McKinsey or BCG.', 677, 109, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28755, 'This path is based on one my core values which is that I like change and enjoy working on new and different things. Hence, in consultancy I will get a chance to work on a variety of challenging problems across different industries. This path will also provide me with vast problem solving experience and will also hone my strategic thinking. This will ultimately contribute to my vision of developing a mindset which can be considered entrepreneurial.  ', 677, 110, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28756, 'My target customers and stakeholders will expect me to be an enthusiastic problem solver. I will be expected to ask the right questions and break challenging problems into smaller simpler chunks. At the same time, I would be expected to well versed with various markets and industries. My customers would need to feel confident that I understand their situation and the problems they face. ', 677, 111, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28757, 'As someone who has experience of working in startup environments, I have honed my ability to think on my feet and understand the need to often find unconventional solutions to solve problems effectively and efficiently. I am also a quick learner and hope to be able to prove that I can adapt to different roles by garnering multi-dimensional work experience till I graduate. ', 677, 156, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28758, 'I believe that the work culture at consultancy firms which is far more conventional and corporate would be a big leap for me. However, the competitive and driven environment at large consultancy firms combined with the fact that I would be surrounded by exemplary and brilliant individuals, would bring out the best in me. ', 677, 112, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28759, 'In a corporate setting I feel that the sense of competitiveness that is imbibed within it coupled with the fact that one is surrounded by highly motivated individuals would bring out the best in me. Also, I would tackle problems in an unconventional manner since I would be bringing my experience of thinking out of the box at startups with me. ', 677, 113, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28760, 'The biggest obstacle I face is my lack of relevant experience to obtain a position at a large consultancy firm. However, I believe this can be avoided by getting a mixed bag of work experience in the next few years. This would be a testament to the fact that I can adapt easily in different environments and industries. My long term vision would be accomplished since I would be involved in solving important real world issues that are faced by the biggest of companies. ', 677, 157, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28761, 'My mentors and other influencers such as successful entrepreneurs or investors with whom I have worked before could help me a great deal by endorsing my work ethic, dedication and love for problem solving. If I do succeed in the consulting world I would be happy to use the skills and experience I develop to help those who supported me. Being a successful consultant would put me in a place where I would be content and happy, hence giving me the ability to have a positive impact on those who are close to me, my family and friends.  ', 677, 114, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28762, 'A highly motivated individual who can adapt easily to different situations and is a quick learner fueled by a desire to solve problems in the most efficient and effective manner. ', 677, 184, 144, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
