(29182, 'I am a Leader before I call myself a CEO, I am a Husband/Father before I call myself a mentor, I am a Coach before I call myself a winner, I am a Philanthropist before I call myself wealthy - I am an Entrepreneurial Leader. I am leading a disruptive movement to ensure that technology is what empowers us, not what drives our daily lives. And in doing so, I am creating a community of entrepreneurial leaders to implement positive change and help push the world forward. I am living my life as an authentic leader by: knowing those I lead, standing up for my beliefs, communicating passionately, leading by example, and conquering myself by having a calm confidence of who I am and where I am going.', 699, 44, 40, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29183, 'Family and Friends', 699, 45, 40, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29184, '- Where in the world are you living and working? Identify at least three places that you hope to spend time in the future.\r\nI am living and working in Sydney, Australia. I am hoping to spend more time visiting New Zealand, Indonesia, Africa, visiting one of my best friends (Terry Dorman) wherever he is in the world, and of course at home in Arizona.  \r\n\r\n- What makes you happy and provides peace of mind? \r\n I am happy and find peace of mind when I truly feel like I come alive. I feel alive when I fail and then succeed, surf, travel, serve my community, try new things, pray, help others, know that I gave it my all, express love and compassion, and witness people grow and develop.\r\n', 699, 46, 40, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29188, 'Tech Company', 699, 101, 40, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
