(29206, 'For organizations or movements that take great pride in being different. \r\nWho are dissatisfied with those who follow the crowd.\r\nI serve as an entrepreneurial leader.\r\nThat provides opportunity for others to follow their hearts and feel supported.\r\nUnlike technology and business generalists.\r\nI bring passion, drive, and communicate a sense of urgency in achieving my long-term vision.', 699, 183, 40, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29207, 'Getting laid off, not getting accepted to any of the academic programs I want to complete, disliking my role at a company and not being able to change. ', 699, 155, 40, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29208, 'Stable startups where I can take on a good amount of responsibility in 2 parts of the company. Opportunity to think freely and approach my job the way I see best.', 699, 154, 40, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
