(29226, 'A successful business man, an accomplished writer, the newly elected Mayor of Los Angeles.', 689, 44, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29227, 'My wife and dog, with close friends and family.', 689, 45, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29228, 'Leading a team of my brilliant friends as we solve seemingly intractable problems and inspire others to attempt to do the same.', 689, 46, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29229, '3594a791ef9447746eb105d127b7da4d.jpg', 689, 91, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29231, 'd1d6d4753af49b323c582152011e7bd0.jpg', 689, 92, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29233, '47f8f7bac8376fb73cf11fd483e3f40b.jpg', 689, 93, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29235, '7186d47f8011108dc4fde8c184a29dad.jpg', 689, 98, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29236, 'c82fe7b4b41bbd4c5edfe0f7dc0fcee7.jpg', 689, 100, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29237, 'Politics', 689, 101, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29240, 'Mayor of Los Angeles', 689, 105, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29241, 'This is a position from which I can foster the identity I hope to create and, most importantly, catalyze wide-scale change to better the lives of my fellow Los Angeleans.', 689, 106, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29242, 'Fair and honest reputations, the ability to attract new industries, fearlessness when surpassing the status quo. ', 689, 107, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29243, 'I have been elected to all possible leadership positions offered thus far in life and have excelled under these appointments. I need to replicate this in the real world by excelling in a community leadership position. ', 689, 148, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29244, 'Warm weather, open and free space, non-restrictive seating. ', 689, 154, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29245, 'Fusion of audacious creativity, tenacious perseverance, and charismatic relationship development', 689, 149, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29246, 'Unfortunately, major campaign contributors and union representatives are often needed. What I must instead find are supporters who believe in my platform. I will reciprocate through my honest and adherence to my promises.', 689, 150, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29247, 'When entering into any election, the risk of losing is ever present. This risk cannot b  avoided, but it can be mitigated through my own self-confidence. It is a necessity, and I must learn to enjoy it.', 689, 155, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29248, 'For Los Angeleans who demand drastic change, Steven Greitzer is an audacious Mayoral Candidate who has the creativity needed to solve this city''s biggest problems. Unlike other candidates that enjoy the spotlight yet maintain the status quo, Steven Greitzer will stop at nothing to leave the city significantly better than when he found it.', 689, 183, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29249, 'Screenwriter in the Entertainment Industry', 689, 109, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29250, 'This will enable me to express myself creatively and to share my message and opinions with a wider audience, all while creating something unique.', 689, 110, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29251, 'My audience demands an enjoyable entertainment experience in exchange for minimum cost and burden.', 689, 111, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29252, 'Thus far, I have developed my talent for screenwriting and venture concept development. I must still continue writing a screenplay and strategizing how to solidify this venture pursuit.', 689, 156, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29253, 'A quiet, secluded room with comfortable seating and direct access to nature.', 689, 112, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29254, 'I alone am attempting to integrate an unobtrusive and innovative monetization model into the entertainment content itself.', 689, 113, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29255, 'I will need actors, directors, a production staff and producers. I aim to leverage the silicon valley venture structure for the first time within a film''s production, and I hope to provide equity to those who assist me. ', 689, 114, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29256, 'Getting anything off the ground within the entertainment industry is incredibly difficult. By bypassing studios when raising money, I do avoid many of the most extreme obstacles. ', 689, 157, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29257, 'For 21st Century entertainment audiences, Steven Greitzer is the only content creator designing entertainment that is both inspired and enhanced by digital media technologies. Unlike other entertainment producers, I am creating content integrated into an innovative model that promotes free proliferation.', 689, 184, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29258, 'Tech Titan', 689, 58, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29259, 'This path will enable me to become a global problem solver', 689, 59, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29260, 'My target customers need me to solve entrenched problems with technology. ', 689, 60, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
