(29265, 'Of course, all startups face the risk of failure. The more audacious the pursuit, the greater the risk. These risks can and will be mitigated through open communication and perseverance. ', 689, 119, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29266, 'For Los Angeles residents who are sick of the insurmountable traffic, Steven Greitzer is a tech entrepreneur who is brave enough to audaciously pursue the toughest of challenges. Unlike other entrepreneurs who are focussed on the consumer internet, Steven Greitzer pursues society''s greatest challenges.', 689, 185, 545, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
