(30786, 'The medical profession,  my friends and families.  My sons are vitally interested in this and are developing career path plans using these skill.  The retirement community that I live in has many people of talent and wealth that could benefit from helping younger people and feeling more useful and vital in their own retirement', 770, 150, 256, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
