(30788, 'We have barely scratched the surface on how the brain learns and achieves goals.  I am using brain science to help me discover these processes.  I would like to talk to you about some of the possibilities and get your ideas on what has worked best for you and what to avoid so lifetime learning is part of your process in a way that improves your health, wealth and relationships', 770, 183, 256, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
