(31059, 'To show up fully present...to give them new ways of thinking through their fear, dreams and actions.', 781, 107, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31060, 'I continue to feed my business...learning, innovating and trying new things. I continue to read relevant books, take workshops and deepen my own connection to spirit.', 781, 148, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31061, 'A professional environment that allows me to thrive is one that has a balance of down time, learning and working. I like collaboration AND I also like to be the only one leading.', 781, 154, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31062, 'My brand is my story, my energy and attention that I give to others. I go beyond just the sessions with people. I keep them in my mind moving forward and am always sending relevant information or encouragment their way', 781, 149, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31063, 'My coven will help me as well as my husband and other mentors. ', 781, 150, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31064, 'The only obstacles are me being stuck in the ways that I am comfortable with. I need to continue to stretch, grow and try new things so that I can deepen the work I do with people on this planet.', 781, 155, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31065, 'I am passionate about supporting people to break through their limiting beliefs and trust that once they listen to what is truly calling to them they will begin to see things shift.', 781, 183, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31066, 'I want to write a book.', 781, 109, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31067, 'It will give me a platform to capture my beliefs and wisdom from coaching over the years. It will bring transformation to people and give me a way to speak to larger groups.', 781, 110, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31068, 'clear, concise messages and wisdom that add value to their lives.', 781, 111, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31069, 'I will reach out to a writing coach to talk more about my ideas. I will get a sense of how this work on the book can fit into my day to day life and get info on how to publish once it is done.', 781, 156, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31070, 'I feel that I have a unique writing voice and that my messages are easy to understand. I also have a passion for great quotes and use them in my work already.', 781, 113, 267, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
