(31462, 'I live and work in the San Francisco Bay Area Peninsula where I was born, educated and have always loved. I am going on a cruise around the world so I can continue to travel and see the world even with a disability. When I am not working, I maintain my health by visiting healing locations around the world. My top three healing destinations are the Calistoga, California, the Israeli portion of the Dead Sea, and Sedona, Arizona.', 796, 44, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31463, 'I am near my family, extended family, and with my boyfriend, Jose Juan Chavez. ', 796, 45, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31464, 'I am a university professor who shares knowledge and deeply cares about my students by mentoring and supporting them in their endeavors and dreams, with the goal of empowering and educating the next generation of leaders and good citizens. ', 796, 46, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
