(31477, 'Do not work and focus on pain management and volunteering', 796, 105, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31478, 'I can easily be near my family, extended family, and with my boyfriend, Jose Juan Chavez. ', 796, 106, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31479, 'I will be focusing on my health and volunteering, so my main customer is myself. I will need to prioritize health first, then focus on the organization''s goals my volunteer work seeks to support.', 796, 107, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31480, 'Learn more about medical treatments and continue to gain hand-on experience in the non-profit world.', 796, 148, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31481, 'I will live in the SF Bay Area where there are numerous non-profits I already volunteer with.', 796, 154, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31482, 'I will focus on team work and collaboration and that will be the differentiating factor that differentiates me.', 796, 149, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31483, 'My doctors, friends and family will support me. I will become more independent and reciprocate by giving them', 796, 150, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31484, 'If I am in too much pain to volunteer, that segment of my plan might be temporarily cut. To avoid this, I will pace myself and takes small breaks when needed.', 796, 155, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31485, 'I am staying grounded by focusing on mu health and giving back to society by volunteering my skills when I can.', 796, 183, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31486, 'Try to continue my career later by leaving work now and attempt to recover', 796, 109, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31487, 'I can focus on myself and hopefully hit the ground running to achieve my goal of becoming a professor in the future.', 796, 110, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31488, 'That I can manage my disability, and know myself well enough to understand my boundaries.', 796, 111, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31489, 'I will better understand my health, and will continue my education to earn the degrees required to become a university professor.', 796, 156, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31490, 'I will be in the San Francisco Bay Area close to my doctors, friends and family. Flexibility is key in the dealing with my disabilities.', 796, 112, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31491, 'I will have overcome a huge obstacle with my disability and will be extremely committed to my profession after working hard to get there.', 796, 113, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31492, 'My doctors, friends, and family will help me get there. I will give back to society by educating the next generation of leaders and world citizens.', 796, 114, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31493, 'An obstacle is I am in too much pain to work. This can be avoided by taking little breaks when needed and knowing my limits.', 796, 157, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31494, 'I am working through my disabilities to become a professor and give back to society by educating future generations.', 796, 184, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31495, 'Ignore my doctorâ€™s advice and work until I can longer work', 796, 58, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31496, 'This will not help me realize my long term goals, it will set me back and be hard on my confidence and progress.', 796, 59, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31497, 'I will need to meet my managers expectations at my current job.', 796, 60, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31498, 'The current skills I possess are key in meeting these expectations, but my disability will get in the way.', 796, 118, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31499, 'I will need easy access to doctors and breaks to stop and seek help for my disability when needed.', 796, 115, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31500, 'I will be at a disadvantage because my disability will prevent me from performing at the level I typically do and my competitors do.', 796, 116, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31501, 'My doctors, fiends, and family will help.  I am ignoring my health, so will need more help then I can reciprocate. I am trying to contribute to society through my job.', 796, 117, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31502, 'The biggest risk is that my health will completely give out and I will no longer be able to work. If I work without focusing on my health this cannot be avoided.', 796, 119, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31503, 'I am giving my all to working, at the cost of focusing on the health and listening to the overwhelming physical pain I experience.', 796, 185, 105, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
