(31801, 'A boyfriend of husband with family nearby', 808, 45, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31802, 'Working in a successful, mid-stage tech company.', 808, 46, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31803, '8232f069014e3ddbd5495928119f87dd.jpg', 808, 91, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31804, 'b6801a5545f7731b23b9d6b131216425.jpg', 808, 92, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31805, '4278c602e0a7860fd6f15bb5f80c2176.jpg', 808, 93, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31807, 'Investor', 808, 101, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31810, '73b7008469c477894fe8f357d6884acb.png', 808, 98, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31811, '1cec3d198c4c15081dc6c51db1dd12ff.jpg', 808, 99, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31813, 'e6fba357535e1ab00c3493f74628eb13.jpg', 808, 100, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31815, 'I want to be an investor.', 808, 105, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31816, 'I thrive off of success--improving myself and rising above others--therefore this is a good way to get distinction and money.', 808, 106, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31817, 'I''ll need to know a lot about the space I invest in. I''ll also need good connections in the area and respect from those around me in order to achieve esteem. Investors need esteem to build reputation.', 808, 107, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31818, 'I''m going into growth equity after graduation. Although I''ll be doing mostly sourcing, I hope to get a good sense of how things work. Then, I''ll most likely go straight to business school, where my credentials will continue to grow. I''ll also meet valuable connections in business school.', 808, 148, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `prod_answers` (`id`, `answer`, `user_id`, `configure_id`, `user_game_status_id`, `created`, `modified`) VALUES
(31819, 'I hope not to be in a situation in which my significant other has an impact on where I''m located. I prefer to stick to my guns and do my own thing, but I also realize that by 32, I need to start thinking about things other than myself. \r\n\r\nRegarding which industries I invest in, I don''t have much of a preference at this point, other than that they are intrinsically motivating to me. \r\n\r\nI''d want a culture in which there is open communication, strong commitment among all parties, and the opportunity to have my own autonomy. \r\n\r\nI also really want to be afforded time for sleep, a moderate social life, and EXERCISE. ', 808, 154, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31820, 'Experience: I will have worked in growth equity (as well as interned in VC). Additionally, the MBA from Harvard helps a lot. \r\n\r\nIntuition: I''ve been told by Rich Simoni that I have a keen "sense" for good deals. \r\n\r\nEmotional intelligence--I''m very good at working with people (and maneuvering, if need be).\r\n\r\nI''m incredibly hard-working a driven.\r\n\r\nI''m smart and I can learn relatively quickly, although I wouldn''t say I''m ever the smartest in the room (in the circles I travel in). ', 808, 149, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31821, 'My parents will be my financial support--they will pay my NYC rent so that I can pay my own way through business school. \r\n\r\nLike-minded peers or friends who respect what I do (even if they don''t choose to live the same way). This gives me social reinforcement and support that the path I''m pursuing is admirable and achievable. \r\n\r\nI can pay people back by helping them in their times of need. I can also help support my parents later when they will need it, and hopefully i can pay back all the money I owe them at some point. \r\n\r\nMy impact on the world will manifest in the companies I invest in. ', 808, 150, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31822, 'I might find that investing just doesn''t do it for me, which is scary since I often fall back on it when I think about what I want to do. I fall back on it partly because it means money and esteem, but also because it''s so generalized that it doesn''t entail as much risk regarding whether I don''t like it. \r\n\r\nPeople might also think that after just sourcing and then going to b school, I don''t have enough experience. I might not be able to get as good a job right out of b school as I''d like. However, if we''re thinking 10 years down the road here, that''s not as much of an issue. ', 808, 155, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31823, 'I have experience working in investing, augmented by my Harvard MBA, although what I bring most tangibly to the table is my high-level interpersonal skills and my tenacious audacity to keep raising the bar of what I can offer you. ', 808, 183, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31824, 'I want to be the COO of a mid-stage tech company that already has achieved significant success and is scaling rapidly.', 808, 109, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31825, 'I want to be Marissa Mayer or Sheryl Sandberg because they''re role models for all women and they''re continually in the news. For better or for worse, I crave fame and notoriety because it''s all part of the prestige I''m always seeking. This COO position (at the right company) could take me there. Plus, I find the growth stage and operations work to be intrinsically exciting and satisfying, in turn. ', 808, 110, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31826, 'I''ll need to understand the technology really well, and I''ll need to work well with engineers. Additionally, I will need to be sharp-witted and have a keen sense for the fine line between risk and reward. ', 808, 111, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31827, 'Having a masters in engineering can''t hurt, plus the MBA always counts for a lot. Additionally, I will have gotten a lot of tech exposure while at Stripes. I think also having respect for engineers goes a long way, when you come from the outside with a less technical background.\r\n\r\nSkill-wise, I''m all about the execution. My hallmark is that I get things done on time (or before they''re due) and do everything well. Plus, I love strategizing. As such, a COO role seems like right where I belong. ', 808, 156, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31828, 'Location: probably silicon valley. Unless the NY or Boston tech scenes pick up, it seems like this is it. I don''t want to live in Washington state. \r\n\r\nIndustry: I want to work for a company that I can get behind, although that could range from many things (health-related, productivity-related, or just delight-related). \r\n\r\nculture: Creativity and open-minded innovation is key. I''m going to be the one who channels all that into a viable strategy. ', 808, 112, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31829, 'Aside from what I said for my first dream path, I think that my ability to execute is relatively outstanding in comparison to my peers. I never quite realized that until the Mayfield Fellows Program, when I was surrounded by high-achieving people who were all awed by my ability to get things done. It put things in perspective.', 808, 113, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31830, 'Same as last time. Also, I will need to have good references within Silicon Valley (since I will have been on the east coast for a while). I should nurture my current stanford relationships!', 808, 114, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31831, 'First of all, everyone wants to align themselves with a rocketship company, but that''s hard to do. It''ll be very difficult for me to find a good company to join, although I also like to think that I can MAKE a rocketship if I want to :). \r\n\r\nThere also may be pushback from me having come from the east coast?\r\n\r\nIf this company is successful, I would be accomplishing my long-term goal of fame/success here more than anywhere else i can imagine!', 808, 157, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31832, 'I have a strong ability to see through many moving parts and strategize based off the big picture. Additionally, I''m very good at executing plans (and pivoting as needed), therefore I think I''d be an excellent COO. ', 808, 184, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31833, 'I want to be in a hedge fund.', 808, 58, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
