(31850, 'They have sex appeal due to their risk and high returns. I like how that reflects on me. ', 808, 59, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31851, 'I will need to be responsible to many people, have a good idea for a company, and bring in a rockstar team that all gets along. I''ll also need good connections to VC''s. \r\n\r\nOn a personal level, I''ll need to be comfortable with much more ambiguity and risk-taking than I currently am. I''ll also need to learn a lot more about finance and be comfortable working longer hours.', 808, 60, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31852, 'Having banking and investing on my resume will help, but I''ll have to have a strong finance focus in business school. \r\n\r\nAside from that, I''m good at learning quickly and I''m very motivated.', 808, 118, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31853, 'Location: could be anywhere, but I can''t see myself in any place other than the Bay Area, NY, or Boston.\r\n\r\nCulture: Same as the others.', 808, 115, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31854, 'I''d compete based off of intellect because I''d have limited prior experience. I''d hope that my drive, personability, and intellect will make me stand out. ', 808, 116, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31855, 'I''d  help from my friends in finance, for they may have "ins." I''ll have to pay them back in kind. My impact on the world around me will be to earn money for my family and clients. ', 808, 117, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31856, 'I risk not having a knack for finance. I''m not sure I do. The best way to avoid that risk is just to learn a lot in the interim. \r\n\r\nI''m also not sure I''d be happy in a hedge fund. I don''t know if I''d find the work rewarding enough (as opposed to the "idea" of it). I''m also not sure I''d be able to handle the hours with good mental and physical health. ', 808, 119, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31857, 'Hedgefunds are for smart people who like to grind, and that''s something I excel at. ', 808, 185, 529, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
