(31893, 'Honest', 811, 40, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31894, 'Mindful', 811, 41, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31895, 'Pragmatic', 811, 42, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31896, 'I want to be a consultant', 811, 105, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31897, 'Being a consultant would expose me to various industries and help me learn more about myself and the world. With new knowledge and networks, it would help me be in a better position to understand the need of others and help them.', 811, 106, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31898, 'I would need experience, be resourceful and be able to present myself well.', 811, 107, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31899, 'Pursuing a MS in Management Science & Engineering and working with various supply chain projects. Pursuing an internship with Ericsson as a internal consultant over the summer.', 811, 148, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31900, 'I would like to live an a warm predictable environment. Be exposed to people of diverse background and work in an industry that is meaningful to people.', 811, 154, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31901, 'My upbringing in an Asian country and my experience with South-East Asia, the ability to speak mandarin and the skills and degree I am pursuing', 811, 149, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31902, 'Friends who can guide me and point me in the right direction. Professors who would be able to impart the right skills to me and my parents who have supported me financially. I would hope to develop a long term friendship with people who helped my along the way. Eventually I would hope to use my skills to make the world a better place.', 811, 150, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31903, 'Rejected from jobs that I want to work in. I would need to diversify my applications, work on my networks and better prepare myself for the interviews.', 811, 155, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31904, 'Motivated individual looking to learn and contribute  to society.', 811, 183, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31905, 'I want to do charity', 811, 109, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31906, 'I hope to find a sense to satisfaction by reinvesting in the society that helped developed me', 811, 110, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31907, 'Responsible, Genuine', 811, 111, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31908, 'Being able to work closely with people I am helping and witnessing the change that I have made', 811, 112, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31909, 'Ability to let go of my time and money', 811, 156, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31910, 'Amount of resource that one can give. Work hard to ensure that money is not an issue and plan smart to ensure resources are put to good use.', 811, 113, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31911, 'Friends who help support me and organizations that highlights issues around the world. Update them on the impact that I have made.', 811, 114, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31912, 'Lack of financial stability. Planning well and working hard.', 811, 157, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31913, 'Individual who wants to make and witness change in people''s lives.', 811, 184, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31914, 'I want to be a photographer', 811, 58, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31915, 'I like to express myself and show the world a side of things that city dwellers do not commonly see', 811, 59, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31916, 'Aesthetics, creativity and a strong sense of exploration', 811, 60, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31917, 'Love of nature, perseverance and appreciation of beauty', 811, 118, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31918, 'Wilderness and the unknown. Solitary. ', 811, 115, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31919, 'I take pride in my image and pay attention to the details in my photographs.', 811, 116, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31920, 'Fellow photographer and the online community who will motivate me. Being able to show the world the beauty around them.', 811, 117, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31921, 'Busy schedule and opportunity cost of time in my career. Kids. Taking a gap year from work.', 811, 119, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31922, 'Enthusiastic photographer seeking to captivate viewers with my shots of nature.', 811, 185, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31925, '10 years down, I see myself being financially independent without debt obligations. Having a career that is stable and working on projects that are intellectually engaging. I will be in a place that is warm surrounded by parks and nature.', 811, 44, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31926, 'I would like to be with my future spouse. Stay close to some friends and maintain contact with the rest of my friends in my hometown', 811, 45, 631, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
