(32348, 'Company builder and CEO', 831, 105, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32349, 'It will help me work with and lead people, build products and services that serves a purpose and create opportunities for me to manage my own time and become financially independent ', 831, 106, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32350, 'Full commitment to persevere in tough times, make difficult decisions when the right path is unknown, and engage and motivate employees and clients', 831, 107, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32351, 'My passion, persistence, pragmatism and leadership skills will enable me to build a company with people, products and services that are well thought of, appreciated and looked up to.', 831, 148, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32352, 'An entrepreneurial environment in the intersection between technology, design and products where decisions are made quickly and pragmatically, in markets where people are friendly and effective, and the economy creates business opportunities, for example Colombia.', 831, 154, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32353, 'I differentiate by being an effective leader in a creative environment, always persevering through though times and continuously striving to reach the goals by being a creative problem solver. ', 831, 149, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32354, 'My goals will be achieved by working with people I view as my friends as well as colleagues, that can teach and coach me. I can reciprocate by being a leader that empowers others to do their very best, encourages and acknowledges them. I empower the world around me by enthusing and noticing people around me.', 831, 150, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32355, 'The risks I face are the hold-backs in my own mind; being in a safe employment position may keep me from taking the leap into creating my own start-up. My current position does inhibit me from accomplishing my long-term goals and the way to avoid it is to change my path.', 831, 155, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32356, 'My passion, perseverance, pragmatism and people skill will enable me to create a consumer behavior turned company turned culture for the long-term.', 831, 183, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32357, 'A modern family', 831, 109, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32358, 'Having a passionate, loving, caring and respectful marriage will create an environment where our children will grow into intellectual, caring, humble and curious individuals.  ', 831, 110, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32359, 'My husband will expect devotion and presence, appreciation, love and commitment. My children will expect unconditional love, support, guidance and presence.', 831, 111, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32360, 'I''m a loving, considerate, and caring person and I look for passion in all I do. Whether it''s in the relationship I am in or in the business I''m doing. I will bring my passion, perseverance and friendship into my marriage and family, for the respect, love and excitement I believe is needed to keep a relationship last for a lifetime.  ', 831, 156, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32361, 'Our family has a comfortable and secure home in the city where we work, but we are also a family of travels and can easily adopt to new places, transports and cultures. We have multiple environments where we feel at home; from metropolitan cities across the world, to mindful quite places in the archipelago, countryside or beach in Latin America, Europe and US. We travel light and with ease, constantly prepared for the next adventure.', 831, 112, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32362, 'Mutual respect, compassion, passion, love, devotion and esteem makes our relationship withstand any competition.', 831, 113, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32363, 'My husband, my children and my friends will help me achieve the goal of my modern family. By nurturing an environment where we care for each other, keep an active mind and body and cherish our relationships we reciprocate by being generous and sharing our fortunes with our dear ones.', 831, 114, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32364, 'Overcoming downturns in your relationships; hard times, difficult times and crisis when family, friends and loved ones are hurt by you or others, not being present or abandoning, betraying or letting you down. Looking at the larger picture, the real reason for it, expecting a good intent, and visioning the long-time horizon can help avoid or overcome the issues and enable the long-term goal by not giving in to short term obstacles.', 831, 157, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32365, 'Our marriage is built on passion, love and trust that helps us coach, appreciate, love and care for each other so much that it spills over to everyone around us.', 831, 184, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32366, 'Celebrated artist', 831, 58, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32367, 'It will help me to get active with my creative abilities and gain fulfillment in life in company with my other goals.', 831, 59, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32368, 'They will expect highest standard in fine art and design', 831, 60, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32369, 'Being part of a creative collective, an incubator for artists, where you share space, ideas, knowledge and time together while executing on your own projects', 831, 118, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32370, 'A light, airy, cozy and open artist atelier with equipment, tools, materials and machines to create, sculpt, paint and make. The people there are all open, respectful, helpful, funny and innovative.', 831, 115, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32371, 'Our culture of knowledge sharing, helping, providing space for interaction or individual work, humor and friendship makes our creativity lack all boundaries. ', 831, 116, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32372, 'Patrons from our network and friends of friends will help get us started by commissioning exhibitions, art work for their collections and charity events. We will help create beautiful, meaningful and curious art that will benefit the viewers of the art as well as charities benefiting from donations. We will also help startups, students and amateurs in search of professional feedback, support and development.', 831, 117, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32373, 'Creativeness requires a lot of empty time to evolve and grow in its own pace. That continuum of time is not always easy to accomplish. Not letting other "musts" get in the way will create space and time for creativeness.', 831, 119, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32374, 'The Gyro Gearloose in design, aesthetics and creativeness. ', 831, 185, 315, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
