(32570, 'I want to be a successful entrepreneur, while continuing to be a great husband, father, son and friend.', 839, 105, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32571, 'I will be able to express my creativity, solve problems, and change the world, while continuing to be happy with my personal life.', 839, 106, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32572, 'Great leadership, technical skills, business skills, communication skills', 839, 107, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32573, 'I already have the technical skills, and will continue to develop them. I am learning the business skills in my Masters, and will continue to do so through experience I will enhance my communications by taking classes focused on this, like T-Groups (self-awareness and communication), and Public Speaking. I will enhance my leadership by gaining confidence in the fact that I know what I am doing, and respecting other for what they can do.', 839, 148, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32574, 'The software industry lets me thrive to my best. Being around people with ideas, with a passion for creating a great product, and who want to help make people''s lives better. Both Seattle and Silicon Valley bring this out in me.', 839, 154, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32575, 'I have 6 years of technical experience in diverse areas. I have worked in a product which is used by hundreds of millions of people, and worked with world class talent. While being technical, I have a social and business side to me, which is rare among technical folks. I also communicate well, and have a good sense of what people like and dislike. I am willing to accept what my flaws are, and make them better.', 839, 149, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32576, 'From a personal level, my wife will (and already is) helping me achieve my goal. From a professional level, I will receive help from investors, mentors and advisers. ', 839, 150, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32577, 'My biggest obstacle is that when starting a company, I will not be earning a salary like I used to, and wanting to have children soon, this becomes a problem and conflict of interests. I will try the startup path for a limited time, see if it yields any fruit, and otherwise go back to working for a company.', 839, 155, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32578, 'I am an extremely motivated entrepreneur with experience in developing a service used by millions of people, with knowledge about how a business works, and with the communication and personal skills of a business person.', 839, 183, 459, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
