INSERT INTO `prod_answers` (`id`, `answer`, `user_id`, `configure_id`, `user_game_status_id`, `created`, `modified`) VALUES
(32617, 'I will be happily married with no kids, but my first child on the way!', 838, 45, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32618, 'I will be working as a venture capitalist, preparing to start my own business.', 838, 46, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32619, '1e76228c9b0f8d1e4990fead56c8603c.jpg', 838, 91, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32621, 'debcd9542085601367ac0cfadf40b8b3.jpg', 838, 92, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32624, 'a0341639faf66b9e4a30384ee2007f31.jpeg', 838, 93, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32626, '525cb6f8fe890156d977fc89dce86d30.jpeg', 838, 99, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32627, '7d89dc7fdf15124eef1554dcf4ed5174.png', 838, 100, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32629, '4de09902a5074f3d4ebc1e4592b7ed1b.png', 838, 98, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32630, 'Venture Capital.', 838, 105, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32631, 'Creating my own venture capital firm will help me in realizing my long term vision because it will provide me with constant stimulation, and an ever-changing environment.  Two factors that I value very highly in life.  In my own venture capital firm, I will report to myself, and I will be able to determine what types of projects I work on.  In my own firm, I will also amass wealth, which will enable me to explore the world, and enjoy great meals with my family.', 838, 106, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32632, 'My target customers will expect a return on their investments that is greater than the return they would receive by investing their money independently.', 838, 107, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32633, 'I plan to intern this summer in fixed income, and finish up my undergraduate degree in STS at Stanford.  Following graduation, I would like to work in management consulting, to learn more about business operations, and executive leadership.  Following my work in consulting, I hope to attend the Stanford Graduate School of Business, and focus in Entrepreneurial Studies.  My studies at the GSB will help set me on the path to work in venture capital after graduation, and eventually build my own venture capital firm.', 838, 148, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32634, 'I hope to remain localized in the San Francisco Bay Area.  The Bay Area is the largest, and most prominent area for venture capital in the world.  Setting up a firm in silicon valley is an ideal location, because there is a plethora of start-ups in the area looking for funding.  The creative, young, innovative culture that embodies the bay area will help my firm to thrive.', 838, 154, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32635, 'I will focus on personal relationships, and building networks to give my consumers what they deserve.  I value accountability, and transparency, so I will make my investment decisions clear to my clients, and differentiate myself based upon customer service.', 838, 149, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32636, 'My family and friends will provide me with constant support and motivation to keep pushing towards my goal everyday.  The professors, employers, and peers I meet at Stanford and in my jobs/internships will help me to establish a network that I will be able to call upon when I am beginning to establish my business.', 838, 150, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32637, 'There are lots of venture capital firms in the bay area that are already well-trusted, and well-established.  These firms have proven results, so it will be difficult to differentiate myself from them, and attract clients to my company rather than one of the pre-existing companies.', 838, 155, 539, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
