(32731, 'I want to start off as a software Engineer at large software corporations (i.e. Microsoft), and rise up to an influential position at the company.', 840, 105, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32732, 'My long-term goal is to bring innovations in software and biotechnology industry that will save and enrich people''s lives. I want to become the main person to make such contribution to the world. \r\nIn order to achieve the above goal, being an influential person in the software and biotechnology industry of both US and South Korea, the two countries that I have direct connections to, will definitely help. Being in an influential leader position at a company like Microsoft or Google, whose social impacts reach international level, will enable me to truly and actively change my ideas and passion into reality, and directly bring innovations and changes to the world around me.', 840, 106, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32733, 'My initial target customers are large software corporation employers in the Silicon Valley including Google, Microsoft, Facebook, etc. These target customers expect me to contribute to the development of their software products as a software engineer. Yet, they do not want me to become a mere developer who only codes. They expect me to take pro-active actions to work and care about the company as if the company was my own to make the most possible contributions. Furthermore, they want me to inspire and motivate other people in the company, and generally impose positive impacts to the community. Through such experience, the companies expect me to achieve my own self-development, both in software engineering and management, so that I could one day become one of its future leaders.', 840, 107, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32734, 'My computer science degree at Stanford, past working experiences at Microsoft and other large software companies, and past startup experiences are qualifications that demonstrates my potential to meet the expectations above from the target customers. In fact, I plan to continue my career at Microsoft right after graduation to work as a software engineer.\r\nAlong with these past experiences, the passionate, persistent and competitive aspects of my personality also hint the target customers that I will be able to fulfill the expectations effectively. While working as a software engineer, I plan to continuously search for opportunities to develop and demonstrate my potentials further. For example, I plan to pursue additional graduate educations in either engineering (Ph.D), business (MBA), or law (JD) to gain more in-depth professionality and better suit myself as a future leader of the company. \r\nIn addition, while being at the large corporations, I plan to continue my own unique passion: the integration of software technology with the field of medicine. This personal passion will not come into play much until I become an influential leader with enough power to initiate, but by being a pioneer in such new field of great potential, I will prepare myself for the future when I will have enough power and support from the company to try something new and bring the next big thing.', 840, 148, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32735, 'I thrive in a professional environment where there exists continuous stimulus for motivation (either through competition or adventure). As a software engineer, Silicon Valley is the most optimal location because the huge pool of software companies and engineers stimulates my passion in engineering and entrepreneurship.  In addition, as a Stanford graduate, Silicon Valley is where my primary network from Stanford is located. My friends and professors from Stanford will continuously present me with new stimulus and opportunities for me to keep me motivated. \r\nConsidering how working environment in large corporations often lack the adventurousness and excitement due to the structural barrier, startup environment might fit better for me to truly demonstrate my potential to the max. Yet, since I am going to be a recent college graduate with no real full-time working experience, working at large corporations as an engineer and/or manager will also succeed to motivate me with its professionalism. I also look forward to gain professional network by meeting brilliant colleagues.', 840, 154, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32736, 'To begin with, I am differentiated by my unique passion and background. I am specifically passionate about integrating software technology, specifically the Artificial Intelligence technology, with biotechnology to bring unseen medical innovations. \r\nI am specialized in artificial Intelligence and natural language processing technology as a Computer Science major (AI track) at Stanford with extensive AI-related work experience at startups and Microsoft. On the other hand, I have numerous past biomedical research experiences at prominent research centers like Georgetown Lombardi Cancer Center or Stanford Stem Cell Institute, having had worked as a biomedical researcher (has one publication in one of the major medical research journals). With such in-depth experience in biomedical research, my skills and background in software engineering will be an attractive factor for my target customers, or the large software corporations like Microsoft or Google as those companies are trying very hard to broaden its technology spectrum to biotechnology in the future. Individuals with professional experience and background in both medical and computer science are quite rare, so my interdisciplinary background in both fields with professional experience will differentiate me from either software engineers or medical researchers.\r\nIn addition, I believe my past and future entrepreneurial experiences that I plan to gain at Silicon Valley would also become a crucial differentiator for me because the entrepreneurial spirit is essential even for large corporations when tackling a new field. I plan to differentiate myself from medical researchers or software engineers who have technological skills and knowledge, but lack the ability to execute and make ideas into reality.\r\nLastly, my background as a native South Korean with dual citizenship in US will differentiate me by enlarging my workplace to international level. As the companies, especially large corporations, try to more and more target international markets, my background as a native East Asian will definitely make me stand out as the suitable person to work in international markets.', 840, 149, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32737, 'Stanford professors and my fellow student friends have been the largest source of help during my undergraduate career. After graduation, my colleagues and bosses will be the one to help me achieve my goal of gaining professionality in engineering and management. At Microsoft, I want to find a professional network in which I can find people with passion and professional skills, and I believe these people will help me with my future journey in the industry. Especially, my bosses and mentors at work will be a direct contributor to my future success because they are the one that will provide guidance and support. In addition, the network I will have already established from Stanford University (professors, friends, etc.) will be another important source of network to find people who will help me achieve my goal. Not only they will grant me with direct help by aiding each other to achieve goals together, but also they will be the continuous source of inspiration and motivation for me to move forward. Last but not least, my family is the biggest support because they will give me energy to stay strong and focused even when things get hard. \r\nHonestly, I do not know how exactly I should return the help or benefits back to the people. The most obvious way to do that is to become a very influential person myself, and actively helping them back when they need my help. In addition, not by returning the benefits directly back to the people who provided, but by generating more value or help to other people in the society, I want to make my helpers feel proud of what they did for me.', 840, 150, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32738, 'I want to become an influential leader at a large corporation like Microsoft where I can change my ideas and vision into reality to the world. I plan to ride up the ladder by continuously developing myself in the field of engineering and management and proactively pursuing my own passion that not many people share. During my journey, my network from Stanford and Microsoft will be the largest support along with my family. I might face obstacles in my journey when life gets difficult in general, and such difficulties might lead me to make decisions that will prevent me from achieving my long term vision. However, I plan to avoid those risks by truly putting my passion and dream in front of any other factors when making my life decisions. If I face practical obstavles due to my personal background, I will pivot my path, but I will ultimately pursue the same long term vision. By becoming an influential person for the society I belong, I want to be the one main guy to make the world a better place to live.', 840, 183, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
