(32805, 'The largest risk is the risk of losing my personal passion due to the life difficulties in general that might lead me to choose safety and comfort over passion. Giving up my dream to become the person to bring innovation to the world would prevent me from achieving my ultimate long-term dream. However, I believe the above risk could be avoided by putting my passion and dream in front of safety and comfort when making decisions. \r\nIn fact, there is one risk factor that I am not sure if it is avoidable. As a South Korean male, despite the fact that I am also a US citizen, I might face a ceiling during my path to becoming a leader at large corporations in US. In this case, I will have to change my path plan, either to pursue my career in Asian companies like Samsung or to work at a startup where there are much less degree of such ceilings for "non-Americans". Despite such pivot, but I will ultimately pursue the same long term vision.', 840, 155, 133, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
