(35022, '0563826f82207f980c296d85284735df.jpg', 850, 2, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35023, 'Quick to learn', 850, 40, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35024, 'Pragmatic', 850, 41, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35025, 'Intellectual', 850, 42, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35026, 'Bank', 850, 44, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35027, 'adfadadf\r\n\r\nfad\r\nfad\r\nfa\r\ndf\r\nadf\r\nads\r\nf', 850, 45, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35028, 'I want to be a teacher.', 850, 105, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35029, 'It will allow me to work with children in expressing their voices.', 850, 106, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35030, 'Hi, I''m Brigitte.  enjoy working with kids and helping them have fun. I have a lead a summer camp at Daniel Inc, a residential school where children who have been abused are taken, for a couple of summer which involved me directing and organizing several activities for the campers. I am in a children''s theater group called Flying Treehouse which works with elementary schoolers on their creative writing skills and then performs their stories for them. I hope to, through my experience with working with kids and theater, give children a safe space to create and thrive personally and artistically.', 850, 183, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35031, 'I''m guessing they''ll want me explaining how plays have been and can be structured, but more importantly I hope they expect me to open their minds to new and crazy ideas.', 850, 107, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35032, 'I have worked with 2nd and 3rd graders on their creative writing skills and performed their stories for them. I also lead a playwriting group on campus and have taken some writing classes.', 850, 148, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35033, 'One that is separate from my home but involves people that make me feel at home. Location-wise, probably something more on the urban than suburban side.', 850, 154, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35034, 'The members in my theater group and the theater communities I''ve been a part of in general. I will reciprocate by supporting my friends in their endeavors whether they need help starting a theater company or a coffee shop, as my friends have plans to do. My impact is unclear to me-- I know I can make people laugh and smile which seems like a positive thing.', 850, 150, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35035, 'I risk doing too much and not having enough time to take care of myself. This can be avoided if I make a conscious effort to balance myself-- but I''m also a dabbler so I like saying yes to more than I probably should...I''m not sure of my long-term goals even though I see a possible path as a teacher. There''s a lot of wonderful uncertainty right now that I''m holding tighter to than the possibility of a firm future.', 850, 155, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35036, 'I want to be the president', 850, 109, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35037, 'I want to be a coder', 850, 58, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35038, '3', 850, 180, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35039, '4', 850, 159, 1432, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35040, 'I compete by listening to people-- that is, I''m not good at raising my voice and competing for my opinion to be right. I''m better at sitting back and sorting through all the opinions.', 850, 149, 1432, '2014-08-22 00:09:18', '2014-08-22 00:09:18'),
