(36964, '', 202, 39, 657, '2014-11-04 01:46:51', '2014-11-04 01:46:51'),
(36965, 'Perseverant', 202, 40, 657, '2014-11-04 01:46:59', '2014-11-04 01:46:59'),
(36966, 'Curious', 202, 41, 657, '2014-11-04 01:47:02', '2014-11-04 01:47:02'),
(36967, 'Quick to learn', 202, 42, 657, '2014-11-04 01:47:15', '2014-11-04 01:47:15'),
(36968, 'Steve Jobs', 202, 68, 657, '2014-11-04 01:47:21', '2014-11-04 01:47:21'),
(36969, 'In Enfield, London', 202, 44, 657, '2014-11-04 01:49:45', '2014-11-04 01:49:45'),
(36970, 'My partner, my dog, my industry colleagues and PhD professors', 202, 45, 657, '2014-11-04 01:50:10', '2014-11-04 01:50:10'),
(36971, 'I am doing really well in my PhD, I''ve completed 3-4 years worth of work and gathering great data. I am living in Enfield with my husband and dog Xyla in a home we''ve bought and just finished decorating.', 202, 46, 657, '2014-11-04 01:50:34', '2014-11-04 01:50:34'),
(36972, 'e1be8b2ae137ff1c0c679e6dc0689bc4.jpg', 202, 91, 657, '2014-11-04 01:51:15', '2014-11-04 01:51:15'),
(36973, 'Producing high quality experiments', 202, 94, 657, '2014-11-04 01:52:09', '2014-11-04 01:52:09'),
(36974, 'da717740b5f8ad4bddb273415990fb00.jpg', 202, 92, 657, '2014-11-04 01:52:25', '2014-11-04 01:52:25'),
(36975, 'Gain a team of mentors I can talk to', 202, 95, 657, '2014-11-04 01:52:33', '2014-11-04 01:52:33'),
(36976, 'Getting new training in stats & qual', 202, 96, 657, '2014-11-04 01:53:08', '2014-11-04 01:53:08'),
(36977, '99d45c0556054397c5a32f060ca94332.png', 202, 93, 657, '2014-11-04 01:54:57', '2014-11-04 01:54:57'),
(36978, '7b29abe12af8268f86b50816387cdbb8.jpg', 202, 98, 657, '2014-11-04 01:55:31', '2014-11-04 01:55:31'),
(36979, 'Scheduling time for studying', 202, 101, 657, '2014-11-04 01:55:39', '2014-11-04 01:55:39'),
(36980, 'Reaching out to industry experts', 202, 102, 657, '2014-11-04 01:55:47', '2014-11-04 01:55:47'),
(36981, 'Finding the right courses', 202, 103, 657, '2014-11-04 01:56:11', '2014-11-04 01:56:11'),
(36982, 'Bootstrapping to make this kind of development happen sooner', 202, 58, 657, '2014-11-04 01:56:59', '2014-11-04 01:56:59'),
(36983, 'a2c1f624f22e252329e8a437f47cf386.jpg', 202, 99, 657, '2014-11-04 01:57:39', '2014-11-04 01:57:39'),
(36984, '2e769ee8275648cf3eb7927d9c1e937b.jpg', 202, 100, 657, '2014-11-04 01:58:42', '2014-11-04 01:58:42'),
(36985, 'Scheduling time to study', 202, 105, 657, '2014-11-04 01:59:01', '2014-11-04 01:59:01'),
(36986, 'Scheduling time to study will allow me to structure time devoted to the PhD, helping me to complete it. A PhD will help me understand so much more about my field of interest< which will in turn help me write papers, a book and help me be a better-informed lecturer and ultimately I can reach my next goal of becoming a professor.', 202, 106, 657, '2014-11-04 01:59:54', '2014-11-04 01:59:54'),
(36987, 'My professors will expect me to keep a good attitude at all times, study hard, seek outside expertise and brush up on any skills I DON''T currently possess in order to do the best I can for my PhD. ESOMAR, who are funding me Â£500 and showing great support, are going to expect me to produce work that can be suitable for other academics and practitioners to understand and use, and conduct myself in a professional manner at all times. They will also expect me, and need me, to make my work public and to be very ''open source'' about the PhD, even though I am a practitioner as well. ', 202, 107, 657, '2014-11-04 02:04:10', '2014-11-04 02:04:10'),
(36988, 'My qualifications: Game design, game development, understanding certain elements of quanitative research and quanitative research needs, certain elements of data collection, UCD, UX design etc. \r\nMy plans: Involving myself on a qualitative course to find out more about qualitative research, speaking to industry peers to brush up on knowledge I don''t have. I''ve made a companion website which, once completed, will be of benefit to ESOMAR and my Professors to showcase some of my work. ', 202, 148, 657, '2014-11-04 02:04:26', '2014-11-04 02:04:26'),
(36989, 'Where I have autonomy, space to think, a healthy and professional collaboration with my peers and higher management. I also need transparency, and an ability to see the future of my career.', 202, 154, 657, '2014-11-04 02:07:05', '2014-11-04 02:07:05'),
(36990, 'I understand games for engagement, games for data collection, UX and web design, some code and I also have experience in managing software, game and web developers. I marry design with engineering passion and knowledge. ', 202, 149, 657, '2014-11-04 02:10:50', '2014-11-04 02:10:50'),
(36991, 'My supervisors and my PhD Allies such as Victoria and authors James Newman and Douglas Brown and Arlene Tucker  will allow me to reach my goal for achieving a PhD. ', 202, 150, 657, '2014-11-04 02:16:35', '2014-11-04 02:16:35'),
(36992, 'Obstacles and risks: not having time to study is a risk, which is why I have to schedule specific dates and times for study, reflection, brainstorming, writing and my experiments within my PhD.', 202, 155, 657, '2014-11-04 02:20:56', '2014-11-04 02:20:56'),
(36993, 'Researchers, businesses and academics need to understand better ways of engaging people for the purposes of high quality and accurate data collection and how to do this through games. My invention of ResearchGames needs to recognized by ESOMAR and used for all research conducted around the world. ', 202, 183, 657, '2014-11-04 02:22:38', '2014-11-04 02:22:38'),
(36994, 'Gaining funding to hire talent', 202, 109, 657, '2014-11-04 02:30:49', '2014-11-04 02:30:49'),
(36995, 'Talent will be crucial to Kissaah robust development of the platform and additional features', 202, 110, 657, '2014-11-04 02:32:01', '2014-11-04 02:32:01'),
(36996, 'As a manager, I will be expected to create strategic plans for human resource acquisition and development as well as hiring the right talent. And retaining the talent! ', 202, 111, 657, '2014-11-04 02:32:41', '2014-11-04 02:32:41'),
(36997, 'I have managed two software teams at two organizations in order to build web interfaces, games and survey software as well as two data collection systems. I would need to take on a management course though to understand how management has changed now for the 21st century and to cater to younger software devs. ', 202, 156, 657, '2014-11-04 02:33:58', '2014-11-04 02:33:58'),
(36998, 'I would want to have an environment of enthusiastic developers who are collaborative, have ideas and are not afraid to put them forward. I want them to feel proud of their work and see my as someone who can mentor, support and grow them. To thrive as a team, we would need clear structure, goals, recognition, autonomy and a path to growing team members and the team size. ', 202, 112, 657, '2014-11-04 02:35:30', '2014-11-04 02:35:30'),
(36999, 'N/A ', 202, 113, 657, '2014-11-04 02:35:46', '2014-11-04 02:35:46'),
(37000, 'Investors and crowd sourced investment will help us achieve the ability to hire the right talent with the appropriate capital. ', 202, 114, 657, '2014-11-04 02:38:02', '2014-11-04 02:38:02'),
(37001, 'Risks: talent pool for software devs is large but very competitive. We would need to create a high value proposition to make our roles desirable, attainable and engaging to retain the talent. ', 202, 157, 657, '2014-11-04 02:38:56', '2014-11-04 02:38:56'),
(37002, 'Kissaah cannot develop and grow to be a high-revenue generating platform without a robust back-end and engaging front-end design. Therefore we need to hire talent to build Kissaah as a tool in order to build Kissaah as a profitable and strong business. ', 202, 184, 657, '2014-11-04 02:39:59', '2014-11-04 02:39:59'),
(37003, 'Utalising our current developer in a strategic way: continue to work with him and give him clear milestones, aid him in the testing process and provide feedback. ', 202, 59, 657, '2014-11-04 02:40:40', '2014-11-04 02:40:40'),
(37004, 'I will be expected to manage our software developer effectively and efficiently: keeping an eye on his time and therefore expenditure on him as a resource. From the developers perspective, I am expected to be understanding of his role, what each tasks really translates to in terms of his efforts and to always ask "is this feasible?" and aid him in making something feasible if it''s not, by providing the best resources keepign in mind budget and time constraints. ', 202, 60, 657, '2014-11-04 02:42:12', '2014-11-04 02:42:12'),
(37005, 'I have managed software teams before, so my Kissaah team can be assured that I can bootstrap development. Our developer is also aware of my experience, and understands that I am always looking for the most efficient strategy to a solution to implement bug fixes or be it, new features. ', 202, 118, 657, '2014-11-04 02:43:33', '2014-11-04 02:43:33'),
(37006, 'I will need my Kissaah team and I to agree on priority projects for front and back end development with the time and funds we have, keeping strongly in mind that there are some features, as much as we like them, that have to come later in the pipeline as other perhaps less exciting areas of development have to be put in place to create a robust back-end. ', 202, 115, 657, '2014-11-04 02:44:45', '2014-11-04 02:44:45'),
(37007, 'N/A', 202, 116, 657, '2014-11-04 02:44:48', '2014-11-04 02:44:48'),
(37008, 'Relevant members of the Kissaah team will help me reach this goal by aiding me in the agreement of the development pipeline once a month, and giving their time being part of the evaluation process of developed back-end and front-end features, as well as some testing regarding bug fixes. ', 202, 117, 657, '2014-11-04 02:50:38', '2014-11-04 02:50:38'),
(37009, 'We risk a mis-alignment in expectations of development with the one developer we have right now: for instance, different tasks will always take priority over the other as our commercial business may perhaps change focus, or we may wish to level up tasks on the priority list in light of specific audiences we''re trying to show Kissaah to. This can be avoided by making changes to priority lists minimally, and to have enough advanced warning to make changes to priority projects which may already be in the development process. ', 202, 119, 657, '2014-11-04 02:52:48', '2014-11-04 02:52:48'),
(37010, 'Without some of the features in our pipeline being created, Kissaah may risk being seen as not as high of value to potential clients as it should be. We need certain features in place asap in order to be of value to the individual user which will aid the corporations that pay for their usage of Kissaah. ', 202, 185, 657, '2014-11-04 02:53:53', '2014-11-04 02:53:53'),
