INSERT INTO `prod_answers` (`id`, `answer`, `user_id`, `configure_id`, `user_game_status_id`, `created`, `modified`) VALUES
(38199, 'eaafd2989aac52c544c0c998c306c1e5.jpg', 149, 91, 502, '2015-01-18 07:51:07', '2015-01-18 07:51:07'),
(38200, 'c5286eaa0bdf218af8b4a7ab78cfc024.jpg', 149, 92, 502, '2015-01-18 07:51:07', '2015-01-18 07:51:07'),
(38201, 'f4d5a5b1647e7fd88b86834ef6c04785.jpg', 149, 93, 502, '2015-01-18 07:51:08', '2015-01-18 07:51:08'),
(38202, 'sg-ed672188', 149, 94, 502, '2015-01-18 08:17:08', '2015-01-18 08:17:08'),
(38203, 'sg-a9743fcc', 149, 95, 502, '2015-01-18 08:17:12', '2015-01-18 08:17:12'),
(38204, 'sg-3088c355', 149, 96, 502, '2015-01-18 08:17:17', '2015-01-18 08:17:17'),
(38205, '617236be032691d7f4a1e727963892ed.jpg', 149, 98, 502, '2015-01-18 08:18:33', '2015-01-18 08:18:33'),
(38206, 'ece46f7bed7307e4afba9d6f0170fe33.jpg', 149, 99, 502, '2015-01-18 08:18:34', '2015-01-18 08:18:34'),
(38207, 'Environment conciousness', 149, 100, 502, '2015-01-18 08:18:34', '2015-10-15 22:26:25'),
(38208, 'Relationship', 149, 105, 502, '2015-01-18 08:18:45', '2015-01-18 08:18:45'),
(38209, 'Relationship', 149, 101, 502, '2015-01-18 08:18:45', '2015-01-18 08:18:45'),
(38210, 'Home', 149, 109, 502, '2015-01-18 08:18:49', '2015-01-18 08:18:49'),
(38211, 'Home', 149, 102, 502, '2015-01-18 08:18:49', '2015-01-18 08:18:49'),
(38212, 'Bones', 149, 103, 502, '2015-01-18 08:18:54', '2015-01-18 08:18:54'),
(38213, 'Kumar to Finch, 1 run, gets back and across and tucks the shortish delivery away towards midwicket ', 149, 44, 502, '2015-01-18 08:19:14', '2015-01-18 08:19:14'),
(38214, 'Kumar to Warner, 1 run, Rohit has a direct hit, but Warner is well home after a push towards mid-off. Decent throw off that angle, but despite being on the back foot Warner was immensely quick off the blocks ', 149, 45, 502, '2015-01-18 08:19:18', '2015-01-18 08:19:18'),
(38215, 'Kumar to Warner, no run, oof, did the ball clip off stump?! Or did it take the bottom of the bat? Definitely hit the bottom of the bat and it veers back towards the stumps, but misses it by a whisker!', 149, 46, 502, '2015-01-18 08:19:29', '2015-01-18 08:19:29'),
(38216, 'Mohammed Shami to Finch, no run, good length on off stump, Finch defends to mid-off and Shami walks back with a far better over under his belt. Had his pace up, had his radar right, just needs to reproduce it over and over and over', 149, 106, 502, '2015-01-18 08:21:24', '2015-01-18 08:21:24'),
(38217, 'Mohammed Shami to Finch, no run, 139 kph, has Finch in a spot of bother as he pings a shortish delivery down on off stump. Squares him up as the batsman uses an open face to run down to point ', 149, 107, 502, '2015-01-18 08:21:28', '2015-01-18 08:21:28'),
(38218, 'Mohammed Shami to Warner, 1 run, takes on the short ball, with the field set for it! Nearly carries all the way to Akshar at deep square leg.', 149, 148, 502, '2015-01-18 08:21:35', '2015-01-18 08:21:35'),
(38219, 'Mohammed Shami to Finch, 1 run, seems to get a bit of a bottom edge to a good length ball only a shade outside off. Single to deep third man', 149, 154, 502, '2015-01-18 08:21:47', '2015-01-18 08:21:47'),
(38220, 'Mohammed Shami to Warner, FOUR, one-legged pull to the square leg boundary, but this was the bowler''s mistake again. Bowling short with the new ball, bowling on leg stump with the new ball. No pressure on Australia now', 149, 149, 502, '2015-01-18 08:21:50', '2015-01-18 08:21:50'),
(38221, 'Mohammed Shami to Warner, FOUR, oh dear, that''s a terrible delivery to start off with. And Warner gleefully sends it away to the fine leg boundary. Short, way down leg and all the batsman had to do was help it away', 149, 150, 502, '2015-01-18 08:22:10', '2015-01-18 08:22:10'),
(38222, 'Mohammed Shami to Finch, FOUR, width offered and Finch accepts the present as he flays the fuller ball over mid-off. Powerful stroke', 149, 155, 502, '2015-01-18 08:22:20', '2015-01-18 08:22:20'),
(38223, 'Mohammed Shami to Warner, FOUR, despairing dive from Kohli at deep square leg, but Warner''s pull has too much heat on it. Shami errs by bowling short and a bit too straight', 149, 183, 502, '2015-01-18 08:22:25', '2015-01-18 08:22:25'),
(38224, 'Rohit Sharma asks for middle, Shikhar Dhawan is his partners. Australia unleash a Mitch on him. You, you and you, inswinger watch. Right now. Two slips in', 149, 110, 502, '2015-01-18 08:22:44', '2015-01-18 08:22:44'),
(38225, 'VPS: "Why all the fuss about Indian bowling?? With same Indian bowling, India won 2013 Champions trophy and India won most of the ODI series excluding few in last 3 years. It is not good in Test matches but ODI is totally different ball game." ', 149, 111, 502, '2015-01-18 08:22:56', '2015-01-18 08:22:56'),
(38226, 'Mantra: "Remember, the word ''experiment'' is not allowed in Indian cricket now." So how can you have processes without experiments? Get your lab coats straight, people', 149, 156, 502, '2015-01-18 08:23:03', '2015-01-18 08:23:03'),
(38227, 'India win the toss and will bat MS Dhoni says it''s a good drop-in pitch and that it will come onto the bat. Says it''s good to be back playing for India. Says India needs to concentrate on this tournament and change groove when the warm-ups happen for the World Cd up. Akshar Patel has been picked for India. And the quicks are Bhuvi, Umesh and Shami ', 149, 112, 502, '2015-01-18 08:23:08', '2015-01-18 08:23:08'),
(38228, 'Starc to Dhawan, OUT, edged and taken! Starc continues where he left off against England. It''s a teaser outside off and the fuller length drew Dhwan into that favourite cover drive of his. Except he doesn''t account for the outswing again. Thick edge flies towards Finch at slip, who takes it over his head ', 149, 113, 502, '2015-01-18 08:23:17', '2015-01-18 08:23:17'),
(38229, 'Sandhu to Rahane, OUT, nicked and taken. There''s that bounce that he seems to get and it bests Rahane''s intention to cut. Top strike for a first one, and it was brought about by the pressure created and sustained at both ends. There wasn''t enough room for the shot, but Rahane opted for it and pays the price ', 149, 114, 502, '2015-01-18 08:23:28', '2015-01-18 08:23:28'),
(38230, 'Faulkner to Kohli, OUT, so easily done! Kohli has perished to his own attacking intent. It was just a shade short, barely had room to free the hands. Short-armed pull came out and ends up as a top edge which is taken by the captain jogging in from mid-on. ', 149, 157, 502, '2015-01-18 08:23:48', '2015-01-18 08:23:48'),
(38231, 'Starc to Raina, OUT, he''s thrown it away! It was a fuller delivery outside off and Raina got on the front foot and hacked it straight at mid-on. And you know what happens when Australia get an opening..', 149, 184, 502, '2015-01-18 08:24:01', '2015-01-18 08:24:01'),
(38232, 'Starc to Sharma, OUT, caught on the edge of the circle, that is Starc''s fifth and it comes off his worst ball of the day - a full toss. Rohit was looking for quick runs, but his cow-corner club comes low off the inside half of the bat and picks out midwicket ', 149, 118, 502, '2015-01-18 08:24:26', '2015-01-18 08:24:26'),
(38233, 'Starc to Kumar, OUT, cleaned him up! that''s six! Changed the angle of delivery and came around the wicket to Bhuvi, the new batsman. It was full, it was speared in on middle. The batsman stayed beside the ball to open up the off side, but fails to connect with his shovel drive. Starc smile might as well translate as ''you miss, I hit'' ', 149, 115, 502, '2015-01-18 08:24:34', '2015-01-18 08:24:34'),
(38234, 'Starc to Rahane, FOUR, inside edge! That''s very lucky! It was a bit short, but Starc has not provided the width to justify that cut shot. So very close to off stump, and instead it runs off to the boundary', 149, 116, 502, '2015-01-18 08:25:12', '2015-01-18 08:25:12'),
(38235, 'Cummins to Sharma, SIX, lofted over the bowler''s head! Phew, when he does things like that it makes you sit up and hack for breath. Fuller delivery outside off stump and he wades into the front foot to secure a straight six. And the MCG is a pretty big ground, remember ', 149, 117, 502, '2015-01-18 08:25:23', '2015-01-18 08:25:23'),
(38236, 'Starc to Sharma, SIX, smacked for six! Short ball towards the batsman from the leg side, Rohit eyes it early and hammers it over the fine leg fielder with a pull for six ', 149, 119, 502, '2015-01-18 08:25:29', '2015-01-18 08:25:29'),
(38237, 'Faulkner to Sharma, SIX, so what does Rohit do? He flies down the pitch like a truck in a high speed chase and hammers a length ball handsomely over long-on to bring up his fifty. Emphatic', 149, 185, 502, '2015-01-18 08:25:34', '2015-01-18 08:25:34'),
