(38678, 'Distilling complex ideas into a simple form. I use both reverse engineering and reductive design to achieve my goals.', 988, 149, 1525, '2015-05-12 03:49:26', '2015-05-12 03:49:26'),
(38679, 'I currently have an accountability group where I participate every two weeks. We set goals and hold each other to accomplishing them.', 988, 150, 1525, '2015-05-12 03:50:35', '2015-05-12 03:50:35'),
(38680, 'I''ve recently rebooted my life. I went back to school a few years ago and decided to move forward with my interest in designing successful outcomes. I believe the design process can be applied in many different ways not just graphic design. After all I am a trained problems solver.', 988, 155, 1525, '2015-05-12 03:52:14', '2015-05-12 03:52:14'),
(38681, 'I am a design professional helping to tame complexity and present it in it''s simplest form.', 988, 183, 1525, '2015-05-12 03:53:26', '2015-05-12 03:53:26'),
