(39183, 'Creativity', 988, 100, 1540, '2015-10-05 07:39:40', '2015-10-05 07:39:40'),
(39184, 'Learning helps to over come mistakes and avoid unnecessary pitfalls. It opens my mind to the possibilities rather than the obstacles. ', 988, 106, 1540, '2015-07-16 09:13:09', '2015-07-16 09:13:09'),
(39185, 'Guidance, confidence, creativity, and a plan of action.', 988, 107, 1540, '2015-07-16 09:14:18', '2015-07-16 09:14:18'),
(39186, 'Over 25 years of applying problems solving methodology to many communication and business challenges.', 988, 148, 1540, '2015-07-16 09:15:28', '2015-07-16 09:15:28'),
(39187, 'Independence, mobility, trust, revenue.', 988, 154, 1540, '2015-07-16 09:16:13', '2015-07-16 09:16:13'),
(39188, 'I complete by being very direct and forthcoming. I challenge my clients and myself to think beyond the norms. I''m honest and easy to work with. I am great at finding the right talent for any project.', 988, 149, 1540, '2015-07-16 09:18:20', '2015-07-16 09:18:20'),
(39189, 'Colleagues, family, friends. I always look out for my family, friends and network. Helping others usually comes back two fold. Helping people succeed and to evolve.', 988, 150, 1540, '2015-07-16 09:21:50', '2015-07-16 09:21:50'),
(39190, 'I can lose site of my longterm goals by getting caught up in the small things from time to time. ', 988, 155, 1540, '2015-07-16 09:22:54', '2015-07-16 09:22:54'),
(39191, 'Working on this now.', 988, 183, 1540, '2015-07-16 09:29:51', '2015-07-16 09:29:51'),
(39192, 'Helping others is something I do naturally. I''ve found that people remember you and when they''re able they return the favor two to three fold.', 988, 110, 1540, '2015-07-16 09:31:33', '2015-07-16 09:31:33'),
(39193, 'Guidance and direction. They need me to assess the situation and come up with options that meet their needs.', 988, 111, 1540, '2015-07-16 09:33:04', '2015-07-16 09:33:04'),
(39200, 'Considering my goals are part of my personal and professional growth reaching goals helps to provide me with milestones.', 988, 59, 1540, '2015-07-17 01:01:12', '2015-07-17 01:01:12'),
