(39447, 'My husband, a man who loves me honestly and openly, a true companion.  My Family...sisters mother etc.   I have a few close friends, my college friends and those I''ve met in SF, and while we may not talk everyday or live in the same neighborhood we find time to connect and support one another. \r\n', 1104, 45, 1547, '2015-09-14 09:23:14', '2015-09-14 09:23:14'),
(39448, 'Running my own small business selling home goods/decorations (inspired by African and other ethnic art). Or a pottery making and painting shop.  \r\nEnjoying my travels with my husband.  Supporting him in his career in endeavours. \r\nMaintaining my hobby as a potter.\r\nIf not fully supported by my business yet, I will full-time work with an international company in the field of intellectual property policy or operations management.\r\nMy husband and I will start a family. \r\n', 1104, 46, 1547, '2015-09-14 09:23:42', '2015-09-14 09:23:42'),
