(40636, 'The alchemist image makes me think about the impact this book has had on my life.  I feel lucky to have found and shared it w/ soo many great people furthuring the impact it''s had on me.  I want to be conscious of my own personal legend and that I should choose my path.', 1207, 24, 1601, '2015-11-09 03:39:14', '2015-11-09 03:39:14'),
(40637, 'Exercise broadly describes a self improvement practice that has a huge impact on my life.  Minimizing my anxiety, increasing my self-esteem and giving me vital energy to do more.  I feel empowered and motivates knowing I can do more.  I want to learn to develop physical and mental attributes in unison without sacrificing one for another.', 1207, 26, 1601, '2015-11-09 03:40:57', '2015-11-09 03:40:57'),
(40638, 'I think teaching is an innate human behavior that brings everyone joy.  I feel connected when I''m prepared to teach and am open with my students.  I want to keep pushing my self to get better at teaching by try new and some times risky strategies in my teaching.', 1207, 27, 1601, '2015-11-09 03:42:13', '2015-11-09 03:42:13'),
