(40854, 'Helping others win', 1234, 13, 1631, '2016-02-10 22:41:49', '2016-02-10 22:43:59'),
(40855, 'Travel to Exotic Locations', 1234, 14, 1631, '2016-02-10 22:42:05', '2016-03-14 19:48:21'),
(40856, '7ae6bb750ce3655672ec7a7244fb4ff0.jpg', 1234, 3, 1631, '2016-02-10 22:42:10', '2016-02-10 22:42:10'),
(40857, '91991e1df84c92e658e96906ad377bea.jpeg', 1234, 4, 1631, '2016-02-10 22:42:18', '2016-02-10 22:42:18'),
(40858, 'Adventures pushes me out of my comfort zone.  I feel that this new job will enable me to think outside of the box, pushes me forward in my learning that yields a sense of accomplishment.  Since I truly value adventure, I think I will love doing new things and meeting new people', 1234, 24, 1631, '2016-02-10 22:43:47', '2016-05-12 00:08:26'),
(40859, 'Helping others win has always been a great passion for me.  In my previous job, I helped one of our customers, using our software, to gain a very large contract with their customer.  All I could think of was how happy they were.  I felt so on top of my game and fulfilled.  I wanted to celebrate with this customer and then find the next customer I could help win.', 1234, 26, 1631, '2016-02-10 22:43:56', '2016-04-11 06:16:49'),
(40860, 'Adventure is in my blood.  My financial means have limited me to North America in my travels so far, and I long to travel to amazing places like the Hotel Kasbah du Toubkal near Marrakesh in Morocco where we could have an incredible corporate retreat.  Thinking about travel like this makes me want to be very successful so I can afford the time and cost to do so.  I feel so small when I think of the many many places around the world for an incredible journey.', 1234, 27, 1631, '2016-02-10 22:46:40', '2016-04-11 06:17:58'),
